INSERT INTO `t_jobdata` VALUES ('1', '智慧信息化行业技术总工（博士）', '35-50k', '广州', '广东省电信规划设计院有限公司', 'https://www.liepin.com/job/1939682225.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=0&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=0', '广州', '大数据', '35000.00', '50000.00', '42500.00', '职责描述：\r\n1、负责目标市场智慧信息化相关业务（智慧城市、大数据、云计算、物联网、IDC、IT信息化系统等）的售前支撑工作；\r\n2、协助部门领导做好目标市场项目实施监督管理，负责重大项目技术支撑、交付工作；\r\n3、负责部门智慧信息化相关专业技术能力提升和项目团队人员的培训工作；\r\n4、完成领导交办的其他任务。\r\n任职要求：\r\n1、博士研究生学历，计算机科学与技术、通信工程、软件工程、物联网、大数据、云计算等相关专业，具有智慧信息化行业相关项目经验，3年以上工作经验；\r\n2、具有优秀的数据、信息搜集能力和分析能力、具有较强的文字表达和政策研究能力；\r\n3、思路清晰，具有较强沟通协调能力，有行业数据分析经验者为佳；\r\n4、富有责任心、创新精神和团队合作精神，能够承受相应工作压力；\r\n5、熟悉通信行业，有政府、企业、行业相关客户资源或渠道关系者优先。\r\n');
INSERT INTO `t_jobdata` VALUES ('2', '项目经理', '8-15k·16薪', '贵阳-观山湖区', '云上贵州大数据产业发展有限公司', 'https://www.liepin.com/job/1911572420.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=2&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=2', '贵阳', '大数据', '8000.00', '15000.00', '11500.00', '岗位职责：\n1.全面负责公司软硬件项目的实施交付；\n2.负责公司软硬件项目技术方案的编写、标书的准备、讲解及用户答疑等工作；\n3.负责沟通客户需求，制定软硬件项目推动计划，并组织实施；\n4.负责项目整体网络架构建设的实施、部署和运维，保障项目网络和专线网络/业务网络运行的稳定；\n5.负责系统架构设计、云平台管理以及对接业务系统的架构设计、环境搭建以及后期的系统运维工作。\n\n任职资格：\n1.5年以上IT项目实施工作经验，大学本科及以上学历，计算机相关专业；\n2.具有信息系统高级项目经理/PMP相关证书者优先； \n3.独立实施管理过中大型的系统集成项目，并组织验收及回款，有政府行业经验优先； \n4.系统掌握项目管理相关的知识体系结构，熟练使用项目管理相关工具，具有技术方案、项目计划编制的能力，良好的计划和执行能力、协调能力和人际沟通能力； \n5.能识别风险和有效地规避风险，协调相关资源，监控项目实施的范围和进程； \n6.有较强的学习能力，能够承受较高的工作压力； \n7.具备信息系统架构设计、系统分析、业务梳理、项目管控、软件开发或系统集成相关知识技能；\n8.具备良好的沟通交流能力、良好的团队协作精神、能够吃苦耐劳，求知欲强，学习能力强、责任心强、能够承受较高的工作压力。');
INSERT INTO `t_jobdata` VALUES ('3', '大数据总监', '60-90k·15薪', '北京-西城区', '硕磐智能', 'https://www.liepin.com/job/1951424909.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=3&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=3', '北京', '大数据', '60000.00', '90000.00', '75000.00', '职责描述：\n1、负责数据平台团队建设，包括数据方案设计、团队搭建和人员培养等；\n2、负责前瞻性的规划未来数据平台的发展，高效赋能业务；\n3、深度理解各个业务方向数据诉求，负责大数据体系建设，构建行业先进的数据基础设施和数据应用体系；\n4、负责在数据方向遇到的技术问题攻坚，开放性的解决元数据处理、数据治理、数据存储、数据传输、数据展示、数据分析等多维度的数据问题；\n5、立足公司现有产品技术基础，负责面向未来的智能大数据产品、技术创新突破。\n\n任职要求：\n1、全日制大学本科及以上学历,不少于8年以上大数据开发工作经验，5年以上技术管理经验；\n2、精通Hadoop、Flink、Kafka、Spark、Redis、Hive、Zookeeper等大数据相关技术，并能结合业务场景进行架构设计和模型建设，参与或主导过大数据平台建设, 有TOB大数据项目经验者优先；\n3、精通Java，多线程编程、消息系统、数据库、分布式系统，对微服务架构有较深的理解，常规框架能够了解其原理并熟练使用；\n4、熟悉高可用、高并发、高性能的分布式系统的设计及应用，有丰富的线上调优经验；\n5、了解机器学习、深度学习、图数据库、时序数据库等相关技术；\n6、喜欢尝试新技术，关注新的技术方向，能够平衡好业务的需求和技术团队成长之间的关系，并能从技术趋势和设计思路上辅助产品工作。');
INSERT INTO `t_jobdata` VALUES ('4', '大数据开发工程师', '18-28k', '深圳-南山区', '睿服科技', 'https://www.liepin.com/job/1947988709.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=4&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=4', '深圳', '大数据', '18000.00', '28000.00', '23000.00', '技能要求：\r\n1、有大数据离线或实时项目经验，对数据采集、数据处理、数据建模、数据分析有一定的认识和实战经验；熟练掌握Hadoop、Hive、HBase、Spark、Flink、ES等至少3种大数据相关技术组件。\r\n2、熟练掌握SQL，熟悉Java，了解Python或Scala语言优先。\r\n3、3年及以上IT开发相关工作经验，专科及以上计算机相关学历。\r\n认真仔细、踏实肯干，有上进心和求知欲，善于学习和运用新知识，善于思考分析，善于沟通和逻辑表达，有团队意识和执行力。\r\n4、要求会英语，粤语良好。\r\n工作内容：\r\n1、参与投顾平台基于TBDS大数据平台，根据业务所需的大数据相关离线或实时任务的采集、计算与调度的设计开发；\r\n参与日终或实时调度的监控、优化；：');
INSERT INTO `t_jobdata` VALUES ('5', '大数据开发工程师', '13-25k', '深圳-南山区', '广西崇亿资产管理有限公司', 'https://www.liepin.com/job/1951223599.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=5&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=5', '深圳', '大数据', '13000.00', '25000.00', '19000.00', '岗位概述 \n1、有参与数仓搭建经验优先\n2、熟练并掌握主流数据库，能独立设计数据库各层的设计                      \n教育背景要求 大专及以上         \n                                                          \n工作经验，3-5年                                                  \n知识与技能 1、深入理解常用的数据建模理论，可独立把控数据仓库各层级的设计。\n2、三年及以上建模开发经验，有供应链相关建模经验的优先。\n3、熟悉Hive、Spark Sql开发及调优，熟悉传统和大数据数仓架构，了解关系型数据库，对离线大数据有自己的了解。有使用过kettle、finereport等组件。\n4、熟悉hadoop/hive/flink/ES等大数据生态技术栈，具备良好的数据敏感度，具备海量数据开发和调优的能力。\n5、具备快速学习、沟通协调能力及团队精神，有较强的责任心、主动承担性和一定的抗压能力。\n其他 善于沟通，理解能力强，较强的学习能力，有多年报表开发经验优先\n\n');
INSERT INTO `t_jobdata` VALUES ('6', '商务总监（汽车大数据/AI方向）', '40-70k', '深圳-南山区', '浙江吉利控股集团', 'https://www.liepin.com/job/1950888187.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=6&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=6', '深圳', '大数据', '40000.00', '70000.00', '55000.00', '职责描述：\n\n岗位职责：\n负责汽车行业客户的管理合作与业务拓展。了解行业的发展及客户业务需求，结合公司解决方案和交付资源进行大客户的拓展，进行调研、目标策略计划制定、合作推进、商机拓展、招投标、商务谈判、合同签订、合同执行督促、催讨应收销售款项等商务管理活动。 \n负责大客户关系维护及项目协调。实时掌握和了解客户合作情况，协调公司资源解决问题和优化服务，提升大客户的满意度和忠诚度 。 \n经营行业生态圈，通过市场覆盖、合作伙伴、组织市场活动等工作，宣传公司的品牌，传达公司的行业价值，商机拓展及客户覆盖，扩大公司产品的市场份额。 \n关注汽车大数据市场和产品动向，收集营销信息和用户意见，配合公司运营、产品、技术团队挖掘新产品及探索更符合公司商业模式，对公司营销策略、市场推广、产品解决方案的改进与开发等提出参考意见。 \n根据公司战略，产品规划和业绩指标，拟定产品销售策略，完成销售目标；负责公司销售团队的打造、管理和优化。 \n\n任职条件：\n本科及以上学历，5年以上大数据、AI、云服务或汽车软件开发等相关产品和解决方案的行业销售经验，有汽车行业工作背景或者资源者优先。 \n具备在中小型Al科技公司从事过ToB、ToG产品的商务拓展经验，熟悉ToB或ToG产品的销售流程和策略。 \n优秀的口头和书面沟通能力、产品宣讲和解决方案能力；沟通协调能力强，能够有效推动内外部合合作伙伴和团队协同工作。 \n积极主动，具备敏感的商业意识，能快速了解公司产品并对市场做出分析与判断。较强的市场开拓，需求拓展，商务实操（招投标、合同商务等），商务谈判和项目进度控制能力。 \n具备高度的工作热情、自律性强、良好的团队合作精神 。 \n熟悉云服务、推荐系统、大数据技术体系、汽车钥匙等相关技术者优先。\n');
INSERT INTO `t_jobdata` VALUES ('7', '蚂蚁集团-大数据质量高级专家', '50-80k·16薪', '上海-浦东新区', '蚂蚁集团', 'https://www.liepin.com/job/1951489725.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=7&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=7', '上海', '大数据', '50000.00', '80000.00', '65000.00', '职责描述：\n1、 负责整体蚂蚁业务域的大数据质量与技术风险， 及业务数据评测体系的建设, 整体牵头数据质量保障，持续提升测试技术、工具和平台创新；\n\n2、 能够快速拉通大中型项目测试体系建立、测试流程、测试实施、质量和风险控制；\n\n3、 推进和改进在大数据的测试能力提升，具体业务上（数据分析， 埋点，返佣，数据产品保障等）方向进行全局性技术风险的判断和持续打磨；\n\n4、 熟知数据质量标准打法，以及分析及测试工具的研发， 有大型企业级数据资产管理质量和整体运维风险治理方向的相关经验；\n\n4、 熟知互联网敏捷流程和分级测试，灰度发布，A/B测试，把握测试进度把控，具有控制项目测试风险、预防能力；\n\n5、 能够推动整个研发团队的质量意识，提升研发效能，在保障质量的同时提升研发效率；\n\n6、 带领中大型质量团队进行不断技术深度及宽度深耕。\n\n任职要求：\n1、有五年以上数据及AI类的测试开发工作经验；能通过新的技术手段来保障和改进产品质量 ；\n\n2、深入掌握在大数据体系的的测试全局性体系、测试流程和测试技术，能通过测试技术提升研发效能；\n\n3、独立承担并带领过大型项目的测试或者开发负责人，能够通过有效的手段、流程和方法推进产品测试开展，把控产品质量及验收；\n\n4、精通功能测试方法和设计，掌握单元测试，接口测试，性能测试，持续集成等测试手段；\n\n5、良好的沟通能力和团队协作能力。能从整个研发的角度出发，对研发流程和研发效率的改善提出落地方案；\n\n6、有Owner意识， 能够从owner角度出发倒推整个产品线改革及进步。');
INSERT INTO `t_jobdata` VALUES ('8', '主任大数据应用工程师', '25-50k', '西安-高新区', 'BYD', 'https://www.liepin.com/job/1947429401.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=8&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=8', '西安', '大数据', '25000.00', '50000.00', '37500.00', '职责描述：\r\n1.针对整车性能大数据挖掘、数据分析体系开发，负责运行数据的分类汇总、分析研究和数据建模；\r\n2.根据整车性能大数据完成较深入的专项数据分析，并形成数据分析报告；\r\n3.负责对车辆大数据进行整合、分析挖掘，挖掘用户行为特征，为产品设计、性能开发提供数据支持；\r\n\r\n\r\n任职要求：\r\n1. 统计学、数学、经济学、车辆工程、电气工程等相关专业，扎实的机器学习或数据挖掘理论和技术基础，具有相关领域较深入的技术应用的经验和能力；\r\n2. 熟悉汽车工作原理，有汽车研发经验的优先；\r\n3. 至少熟练使用R、MATLAB、PYTHON中的一种，熟悉常用数据统计和分析方法；\r\n4. 良好的沟通能力、团队合作精神、工作规划能力和主动意识；\r\n');
INSERT INTO `t_jobdata` VALUES ('9', '运维工程师', '15-25k', '上海-浦东新区', '蓝想大数据科技(上海)有限公司', 'https://www.liepin.com/job/1950902241.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=9&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=9', '上海', '大数据', '15000.00', '25000.00', '20000.00', '职责描述：\n1.云桌面系统的日常维护。\n2.公司内部设备的运维。\n3.日常服务器故障解决。\n4.mysql、redis、Mongodb、sqlserver等数据库备份、迁移、恢复等。\n5.nacos、SeaTa、xxadmin、maven、Mino等中间件的维护及日常故障解决；\n6.公司微服务项目部署、调试。\n\n\n\n任职要求：\n1. 精通  Kubernetes 集群，Kubeadm 高可用，和二进制部署 Kubernetes 以及资源对象管理和创建，EFK 容器日志收集。\n2. 精通 Docker 虚拟化平台，熟悉 Dockerfile 构建镜像，和 Docker-compose 管理集群。\n3. 熟悉exis系统，Vceter集群架构。\n4. 熟悉horzin云桌面系统。\n3. 熟悉 Harbor 仓库和部署搭建。\n3. 熟悉 MySQL 数据库的基本 SQL 语句，掌握 MySQL 主从复制原理及配置，掌握 MySQL 数据 库的备份及恢复从而实现主从复制，读写分离。\n4. 熟悉 Jenkins 服务平台搭建部署，GIt 版本库的搭建部署，利用 Git 实现服务自动化上 线，实现 Jenkins 自动化构建项目运用。\n5. 熟悉 LVS，Haproxy，Nginx 前端代理服务，可实现 LVS+Keepalived 以及 Nginx 反向代 理，复制均衡，动静分离结构部署。\n6. 熟悉 Redis Sentinel 非关系型数据库，搭建部署主从复制及哨兵集群和 Cluster 集群。\n7. 熟悉 zibbix 监控平台的搭建及使用，配置服务自动发现。 \n8. 熟悉阿里云相关技术，具有云产品相关经验 。\n9. 熟悉 shell 脚本或者python，可编写监控，备份脚本。\n10.了解 Ansible 常用模块。');
INSERT INTO `t_jobdata` VALUES ('10', '数据中台产品经理、大数据产品经理', '25-50k', '上海-黄浦区', '国控数科', 'https://www.liepin.com/job/1948525697.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=10&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=10', '上海', '大数据', '25000.00', '50000.00', '37500.00', '职责描述：\n职责描述：\n（1）负责调研和挖掘业务需求，深入理解公司业务场景，开展数据类产品的规划、设计和落地，探索基于数据分析的商品运营、风险控制、经营决策，为经营、管控、决策提供数据赋能；\n（2）负责指标体系的梳理、分解，建立指标体系的标准化清单，规范指标数据的全生命周期管理；\n（3）负责撰写和输出产品规划书、产品需求文档、产品原型、测试用例等文档，与架构师、开发团队协同共同完成产品方案设计；\n（4）负责推动和跟进大数据产品的全生命周期管理，把控产品开发进度和质量，推进产品广泛应用，持续开展产品应用效果评估，完善产品迭代和演进；\n（5）负责数字类产品的应用推广，引导和培育业务、运营团队的数据文化，培养业务部门的数据分析师队伍，使其能够利用数据分析工具开展自助分析；\n（6）基于数据分析成果，输出业务改进建议、业务系统优化建议，丰富和优化数据资产目录、分析指标体系。\n任职要求：\n（1）具有较强的数据敏感度和洞察力，善于利用数据发现问题、寻找解决方案；\n（2）熟练掌握产品设计、数据开发方法论，并应用于大数据产品设计与开发实践；\n（3）能够熟练使用Axure、Mind Manager、xMind、Visio等产品设计工具，Python、Tableau、帆软、永洪等数据分析软件；\n（4）熟悉大数据平台相关技术，了解Hadoop框架和技术体系，能够熟练使用T-SQL语句，熟悉数据采集及集成、数据建模、数据开发、数据治理等数据分析相关工作；\n（5）熟悉常用的数据挖掘算法，如逻辑回归、决策树、关联规则、序列模式、时间序列等；\n（6）具有医药流通行业相关工作经验优先考虑。\n\n全日制大学本科以上学历，计算机、管理信息系统、数学、统计学、药学等相关专业；3年以上工作经验，具备医药行业数据分析产品设计经验优先考虑。');
INSERT INTO `t_jobdata` VALUES ('11', '大数据开发工程师', '15-25k', '上海-浦东新区', '兴业数金', 'https://www.liepin.com/job/1949633407.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=11&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=11', '上海', '大数据', '15000.00', '25000.00', '20000.00', '职责描述：\n\n1. 进行数据相关开发工作，包括元数据定义和管理、各渠道数据采集和处理、ETL系统建设、实时计算实现等。\n2. 进行高性能、高灵活性的数据指标系统设计和开发。\n3. 负责各业务报表的设计和开发\n4. 进行大数据平台其他Java开发工作。\n\n任职要求：\n1、有Java开发及大数据平台应用开发经验优先。\n2、熟悉SQL语言和数据仓库开发。\n3、 熟悉数据采集、清洗入库、统计计算等要点，实现指标计算需求；\n4、熟悉至少一种大数据框架，如 Hadoop/YARN、Hive、Spark、Storm、Kafka、CDH、TDH、TiDB等。\n5、具备较扎实的理论基础和工程能力，至少熟悉Java, Python等一种开发语言，熟悉任务调度平台。\n6、 具备良好的沟通和团队协作能力，能快速响应客户需求。\n7、学历需本科及以上（统招），本科211/985院校，研究生学历不做院校限制。\n\n');
INSERT INTO `t_jobdata` VALUES ('12', '大数据分析经理', '30-50k·22薪', '上海-浦东新区', 'ATL', 'https://www.liepin.com/job/1946334453.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=12&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=12', '上海', '大数据', '30000.00', '50000.00', '40000.00', '岗位职责:\r\n1.负责公司工业数据分析、算法和系统开发业务\r\n 2.承担数据化的业务调研、需求分析，并规划定制化技术解决方案\r\n 3. 负责智能制造大数据分析规划. 架构和方案设计，开发数据清洗、分析的模型，构建业务的方案。包括但不限于基于应用场景的大数据分析规划. 设计. POC，人工智能应用技术研究和应用场景规划和设计，大数据分析规划和方案设计\r\n 4.负责公司数据分析和应用能力的建设\r\n任职要求\r\n1、理工科专业，硕士以上学历，熟悉制造业的工业场景。 \r\n2. 5年以上大数据系统开发经验，主导过工业大数据项目。\r\n3、熟练掌握大数据技术，熟悉数据架构、数据治理、机器学习、数据建模等\r\n4、熟悉主流的大数据分析的算法和应用；熟练掌握Python、R等开发语言，熟悉JMP，SAS等分析工具。 5、有丰富的项目管理、团队管理经验。');
INSERT INTO `t_jobdata` VALUES ('13', '大数据产品解决方案Leader', '90-120k·16薪', '北京', '某知名公司', 'https://www.liepin.com/a/38859211.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=13&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=13', '北京', '大数据', '90000.00', '120000.00', '105000.00', '职位描述\n1、与销售、行业解决方案等团队一起，在售前交流、技术方案设计、招投标等工作上，为客户及合作伙伴提供大数据产品及相应解决方案的支持；\n2、将客户业务需求转换为大数据产品技术方案，针对具体项目规划大数据信息架构顶层设计，并为客户提供业务咨询及技术咨询服务；\n3、规划数据产品的矩阵结构，打通和优化多个数据产品的产品架构，为客户提供一致的用户体验，包括增长营销类数据产品，数据中台类产品，大数据引擎产品等；\n4、为客户提供远程或现场技术支持，协助客户完成项目规划、架构设计和产品PoC测试。\n职位要求\n1、5年以上大数据领域售前或产品经验，熟悉相关领域的产品、解决方案和系统建设方法；2年以上管理经验；本科及以上学历；计算机及相关专业优先；\n2、具有良好的数据驱动业务视角，逻辑思维能力和快速解决问题能力，能够在复杂的客户场景中迅速帮助客户定位问题并提出可行的解决方案；\n3、熟悉大数据生态环境， 精通大数据分布式系统（Hadoop、Spark、MPPDB等）的架构原理、技术设计及应用开法及调优；\n4、具有面向行业的大数据项目经验(泛互联网、运营商等)，对行业知识和业务架构有整体深刻理解；\n5、优秀的沟通能力，执行力强，客户服务意识，跨团队协作和项目推动能力。');
INSERT INTO `t_jobdata` VALUES ('14', '大数据开发工程师', '15-30k', '成都-高新区', '民生科技有限责任公司', 'https://www.liepin.com/job/1948896957.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=14&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=14', '成都', '大数据', '15000.00', '30000.00', '22500.00', '职责描述：\n（1）负责数据平台相关应用开发，平台建设、优化和维护。\n（2）负责数据存储、数据仓库、数据接口、离线和实时计算应用的设计、开发和维护工作。\n（3）调研和跟进大数据平台的技术发展趋势。\n（4）编写和维护开发规范等文档。\n任职要求：\n（1）全日制本科及以上学历，计算机、通信、数学等相关专业毕业，至少1年以上开发经验。\n（2）熟练掌握 Java、Scala 语言以及 IO、多线程、集合等基础知识，编程能力扎实。\n（3）对 Apache Hadoop 生态体系有比较全面的了解，如 HDFS、YARN、Spark、Hive、HBase、Spark 等，熟悉其中两种以上，并了解其原理。\n（4）熟悉图数据库（如 Neo4J）者优先，有推荐、用户画像等实战经验者优先。\n（5）热爱软件开发和coding，有良好的团队合作意识和沟通能力，具有强烈的责任心和一定的抗压能力\n（6）有资金管理或相关金融项目经历优先');
INSERT INTO `t_jobdata` VALUES ('15', '科技信息部-大数据工程师', '20-40k', '成都-青羊区', '中国太平', 'https://www.liepin.com/job/1947215735.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=15&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=15', '成都', '大数据', '20000.00', '40000.00', '30000.00', '工作职责:\r\n1、负责数据模型需求和数据应用需求的调研分析，进行数据模型和数据应用的设计、开发、测试、上线等工作；  \r\n2、负责建立规范化、稳定可靠的数据体系；\r\n3、负责大数据生命周期管理系统的架构评估和设计\r\n4、负责大数据平台日常监控与维护。\r\n\r\n任职资格:\r\n1、本科以上学历，5年以上大数据相关工作经验； \r\n2、拥有基于大数据平台的数据应用和数据仓库设计实施经历，具有优秀的业务分析和洞察能力以及丰富的业务数据应用经验；\r\n3、熟悉Hadoop体系结构、对Hadoop生态系统有较全面了解，熟悉Spark、Hive、Impala、Flink、HDFS、YARN、Kafka等，熟悉部分框架底层源码者优先； \r\n4、精通SQL，能够快速使用SQL实现业务逻辑，熟悉数据库系统，包括Oracle、MySQL、Elasticsearch、HBase等。');
INSERT INTO `t_jobdata` VALUES ('16', '大数据总监', '150-180k·15薪', '北京', '某知名互联网公司', 'https://www.liepin.com/a/38175665.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=16&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=16', '北京', '大数据', '150000.00', '180000.00', '165000.00', '工作职责：\n1、负责整个数据管理体系的规划及建设，从整个体系流程、制度、工具、平台等所有能力上保障公司数据相关工作的稳定、安全、可靠、合规。\n2、负责大数据工具平台的规划建设、架构设计，并在工作中根据业务发展不断提升团队、平台的水平和效率。\n3、基于数据驱动，统筹公司级数据产品、数据治理和数据资产管理等相关工作，为业务提供数据价值。\n4、根据互联网行业内前沿大数据技术方向和公司业务发展，制定大数据底层平台的技术演进图，把握技术发展方向，推进公司大数据中台的建设。\n5、负责团队部门的日常技术管理工作以及部门人员的统筹规划，加强团队成员培养和技能提升。\n任职要求：\n1、学历要求：优秀学校本科以上学历、计算机、软件信息相关专业，硕士优先。\n2、经验要求：10年以上数据平台、数据体系建设等相关工作经验，作为项目负责人参与过数据中台能力建设或数据体系搭建的相关经验，有过3年以上80人以上团队管理经验。\n3、技术要求：\n（1）熟练掌握数据体系建设的各个环节，深入理解数据质量管理、数据标准管理、企业级数据建模、主数据管理等方法。\n（2）熟悉大数据生态Hadoop、Hive、HBase、Spark、Storm、Flink等开源平台者优先。\n（3）有五百强中大型金融行业、消费金融、银行零售业及大型数据平台建设经验者优先。\n4、通用要求：\n（1）具有较强的用户思维和业务导向思维。\n（2）具有较强的分析和解决问题的能力，良好的学习能力和团队合作精神，追求价值实现，认同目标管理。\n（3）为人诚信，具有高度的责任心，工作主动积极，善于管理和培养开发队伍，能承担工作压力。\n（4）认同拼搏价值体现的企业文化，愿意付出额外的时间为目标奋斗。\n（5）在技术方面具备钻研精神，能传授团队先进的技术。');
INSERT INTO `t_jobdata` VALUES ('17', '大数据开发工程师', '15-23k', '深圳-南山区', '天虹数科商业股份有限公司', 'https://www.liepin.com/job/1948481947.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=17&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=17', '深圳', '大数据', '15000.00', '23000.00', '19000.00', '岗位职责：\n1、负责数据仓库用户画像建设和标签数据开发；\n2、负责基于海量用户的服务系统开发，提供稳定的在线/离线服务。\n岗位要求：\n1、大学本科及以上学历，计算机相关专业或有相关职位经验；\n2、3年以上互联网大数据研发经验，熟悉大数据相关技术，包含但不限于Flink/Hadoop/Hive/Sqoop/ElasticSearch/Redis/EFK/Kafka/Spark/Impala/Kudu/Kylin等分布式计算/存储/索引等框架；\n3、掌握SQL、HiveSQL、SparkSQL进行数据开发，有较好的性能调优经验，同时有Spark/Spark Streaming开发经验者优先考虑；\n4、掌握Java/Python/Scala其中一种或多种开发语言；\n5、实际工作中使用Flink的可优先考虑；\n5、有一定的算法基础，具备机器学习/数据挖掘实际工作经历者可优先考虑；\n6、有用户画像数据架构设计和标签研发经验者可优先考虑；\n7、热爱技术，主动思考，有责任感，有很好的数据/技术敏感度、全局意识。\n');
INSERT INTO `t_jobdata` VALUES ('18', '商务经理（大数据方向）', '10-15k·15薪', '广州-黄埔区', '科学城信科集团', 'https://www.liepin.com/job/1951494233.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=18&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=18', '广州', '大数据', '10000.00', '15000.00', '12500.00', '职责描述：\n1.有大数据运营、大数据售前方面的经验，挖掘客户需求，设计解决方案；\n2.跟踪大数据在智慧政务、智慧城市、智慧医疗等大数据领域的应用发展趋势，参与、撰写售前方案等材料；\n3.支持大数据行业应用相关重大项目的售前咨询，推进大数据行业、咨询等项目执行落地；\n4.及时跟进、分析、研究国家有关政策，推动参与制定行业规范、标准，参与产品规划设计；\n\n任职要求：\n1.3年以上大数据领域或智慧城市相关领域工作经验；\n2.熟悉大数据领域，了解政务、智慧城市、智慧园区、智慧医疗、工业互联网等业务场景；\n3.执行能力强、工作细致认真、责任心强、有较强的服务意识；\n4.工作条理性、逻辑性强，具有良好的职业素养和职业操守；\n5.熟练掌握常用办公软件（word、PPT、excel等），具备一定的文字功底。\n');
INSERT INTO `t_jobdata` VALUES ('19', '大数据架构师', '25-40k', '北京-朝阳区', '阳光保险集团', 'https://www.liepin.com/job/1951409691.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=20&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=20', '北京', '大数据', '25000.00', '40000.00', '32500.00', '职责描述：\n1、负责大数据方向的架构设计，结合实际业务情况进行技术选型；\n2、负责数据仓库的架构设计、数据模型设计、数据库性能优化等全流程数据库管理工作；\n3、深入研究大数据相关技术和产品、保持技术创新，跟进业内先进技术；\n4、负责大数据中台产品得规划和设计开发，参与数据开发规范制定。\n\n任职要求：\n1、有过数据中台设计和实施经验，熟悉数据中台理念和搭建方式者优先；\n2、6年以上数据相关工作经验，参与过大型数据仓库架构设计、模型设计者优先；\n3、对Hadoop生态下的大数据体系有深入认识，对Hadoop、Hive、HBase、Spark、Flink、Kafka、ES等有实际应用研发经验；\n4、很强的学习、分析和解决问题能力，良好的团队意识和协作精神，有较强的内外沟通能力；\n5、有数据工厂、实时数仓、流式计算、网站分析、等类型产品的开发经验优先。\n');
INSERT INTO `t_jobdata` VALUES ('20', '产品经理-金融科技大数据方向', '25-50k·18薪', '上海', '三大运营商之一全资子公司', 'https://www.liepin.com/a/37720773.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=21&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=21', '上海', '大数据', '25000.00', '50000.00', '37500.00', '两个职级在招：\n【专家级】\n1.熟悉大数据产品和技术，对数据采集及集成、数据建模、数据开发、数据资产管理、数据分析等大数据领域有实战经验；\n2.具备大数据产品规划、设计交付能力，具备良好的数据敏感度、业务视野、调研分析能力，能够敏锐的捕获用户价值和产品机会，产出MRD、PRD和原型；\n3.熟悉金融行业信贷、交易、营销、安全等具体的业务场景，能不断推动对业务的深度分析，通过数据分析和机器学习建模，实现数据价值的落地和迭代；\n4.负责为部门数据应用创新项目提供前瞻性的技术攻关，将中国移动数据交付能力标准化、产品化；\n5.负责结合前沿技术开辟中国移动数据应用的新赛道，制定可行的应用方案及推进计划；协助相关资源，保证创新项目落地、产生收入。\n任职资格：\n知识：熟悉机器学习、模型开发、金融机构风险防控，数据中台。\n技能：\n1、熟悉信贷、保险商业模式，具有敏锐的市场洞察力和整体的风险识别能力，能够快速、准确定位客户现状、痛点、需求，并形成相应的解决方案；\n2、丰富的数据产品管理或数据分析经验，对金融行业的信息化建设理解深刻，具备金融类数据知识，有金融类数据产品设计经验者优先。\n3、具备良好的文档（PRD、原型、PPT）包装能力、逻辑思维能力、产品（业务需求）分析能力与设计思路，能够独立从事产品规划和设计；\n4、了解金融机构数据应用，贷前，反欺诈风控流程，掌握机器学习，隐私计算知识原理；\n5、有一定建模经验，熟悉常见机器学习算法：逻辑回归、GBDT、神经网络、图算法(louvain、BMLPA)等；\n6、有一定的数据中台建设知识，有一定技术架构知识；\n教育：计算机、通信、软件工程、信息工程等相关专业研究生学历。\n经验：\n1、具有7年以上数据应用相关经验，10年以上工作经验。\n2、有科技公司数据产品建设，能力打造、金融风控相关岗位经验优先。\n\n【高级】\n1、深入理解信贷、保险业务，挖掘、拆解并提炼客户核心需求，结合移动自有数据情况及数据能力，输出数据应用解决方案。\n2、标准化各类数据应用解决方案，结合资源现状，规划设计相应数据产品并推动研发落地。\n3、针对数据产品进行全生命周期管理，提升数据业务粘性及自有数据能力，不断迭代优化产品功能并拓宽产品应用场景。\n4、梳理产品业务实现架构，编写并完善产品相关交付物，包括白皮书、需求文档、竞品分析、产品原型、使用手册、业务规范等；\n5、负责产品的竞品分析以及研究产品的发展趋势，把控相关产品的商业策略，与业务部门保持长效需求沟通和推动业务开拓新市场；\n6、对大数据类产品商业化有深刻认识，结合市场找到差异化的市场切入商机及完成产品突破路径规划。\n任职资格：\n知识：熟悉模型开发、产品研发、运营全流程，具备项目管理知识。\n技能：\n1、熟悉信贷、保险商业模式，具有敏锐的市场洞察力和整体的风险识别能力，能够快速、准确定位客户现状、痛点、需求，并形成相应的解决方案；\n2、丰富的数据产品管理或数据分析经验，对金融行业的信息化建设理解深刻，具备金融类数据知识，有金融类数据产品设计经验者优先。\n3、具备良好的文档（PRD、原型、PPT）包装能力、逻辑思维能力、产品（业务需求）分析能力与设计思路，能够独立从事产品规划和设计；\n4、了解金融机构数据应用，贷前，反欺诈风控流程，掌握机器学习，隐私计算知识原理；\n5、有一定建模经验，熟悉常见机器学习算法：逻辑回归、GBDT、神经网络、图算法(louvain、BMLPA)等；\n6、对创新工作充满热情，能适应短时出差；\n教育：计算机、通信、软件工程、信息工程等相关专业研究生学历。\n经验：\n1、具有5年以上数据应用相关经验。\n2、有银行、消金公司风控建模、策略岗位经验优先。');
INSERT INTO `t_jobdata` VALUES ('21', '大数据开发工程师', '25-30k·20薪', '深圳-福田区', '安信证券', 'https://www.liepin.com/job/1946418883.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=22&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=22', '深圳', '大数据', '25000.00', '30000.00', '27500.00', '岗位职责:\r\n1、负责数据中台和大数据应用的架构设计、研发、维护；\r\n2、负责应用系统架构优化、技术难点攻关、问题分析定位与处理；\r\n3、参与实时/离线应用处理与分析，搭建分布式、高并发、低延时数据服务。\r\n任职资格:\r\n1、本科及以上学历，计算机相关专业，三年以上相关工作经验；\r\n2、精通 Java/Scala/SQL语言，熟悉后台服务开发框架（SpringBoot / SpringCloud等）；\r\n3、熟悉常用的大数据技术，包括Spark/Hive/Hbase/Kafka/Impala/clickhouse等，了解各组建的实现原理且具备实际项目使用经验；\r\n4、了解分布式系统原理，对大数据平台具有丰富的优化和故障定位经验；\r\n5、具有良好的沟通能力，团队合作精神，工作积极主动，具备良好的学习能力。');
INSERT INTO `t_jobdata` VALUES ('22', '大数据产品经理-平台及数据治理', '30-50k', '北京-东城区', '中国电信股份有限公司', 'https://www.liepin.com/job/1950228973.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=23&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=23', '北京', '大数据', '30000.00', '50000.00', '40000.00', '职责描述：\n\n负责大数据业务标准化产品设计，重点跟进大数据平台型、数据治理等产品规划	\n岗位要求：1、计算机、统计学，数学、通信等相关专业本科以上学历，5年以上数据平台类或治理类产品设计经验；\n2、具有良好的逻辑抽象和分析、文档撰写及产品展示能力\n3、熟悉数据平台或数据治理类产品全生命周期管理；针对客户需求, 快速响应, 及时梳理上下游依赖, 提出数据解决方案，并协调各方共同高效推进以满足项目整体预期。\n4、具备较强的沟通能力，思维活跃，前瞻学习能力强，良好的沟通和表达能力，良好的项目管理和推进能力\n\n\n');
INSERT INTO `t_jobdata` VALUES ('23', '西南大区总监（医疗信息化/大数据）', '30-50k', '成都-武侯区', '神州医疗', 'https://www.liepin.com/job/1951221287.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=24&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=24', '成都', '大数据', '30000.00', '50000.00', '40000.00', '职责描述： \n1、结合年度市场战略目标与方向，制定全国年度市场工作规划； \n2、给各业务单元赋能，合理分解销售目标，执行并完成销售计划，包括销售指标、客户回款目标的成等。实施业绩跟踪，及时分析，保障达成既定业务指标； \n3、管理销售团队，推动整个团队的销售目标达成。负责对总部及各区营销人员进行业务指导和专业培训，定期召开营销工作会议，全面准确掌握各业务单元的营销运行状况； \n4、负责医疗大数据市场的开发、维护，采取有效措施促进客户开发、制高点突破和终端提升，全面落实产品的覆盖、渠道营销、销售和持续有质量发展； \n\n 任职要求： \n1、本科及上学历，5年以医疗信息化，医疗大数据行业营销经验； \n2、思维活跃、有积极进取和团队合作的精神及接受挑战的性格； \n3、为人诚实、正直，性格开朗、责任心强，擅长与人沟通；\n4、有一定的组织协调能力，能承担一定的工作压力； \n5、具有一定的市场分析判断能力，良好的客户服务意识 。');
INSERT INTO `t_jobdata` VALUES ('24', '大数据开发工程师（余杭）', '10-22k', '杭州-余杭区', '杭州齐智科技有限公司', 'https://www.liepin.com/job/1947471225.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=25&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=25', '杭州', '大数据', '10000.00', '22000.00', '16000.00', '职位描述：\r\n1、负责大数据分析平台和数据仓库设计、建模、研发；\r\n2、参与数据平台设计、开发及自动化工作；\r\n3、根据业务需求，参与开发相应数据接口服务；\r\n4、参与大数据平台调优及维护，确保系统平台能稳定运行。\r\n\r\n职位要求：\r\n1、2年以上从业经验，至少掌握Java/Scala语言24个月以上；\r\n2、熟练使用Spark计算框架，熟悉包括但不限于其他组件如:Flink、Kafka、Hive、HBase、Phoenix、ClickHouse、Azkaban等；\r\n3、熟悉Linux操作系统，熟练使用常用命令，熟练使用shell脚本；\r\n4、具备较强问题分析和解决能力，能够利用常用工具对程序进行跟踪诊断及性能优化；\r\n5、具备强大的自我驱动能力，出色的学习与钻研能力、沟通及团队协作能力，对工作积极严谨，勇于承担压力；\r\n6、有物联大数据开发和Java Web开发经验优先。');
INSERT INTO `t_jobdata` VALUES ('25', '（国企）大数据产品专家-金融领域', '30-60k·18薪', '上海-浦东新区', '某大型国企直属研究院', 'https://www.liepin.com/a/37632177.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=26&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=26', '上海', '大数据', '30000.00', '60000.00', '45000.00', '【工作内容】\n1.熟悉大数据产品和技术，对数据采集及集成、数据建模、数据开发、数据资产管理、数据分析等大数据领域有实战经验；\n2.具备大数据产品规划、设计交付能力，具备良好的数据敏感度、业务视野、调研分析能力，能够敏锐的捕获用户价值和产品机会，产出MRD、PRD和原型；\n3.熟悉金融行业信贷、交易、营销、安全等具体的业务场景，能不断推动对业务的深度分析，通过数据分析和机器学习建模，实现数据价值的落地和迭代；\n4.负责为部门数据应用创新项目提供前瞻性的技术攻关，将中国移动数据交付能力标准化、产品化；\n5.负责结合前沿技术开辟公司数据应用的新赛道，制定可行的应用方案及推进计划；协助相关资源，保证创新项目落地、产生收入。\n\n【任职要求】\n任职资格：\n知识：熟悉机器学习、模型开发、金融机构风险防控，数据中台。\n技能：\n1、熟悉信贷、保险商业模式，具有敏锐的市场洞察力和整体的风险识别能力，能够快速、准确定位客户现状、痛点、需求，并形成相应的解决方案；\n2、丰富的数据产品管理或数据分析经验，对金融行业的信息化建设理解深刻，具备金融类数据知识，有金融类数据产品设计经验者优先。\n3、具备良好的文档（PRD、原型、PPT）包装能力、逻辑思维能力、产品（业务需求）分析能力与设计思路，能够独立从事产品规划和设计；\n4、了解金融机构数据应用，贷前，反欺诈风控流程，掌握机器学习，隐私计算知识原理；\n5、有一定建模经验，熟悉常见机器学习算法：逻辑回归、GBDT、神经网络、图算法(louvain、BMLPA)等；\n6、有一定的数据中台建设知识，有一定技术架构知识；\n教育：\n计算机、通信、软件工程、信息工程等相关专业研究生学历。\n经验：\n1、具有7年以上数据应用相关经验\n2、有科技公司数据产品建设，能力打造、金融风控相关岗位经验优先。');
INSERT INTO `t_jobdata` VALUES ('26', '人工智能和大数据负责人(J31683)', '80-110k·15薪', '北京-大兴区', '京东方', 'https://www.liepin.com/job/1946482251.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=27&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=27', '北京', '大数据', '80000.00', '110000.00', '95000.00', '工作职责:\r\n1)负责人工智能与大数据中心整体工作，包含技术产品化开发、核心技术平台建设、前瞻性基础技术研究、对外合作与生态联盟建设等;\r\n2)负责人工智能与大数据技术在各类显示智能硬件产品、以及智慧园区、智慧金融、智慧交通及政务等行业解决方案中的落地应用;\r\n3)负责计算机视觉、图像处理、人机交互等技术领域的关键技术和新型技术的研发，并且技术水平持续居于行业头部； \r\n4)负责人工智能与大数据前瞻性基础技术研究，布局新技术方向，储备未来重大技术，在学术研究方面取得行业制高点研究成果，技术产品化方面持续取得突破；\r\n5)负责整合内外部资源，拓展行业生态与合作联盟，强化公司在人工智能与大数据行业地位与影响力； \r\n6)负责人工智能与大数据中心人才队伍建设，在计算机视觉、图像处理、人机交互，以及未来新技术方向上引入高水平业务骨干；\r\n7)承接技术战略工作，包括但不限于：技术战略制定、事业计划编制、人工智能与大数据技术路线图，基础技术研究项目清单等；\r\n8)负责中心日常运营管理工作，持续改善业务流程，提升研发效率；\r\n任职资格:\r\n教育程度:博士\r\n工作经历:\r\n具备人工智能头部企业5年以上人工智能(计算机视觉、图像处理、人机交互等领域优先)、大数据算法研究和技术落地产品开发管理工作经验；具备技术开发团队的管理经验；有海外工作经验优先；\r\n所需专业:人工智能、计算机、电子或相关专业\r\n其他要求:具备人工智能产业界与学术界相关行业影响力');
INSERT INTO `t_jobdata` VALUES ('27', '大数据总监', '60-80k·15薪', '北京-朝阳区', '某国内大型汽车公司', 'https://www.liepin.com/a/38750669.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=28&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=28', '北京', '大数据', '60000.00', '80000.00', '70000.00', '1、负责大数据部门团队组织与管理工作；\n2、负责智能驾驶大数据平台架构的规划与设计、搭建、管理、运维、调优，实现数据驱动和赋能；\n3、负责大数据平台技术框架的供应商选型与技术难点攻关；\n4、 研究跟进智能驾驶数据前沿技术，制定系统相关的技术接口和规范；\n5、负责同技术供应商合作洽谈，制定技术标准，协调内外部接口，验收监管合作方；\n任职要求：\n 1、10年以上数据平台搭建与开发相关经验，全日制统招本科及以上学历，计算机、信息管理、自动化等相关专业优先；\n2、熟悉基本的统计理论，掌握逻辑回归、决策树、SVM、神经网络、深度学习等基本的经典统计和机器学习建模理论与方法； \n3、熟悉Hadoop、Hive、Presto、Spark、Storm，Flink，Hbase，Kafka等大数据技术体系中的一种或多种技术，对某个技术方向有独特见解；\n4、 具备良好的数据敏感度，能从繁杂、海量的数据中挖掘数据价值；强烈的好奇心，热爱数据探索，并勇于创新；\n5、 严密的数据逻辑思考能力，能基于数据分析、归纳总结，分析问题的本质，对问题进行解构； \n6、乐于接受挑战，良好的沟通技巧和团队合作；\n7、 坚定的数据believer，坚信数据可以揭示真相、数据驱动价值；');
INSERT INTO `t_jobdata` VALUES ('28', '大数据etl工程师', '15-25k·13薪', '深圳-南山区', '杰成合力', 'https://www.liepin.com/job/1950057115.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=29&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=29', '深圳', '大数据', '15000.00', '25000.00', '20000.00', '【岗位职责】\n1、负责数据分析、加工、清理、处理等流程设计及开发；\n2、基于Hadoop/Hive/Flink为平台租户构建数据仓库和数据集市架构；设计稳定、可复用、可扩展的数据仓库模型，用户画像数据模型，快速支持公司决策数据需要、各方向数据分析和挖掘需要；\n3、基于大数据平台架构与数据产品服务体系，为业务开发实现各类数据需求，提供稳定可靠的数据服务。\n\n【任职要求】\n1、 熟悉数据仓库各类建模理论，以及数据仓库数据层级关系，具备大型数据仓库逻辑模型和物理模型设计经验；\n2、良好的Hive SQL开发能力和程序调优经验；熟悉实时数据计算者优先；熟悉阿里云大数据生态者优先；\n3、熟悉MySQL或PostgreSQL等关系型数据库，具备良好的SQL优化排障能力；\n4、良好的元数据管理、数据质量管理经验。');
INSERT INTO `t_jobdata` VALUES ('29', '华东大区总监（医疗信息化/大数据）', '30-50k', '南京-鼓楼区', '神州医疗', 'https://www.liepin.com/job/1951344619.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=30&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=30', '南京', '大数据', '30000.00', '50000.00', '40000.00', '职责描述： \n    市场：江浙沪\n1、结合年度市场战略目标与方向，制定全国年度市场工作规划； \n2、给各业务单元赋能，合理分解销售目标，执行并完成销售计划，包括销售指标、客户回款目标的成等。实施业绩跟踪，及时分析，保障达成既定业务指标； \n3、管理销售团队，推动整个团队的销售目标达成。负责对华东大区营销人员进行业务指导和专业培训，定期召开营销工作会议，全面准确掌握各业务单元的营销运行状况； \n4、负责医疗大数据市场的开发、维护，采取有效措施促进客户开发、制高点突破和终端提升，全面落实产品的覆盖、渠道营销、销售和持续有质量发展； \n\n 任职要求： \n1、本科及上学历，5年以医疗信息化，医疗大数据行业营销经验； \n2、思维活跃、有积极进取和团队合作的精神及接受挑战的性格； \n3、为人诚实、正直，性格开朗、责任心强，擅长与人沟通；\n4、有一定的组织协调能力，能承担一定的工作压力； \n5、具有一定的市场分析判断能力，良好的客户服务意识 。');
INSERT INTO `t_jobdata` VALUES ('30', '大数据开发工程师', '40-70k', '北京-顺义区', '民生科技有限责任公司', 'https://www.liepin.com/job/1947036899.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=31&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=31', '北京', '大数据', '40000.00', '70000.00', '55000.00', '【职位要求】\n1、本科及以上学历，计算机及相关专业；\n2、熟练使用SQL，以及Scala/Python/Java其中一种编程语言，对分布式架构和并行计算有较深刻理解；\n3、熟悉Hadoop/Spark/HBase/Kylin/ClickHouse等大数据计算和存储技术栈，了解其工作原理，并有实际开发经验；\n4、熟悉Spark Streaming/Flink等流式计算框架，以及Kafka等常见消息队列。\n1、岗位职责\n\n（1）负责数据平台相关应用开发，平台建设、优化和维护，协助公司沉淀数据资产。\n\n（2）负责数据存储、数据仓库、数据接口、离线和实时计算应用的设计、开发和维护工作。\n\n（3）调研和跟进大数据平台的技术发展趋势。\n\n（4）编写和维护开发规范等文档。\n金融科技整体职业前景向上发展，公司福利待遇好(弹性工作，顺义有班车，每个办公职场都有食堂等)');
INSERT INTO `t_jobdata` VALUES ('31', '高级大数据开发工程师（3-5年）', '25-35k·16薪', '北京-朝阳区', '好大夫在线', 'https://www.liepin.com/job/1949257103.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=32&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=32', '北京', '大数据', '25000.00', '35000.00', '30000.00', '岗位职责：\n1、负责海量数据处理分布式平台及大数据分析系统的架构设计和搭建，任务调度，监控预警，持续完善大数据平台，保证稳定性，安全性；\n2、负责数据开发工作包括持续的数据仓库建设、实时/离线数据计算，业务报表产出等，保证数据质量；\n3.负责及时响应并处理线上系统，与上下游业务进行沟通协作，保障应用系统的稳定运行，推动各类数据需求的落地实践；\n4.负责画像标签离线数据开发及标签质量治理，提供稳定标签输出。\n\n岗位要求：\n1.本科以上学历，计算机、数学、统计相关专业，具有1年及以上数据仓库或大数据领域相关开发或运维经验\n2.熟悉HDFS/HIVE/HBase/Spark/Flink/Yarn/Kafka等Hadoop大数据生态系统的常用组件及工作原理，有部署及运维经验，具备故障诊断和调优能力优先\n3.熟悉常用的数据建模理论，熟悉数据仓库各层级模型设计，有实际逻辑经验\n4.熟悉LINUX平台，熟悉JAVA/SCALA任意一种编程语言，扎实的编程基础\n5.熟练熟悉MYSQL、ES、ClickHouse等数据库，有Hql/Sql调优经验\n6.具备较好的逻辑思维能力及问题分析、处理能力。对BI系统有使用经验，有OLAP开发或数据分析相关经验优先\n7.热爱大数据技术，有良好的沟通表达能力和主动理解业务的能力，有强烈的进取心，责任心，乐于分享。');
INSERT INTO `t_jobdata` VALUES ('32', '大数据项目经理', '12-28k·18薪', '广州', '联通(广东)产业互联网有限公司', 'https://www.liepin.com/job/1950727889.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=33&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=33', '广州', '大数据', '12000.00', '28000.00', '20000.00', '岗位职责：\n\n1.负责公卫、医疗大数据软件项目的管理及协调工作，负责具于大数据平台的数据建模、采集、清洗等实施工作，以及业务数据体系设计，确保项目完成交付。\n\n2.负责大数据项目全生命周期管理，每个阶段制定相应的项目策略，做好项目管控，以实现项目目标。\n\n3.深入理解用户业务需求，熟悉行业领域知识，做好需求合理引导用户，控制项目边界。\n\n4.负责日常数据探索、数据统计、数据分析等工作。\n\n5.参与数据平台的性能分析与系统优化，不断提升系统运行效率。\n\n6.协同完善数据治理相关工作，包括元数据、数据模型、数据质量及生命周期等。\n\n\n\n任职资格：\n\n1.全日制本科及以上学历，信息技术、计算机、软件工程、通信工程、电子工程、医疗、公卫相关专业。\n\n2.项目管理经验3年及以上，有中大型软件开发项目经验，有大数据等专业经验者、医疗行业经验者优先。\n\n3.具有良好的项目管理能力、协调能力、团队领导能力和承压能力；具有良好的需求理解分析能力，能对客户需求进行良好分析和引导；能够独立撰写项目需求、方案、投标书等文档。\n\n4.具备DAMA、PMP、IPMP、高项等资质优先。');
INSERT INTO `t_jobdata` VALUES ('33', '大数据开发工程师', '23-35k·22薪', '上海-徐汇区', '申万宏源证券有限公司', 'https://www.liepin.com/job/1951103209.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=34&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=34', '上海', '大数据', '23000.00', '35000.00', '29000.00', '工作职责：\n1、参与和完善基于大数据平台的量化投研平台的建设；\n2、根据业务需求对于数据进行实时处理和指标运算；\n3、调研大数据平台方向的新技术；\n4、负责自建数据库的每日数据下载，清洗和检查工作；\n5、负责数据调研，采购和部署工作；\n6、负责高性能服务器组的运维工作；\n7、参与部门数据规划和硬件规划工作；\n8、其他数据分析需求的支持。\n\n任职资格：\n1、硕士（含）以上学历，特别优秀者可放宽至本科学历；计算机及相关专业；\n2、三年及以上工作经验，其中至少有二年（含）以上大数据相关工作经验；熟练掌握相关大数据分析处理机制；\n3、熟悉大数据处理相关产品架构和技术（如Hadoop/Hive/HBase/Spark）等。熟悉Java/Python语言，能够熟练的进行开发。具有主流数据库（MySql，Oracle，Mongo, Redis）开发和运维经验。具有编写sql脚本的能力；\n4、具有互联网或交易厂商大数据相关经验优先考虑。');
INSERT INTO `t_jobdata` VALUES ('34', '大数据开发工程师', '25-30k·13薪', '上海-宝山区', '软通动力', 'https://www.liepin.com/job/1947572929.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=35&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=35', '上海', '大数据', '25000.00', '30000.00', '27500.00', '职责描述： \n1、负责大数据平台的设计以及应用开发工作； \n2、负责离线/实时的数据存储和加工处理，保证数据质量，负责数据监体系的建立和维护； \n3、负责海量数据的清洗、处理和挖掘工作，支持数据分析师和算法工程师的数据需求； \n4、对数据敏感，基于海量数据进行业务分析，参与产品与应用的数据研发，分析数据成因，发掘数据商业价值；\n 5、研究前沿技术，解决实际场景中的业务问题，优化离线/实时大数据计算任务的性能。 \n6、研究和掌握华为数据治理相关产品并应用于项目中，包括但不限于DAYU、ROMA、智能数据湖等相关产品\n任职要求： \n1、熟悉数据仓库各类建模理论，以及数据仓库数据层级关系； \n2、熟悉大数据生态的常用组件hadoop、hive、spark、canal、flume、kafka、zookeeper、impala、kudu、azkaban； \n3、熟练使用离线计算工具例如hive、impala、kudu； 4、熟悉华为产品者优先，包含但不限于：DAYU、ROMA; \n5、熟练的运用BI工具，有帆软开发经验优先。');
INSERT INTO `t_jobdata` VALUES ('35', '大数据销售', '15-25k', '成都-高新区', '智广海联大数据技术有限公司', 'https://www.liepin.com/job/1950499863.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=36&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=36', '成都', '大数据', '15000.00', '25000.00', '20000.00', '岗位描述：\n1、负责面向政府委办局进行大数据相关产品的销售工作，与客户进行商务沟通、谈判、签订合同，完成销售指标；\n2、维护公司客户资源，深入挖掘客户产品需求建议，找到市场痛点；\n3、根据项目需要，从销售及商务角度配合售前及实施等部门工作开展，推进项目顺利进行，完成任务指标。\n\n任职要求：\n1、专科及以上学历，有政府项目销售经验的优先考虑；\n2、了解软件产品技术知识，有售前经验的优先考虑；\n3、具有较强的客户沟通能力及公关能力，逻辑思维清晰，目标明确，性格开朗。');
INSERT INTO `t_jobdata` VALUES ('36', '产品规划管理岗（大数据）', '15-25k·20薪', '上海-浦东新区', '某央企研究院', 'https://www.liepin.com/a/37697427.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=37&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=37', '上海', '大数据', '15000.00', '25000.00', '20000.00', '职责：\n1、负责制定公司大数据产品策略、统筹大数据产品规划；\n2、负责开展大数据产品竞品对标分析；\n3、负责开展大数据产品资费、结算、场景服务包的统筹管理；\n4、负责大数据产品全生命周期管理的指导工作，负责大数据产品日常跟踪，产品后评估；\n5、负责制定大数据产品管理相关规章制度。\n\n知识技能：了解产品管理相关知识；了解通信、计算机等技术领域如5G、AI、区块链、云计算、大数据等理论与知识。\n工作经验：具有大数据相关工作经验；具有通信、互联网、IT或垂直领域产品全生命周期管理工作经验；具有通信、IT、互联网等领域产品管理经验。');
INSERT INTO `t_jobdata` VALUES ('37', '大客户销售（大数据服务）', '20-40k', '北京', '中国司法大数据研究院有限公司', 'https://www.liepin.com/job/1938524101.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=38&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=38', '北京', '大数据', '20000.00', '40000.00', '30000.00', '岗位职责：\r\n1.负责司法领域政企（政府/国央企/大型互联网企业等）市场开拓、产品销售、商务洽谈和相关保障事宜；\r\n2.负责相关市场领域的商机捕捉、客户拜访、需求分析和解决方案的初步规划；\r\n3.负责相关项目的售前、售中和售后全生命周期管控，跟踪客户满意度；\r\n5、年销售额1000万以上。\r\n任职要求：\r\n1.本科及以上学历；\r\n2.具有3年以上工作经验；\r\n3.熟悉政企服务行业布局、项目运作及招投标相关业务，并具备一定的行业及市场分析能力；\r\n4.有司法领域、大数据服务领域从业经验者优先；\r\n5.有政府、大型互联网公司、律所等司法行业相关市场资源者优先。');
INSERT INTO `t_jobdata` VALUES ('38', '大数据开发工程师', '25-50k·15薪', '深圳-南山区', '富途', 'https://www.liepin.com/job/1951166145.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=0&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=39&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=0&pageSize=40&index=39', '深圳', '大数据', '25000.00', '50000.00', '37500.00', '工作职责 ：\n\n• 负责流批一体数仓规划、建设与维护\n\n• 基于公司海量数据进行实时/离线数据开发工作，包括但不限于数据清洗、数据治理、业务画像数据开发\n\n• 保证大规模的离线、实时任务的正常平稳运行\n\n• 负责相关线上ETL任务的线上问题排查\n\n职位描述：\n\n• 熟练主流开源大数据工具，包括但不限于Hadoop、ClickHouse、Kafka、HBase、Redis等相关技术\n\n• 熟悉数据建模和数据表的设计工作，能较好的归纳业务逻辑，设计出合理的数据和计算逻辑\n\n• 有大数据处理分析经验，熟悉Flink/Spark/Hadoop等大数据处理引擎的原理和使用,有相关调优经验更优\n\n• 熟悉java/scala/python/go等不少于2种语言的使用和原理，了解JVM调优、并发等特性更优');
INSERT INTO `t_jobdata` VALUES ('39', '销售vp（大数据政府线）', '60-70k', '北京-海淀区', '神州医疗', 'https://www.liepin.com/job/1947104507.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=0&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=0', '北京', '大数据', '60000.00', '70000.00', '65000.00', '职位描述：\n1、负责医疗大数据销售团队的管理工作； \n2、负责针对政府、卫健委等行业大客户的业务拓展、熟悉财政资金项目的运作、项目谈判工作， 并承担销售任务； \n3、负责了解医疗卫生行业信息，整合行业资源助力业务开拓，协助部门销售业务的汇总和分析报告； 4、新客户和新机会的挖掘、定位和开发，了解、分析和评估客户的需求，重点客户管理和协调， 相应销售项目的运作； \n\n 任职要求：\n1、10年以上政府合作经验； \n2、良好的IT或者医疗行业销售经验与技能，并在过往的工作中有良好的、可核实的业绩记录； \n3、良好的沟通表达（包括阐述，讲解，基本商务写作，倾听和理解能力）技巧； \n4、客户导向，能够倾听、理解、和准确把握客户的真实需求，并客观地影响客户的购买行为与决策； 5、极强的工作执行力和计划性，具备良好的沟通表达能力、谈判能力，具有丰富的业界人脉资源； \n6、合作伙伴的拓展，团队协作及新业务沟通，调配各种资源完成销售目标。');
INSERT INTO `t_jobdata` VALUES ('40', '大数据总监', '160-250k', '北京', '某北京大型保险公司', 'https://www.liepin.com/a/38382577.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=1&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=1', '北京', '大数据', '160000.00', '250000.00', '205000.00', '大数据中心总经理\n本职位属于高端岗位\n需要要么技术专家或者产品专家一号位，必须要有金融项目经验，必须要有金融项目经验,需要对标大厂经验。');
INSERT INTO `t_jobdata` VALUES ('41', '大数据开发工程师', '15-25k', '成都-高新区', '兴业数金', 'https://www.liepin.com/job/1949634507.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=2&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=2', '成都', '大数据', '15000.00', '25000.00', '20000.00', '职责描述：\n\n1. 进行数据相关开发工作，包括元数据定义和管理、各渠道数据采集和处理、ETL系统建设、实时计算实现等。\n2. 进行高性能、高灵活性的数据指标系统设计和开发。\n3. 负责各业务报表的设计和开发\n4. 进行大数据平台其他Java开发工作。\n\n任职要求：\n1、有Java开发及大数据平台应用开发经验优先。\n2、熟悉SQL语言和数据仓库开发。\n3、 熟悉数据采集、清洗入库、统计计算等要点，实现指标计算需求；\n4、熟悉至少一种大数据框架，如 Hadoop/YARN、Hive、Spark、Storm、Kafka、CDH、TDH、TiDB等。\n6、35周岁以下，学历需本科及以上（统招），本科211/985院校，研究生学历不做院校限制。\n');
INSERT INTO `t_jobdata` VALUES ('42', '大数据产品经理', '30-45k', '杭州', '浙江吉利控股集团', 'https://www.liepin.com/job/1947439275.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=3&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=3', '杭州', '大数据', '30000.00', '45000.00', '37500.00', '工作职责：\r\n1、负责数据中台数据产品设计及落地，能深入行业、结合客户需求、挖掘业务价值，通过数据驱动业务增长。\n\r2、进行产品创新，对产品模块进行组织和架构，为客户打造数据价值闭环。\n\r3、负责数据中台相关产品设计，对数据中台相关工作进行梳理产品化，包括：数据采集，指标管理，数据质量，数据自动化等，支撑的内外部业务数据需求。\n\r4、负责需求管理，数据项目管理，协调内外部资源，流程优化、协调方案，最终保障项目目标达成\r\r\r\n任职要求：\r\n1、具备良好的产品感知，具有良好的用户体验意识，熟练原型设计软件（auxure、墨刀、visio等），输出标准PRD，熟练excel，ppt等相关必备软件。\n\r2、熟练sql、haoop、hive、R，python、quickBI，fineBI等软件，有脚本开发经验更佳，具备良好的数据感知，具有良好数据分析能力，能通过数据分析发现痛点并改进的能力。\n\r3、对大数据研发工作熟悉，参与过元数据管理、指标管理、标签建设、有数据中台类项目经验优先。\n\r4、熟悉互联网、大数据、人工智能等，有B端经验优先，参与数据清洗、数据驱动流程自动化等项目的优先。\n\r5、熟悉新能源车行业优先，熟悉车营销策略优先。\r\r');
INSERT INTO `t_jobdata` VALUES ('43', '大数据总监', '400-510k·15薪', '广州-白云区', '某知名公司', 'https://www.liepin.com/a/39072421.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=4&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=4', '广州', '大数据', '400000.00', '510000.00', '455000.00', '岗位职责：\n1、全面负责集团大数据团队日常管理，大数据平台技术和数据产品规划等工作；\n2、负责数据收集、挖掘和分析能力建设，支撑营销、运营策略的制定，为集团核心业务和战略提供决策依据;\n3、深入并理解业务，构建有竞争力的数据产品，赋能一线业务，提升业务效率;\n4、负责打造集团大数据平台，数据中台建设，以数据驱动业务快速发展；\n5、负责数据业务报表开发、数据分析、机器学习等，数智化推动业务发展;\n6、负责建立和维护大数据平台技术标准规范、采集规范、数仓规范，建设数据采集评估标准；\n7、负责大数据团队组织建设，加强团队成员能力提升，培养一支结构合理，富有竞争力的大数据专业队伍；\n\n任职要求：\n1、计算机，数学，统计学相关专业，本科及以上学历；\n2、大数据平台8年及以上从业经验，3年及以上团队管理工作经验，对大数据领域有很强的理解；\n3、熟悉Mysql、SQLServer数据库，扎实的数据库基础知识，有较强的SQL编码经验，熟悉BI报表设计开发；\n4、熟悉但不限于Hadoop，Hbase，Flink，Spark，Kafka等大数据处理框架，并能根据业务模型选择合适的大数据组件；\n5、视野开阔，学习和抗压能力强，具备良好的组织、沟通、协调和问题解决能力；\n6、从0到1搭建大数据平台，数据中台，或者机器学习，算法设计经验者优先考虑；');
INSERT INTO `t_jobdata` VALUES ('44', '医疗大数据销售经理', '15-25k', '济南-历下区', '北京深睿博联科技有限责任公司', 'https://www.liepin.com/job/1949308437.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=5&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=5', '济南', '大数据', '15000.00', '25000.00', '20000.00', '职责描述：\n1、负责拓展新医院和维护现有医院的项目，对医院端、政府端解决方案销售负责。\n2、建立与辖区内医院的合作，维护关键客户和合作渠道，完成相应指标。\n3、配合运营体系持续可跟踪服务医院及专家，挖掘客户需求。\n\n岗位要求:\n1，大专及以上学历，医疗信息化背景优先，有一定的行业资源；\n2，对医疗大数据领域有一定认知和见解，有兴趣和激情一起加入创业团队；\n3，有独立的项目管理、策划和执行能力，有一定的研究和科研思维；\n4，客户服务第一的工作思维；\n5，有独立的思维能力，具备较强的学习和创新能力。');
INSERT INTO `t_jobdata` VALUES ('45', '大数据测试工程师', '12-19k', '广州-天河区', '京北方信息', 'https://www.liepin.com/job/1950703025.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=6&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=6', '广州', '大数据', '12000.00', '19000.00', '15500.00', '职位描述：\n资格： 本科学历，需要3年以上测试经验；\n能力： \n熟悉测试流程。 熟练掌握大数据测试关键要素；\n较好的沟通能力与文档填写能力，能规范的编写测试用例；\n能熟练运用主流的测试管理工具，熟练掌握能力测试常用方法 ；\n精通主流数据库技术，如 MySQL、Oracle、SQL Server、HIVE；\n熟练 SQL 调优; 熟悉数据仓库，ETL（主要是 Kettle）。\n要有大数据测试经验，一定的SQL的读写能力；\n熟练使用大数据组件（airflow  flink）。\n\n职责： 实施系统测试的需求调研；\n负责系统测试执行和用例设计；\n负责测试计划、测试用例设计和测试执行；\n负责结果记录和测试结果分析；\n协助测试方案制定；\n协助测试报告评审；\n协助自动化测试实施。\n\n职位优势\n1.上市集团，拥有完善的福利待遇，法定节假日，双休，带薪年假；\n2.晋升机制佳；\n3.交通便利，环境优雅；\n4.公司氛围好，定期团建；\n5.扁平化管理~\n\n附加信息：\n工作时间：周末双休\n面试信息：\n面试方式：视频面试\n面试轮数：1-2轮');
INSERT INTO `t_jobdata` VALUES ('46', '（农业大数据生态事业部）G端营销副总经理', '80-100k', '深圳-南山区', '某深圳大型互联网公司', 'https://www.liepin.com/a/37972915.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=7&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=7', '深圳', '大数据', '80000.00', '100000.00', '90000.00', '职责描述：\n1、负责政府及农业行业头部客户拓展，并推进业务目标落地；\n2、熟悉政府/大企业集团的采购流程，负责统筹和引导重点项目的落地；\n3、协助事业部总经理管理营销团队，保障年度营销目标的达成；\n4、配合项目交付，并按期实现回款。\n任职要求：\n1、产品规划设计能力强：成功操盘过行业标杆产品规划；     \n2、有较强的解决方案思维：能够看透问题的本质，且站在问题的更高层面思考解决办法；\n3、具备较强的创新能力：\n4、有较强的数据、平台、技术理解能力，能匹配适应的场景，并且在产品各环节能深层次的应用； \n5、行业视野，有很强的需求分析及产品规划能力，能够应对综合、复杂产品线的挑战；\n6、对IoT行业有较深的认知：对IoT行业里的公司能够清晰地说出其核心优势、劣势、特点，并对行业未来发展趋势有独到见解；     \n7、对养老行业有一定的认知及理解：对养老行业现状有一定了解，对行业未来发展有一定的预判；\n8、人比较聪明，学习及总结能力强、沟通表达逻辑非常清晰；\n9、有成功的产品规划经验，做过行业标杆产品；\n10、有大企业工作背景；\n11、对物联网、大数据感兴趣，且有自己独立的思考和认知；\n12、有医疗或养老行业背景；');
INSERT INTO `t_jobdata` VALUES ('47', '大数据开发工程师', '20-40k·13薪', '西安-经开区', '威讯柏睿数据科技(北京)有限公司', 'https://www.liepin.com/job/1951322237.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=8&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=8', '西安', '大数据', '20000.00', '40000.00', '30000.00', '工作职责：\n1、负责大数据平台（数据中台）后端框架设计与开发，包括数据采集、传输、存储、计算、分析、数据治理等产品开发；\n2、构建批量分析、交互式分析、实时分析、数仓等数据开发方案；\n3、探索大数据、智慧运维领域技术发展趋势以及新的产品形态。\n\n任职资格：\n1、本科及以上学历，计算机、通信及相关专业，5年以上研发工作经验；\n2、精通 Java编程，精通主流开发框架，熟悉多线程编程技术，熟悉分布式平台开发，熟悉高并发机制，熟悉常见的数据结构和算法；\n3、熟悉 linux 平台，熟悉至少一种脚本语言（ shell / python )；\n4、熟悉一种或多种主流开源大数据平台组件，如 Flume 、 Kafka 、 Hadoop 、 Hive 、 Spark 、 Flink 等；\n5、熟悉SQL语句编程，熟悉Mysql、Oracle等数据库的应用开发；\n6、深刻理解大数据相关业务场景，优秀的产品研发能力；\n7、有大数据平台或数据中台产品研发经验优先；\n8、良好的团队合作、沟通能力和学习能力。');
INSERT INTO `t_jobdata` VALUES ('48', '医疗大数据销售经理', '20-25k', '武汉-江夏区', '北京深睿博联科技有限责任公司', 'https://www.liepin.com/job/1949638257.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=9&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=9', '武汉', '大数据', '20000.00', '25000.00', '22500.00', '职责描述：\n1、负责拓展新医院和维护现有医院的项目，对医院端、政府端解决方案销售负责。\n2、建立与辖区内医院的合作，维护关键客户和合作渠道，完成相应指标。\n3、配合运营体系持续可跟踪服务医院及专家，挖掘客户需求。\n\n岗位要求:\n1，大专及以上学历，医疗信息化背景优先，有一定的行业资源；\n2，对医疗大数据领域有一定认知和见解，有兴趣和激情一起加入创业团队；\n3，有独立的项目管理、策划和执行能力，有一定的研究和科研思维；\n4，客户服务第一的工作思维；\n5，有独立的思维能力，具备较强的学习和创新能力。');
INSERT INTO `t_jobdata` VALUES ('49', '大数据开发工程师', '20-30k·13薪', '深圳', '迪阿股份有限公司', 'https://www.liepin.com/job/1949856547.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=10&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=10', '深圳', '大数据', '20000.00', '30000.00', '25000.00', '岗位职责：\n1、负责大数据平台的基础环境搭建与性能优化，完成平台的构建与维护、包括定义数据的存储、集成(ETL)、应用，支撑业务运营和数据分析类需\n求实现；\n2、制定数据治理领域的数据体系化管理措施，包括元数据设计、数据标准、数据质量、数据处理、数据安全等工作，确保数据可信与安全；\n3、能根据业务需求进行数据分析，开发数据模型，给业务决策提供数据支持。\n\n任职资格：\n1、五年以上数据仓库开发经验，对数据仓库架构有良好的认识,计算机相关专业毕业；\n2、具备较好的数据仓库建模设计，etl设计能力，数据质量管控经验，熟悉sqoop kettle等抽取工具；\n3、掌握hive sql,spark sql,mysql，熟练使用java,scala,python,shell；\n4、熟练使用dolphinscheduler进行调度开发。');
INSERT INTO `t_jobdata` VALUES ('50', '大数据分析研究专家', '35-50k·15薪', '杭州-余杭区', '之江实验室', 'https://www.liepin.com/job/1951136567.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=11&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=11', '杭州', '大数据', '35000.00', '50000.00', '42500.00', '职责描述：\n具体职责（以下一项或多项）：\n1．参与见微大数据智能可视分析平台研发；\n2．参与经济运行态势分析及模拟推演平台研发；\n3．参与大图分析项目研发；\n4．独立进行大数据分析相关的其它项目研发。\n\n\n\n\n任职要求：\n1.国内外知名院校计算机、人工智能等相关专业博士毕业；\n2.有3年及以上国内外知名高校、研究机构或企业的工作经历，在数据分析、数据挖掘、机器学习、可视化、大图分析等领域有多年工作积累；\n3.在大数据、人工智能等领域顶级会议和期刊上发表过一定数量的论文，具有一定的学术影响力；\n4.有带领团队完成项目申报、推进及验收的全流程经验；\n具有较强的沟通能力、团队领导能力和英文论文写作能力。');
INSERT INTO `t_jobdata` VALUES ('51', '（鲲鹏高层次）（西安）大数据架构师（大数据开发）', '15-30k', '西安-高新区', '中电太极(集团)有限公司', 'https://www.liepin.com/job/1935836733.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=12&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=12', '西安', '大数据', '15000.00', '30000.00', '22500.00', '工作职责:\r\n2 精通Java/python/C中的一门或多门编程语言\r\n2 熟悉互联网典型的大数据产品架构；\r\n3 熟悉数仓建模理论，3年以上领域实践经验，能够独立完成系统架构；\r\n4 熟练掌握Hadoop、Hive、Spark等大数据技术；\r\n5 熟练使用Java或其他语言进行复杂业务逻辑的数据处理工作，具备海量数据处理和优化能力\r\n6 熟练Mysql、Oracle、Redis、Hbase等数据库\r\n任职资格:\r\n1.  硕士及以上学历，计算机、相关专业\r\n2. 5年以上\r\n3. 有售前工作经验者优先\r\n4. 良好的团队协作能力和沟通能力；善于思考，能独立分析和解决问题\r\n6. 待人和善，责任心强\r\n');
INSERT INTO `t_jobdata` VALUES ('52', '大数据分析师', '30-40k·13薪', '上海-长宁区', '上海特朗思大宇宙信息技术服务有限公司长沙分公司', 'https://www.liepin.com/job/1951292849.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=13&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=13', '上海', '大数据', '30000.00', '40000.00', '35000.00', '职责描述：\n1、借助阿里大数据平台（数据银行、策略中心为主），为品牌提供全方位的数据赋能服务，包括但不限于淘内外投放提效，电商营销计划指定、消费者洞察、产品/生意策略指导及优化等；\n2、深入理解各行业品牌/产品特点，结合品牌痛点和市场挑战提供定制化的行业策略分析、数据运营规划思路及落地执行建议，将基于数据的分析转化为可执行的商业洞察\n3、负责多个研究小组的统筹管理工作，并带领团队完成业绩目标\n4、协助新业务开拓工作\n5、协助完成公司安排的其他工作（如内外部培训、宣讲等）\n\n任职要求：\n1、市场研究、数字营销、电商运营、大数据分析等相关领域5年以上经验\n2、3年以上大品牌客户服务经验\n3、对数据敏感并具有数据想象力，善于通过数据洞察背后的市场或商业现象\n4、优秀的逻辑思维及发散性思维\n5、优秀的PPT撰写及指导能力\n6、优秀的沟通能力和提案能力\n7、具有强烈的好奇心及开放学习的心态\n8、熟悉阿里大数据体系及产品者优先\n\n');
INSERT INTO `t_jobdata` VALUES ('53', '大数据开发工程师', '15-25k', '上海', '上海医药大健康云商股份有限公司', 'https://www.liepin.com/job/1951404205.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=14&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=14', '上海', '大数据', '15000.00', '25000.00', '20000.00', '工作职责:\n1、负责数据中台大数据产品相关项目的技术方案，架构设计以及核心代码的研发工作; \n2、在数据采集，数据治理和数据分析方面有较丰富的经验经历；\n3、熟悉标签设计和管理；\n4、参与技术攻关和培训等工作\n任职资格:\n1、具有5年左右的数据仓库、ETL或数据库开发经验；\n2、精通MySQL、SQL SERVER、ORACLE，具有丰富的SQL优化经验；\n3、精通ETL开发流程及规范，熟练使用Kettle、DataX等ETL开发工具；\n4、熟悉数据仓库DW和数据集市DM等建设相关经验；\n5. 具有扎实的编程功底，熟悉常用的算法和数据结构，掌握Java/Python等一种以上语言的开发能力。\n6. 熟悉元数据、特征工程，善于挖掘和展现数据价值\n7. 熟悉开源分布式计算/存储相关技术，包括Kafka、MongoDB、ES、Flink、ClickHouse等\n8、较好的沟通理解能力，性格乐观，态度踏实，积极上进；\n9、医疗软件行业相关工作经验优先。');
INSERT INTO `t_jobdata` VALUES ('54', '投资（软科技/ai/大数据/金融科技/软件开发/算法等）', '30-45k·18薪', '上海', '国内知名pe/vc投资机构', 'https://www.liepin.com/a/39057433.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=15&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=15', '上海', '大数据', '30000.00', '45000.00', '37500.00', '1、根据公司战略定位和投资标准，负责项目寻找、开发、筛选、跟踪、评估和尽职调查等工作；\n2、3-5年私募投资经验，熟悉软科技科技、TMT行业，ai/大数据/金融科技/软件开发/算法等；\n3、硕士以上学历，计算机等理工科背景优先。');
INSERT INTO `t_jobdata` VALUES ('55', '大数据运维工程师', '30-55k·24薪', '上海', '某上海基金证券公司', 'https://www.liepin.com/a/38877089.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=16&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=16', '上海', '大数据', '30000.00', '55000.00', '42500.00', '职责描述：\n1、负责分布式数据库、大数据平台运维管理，建立和完善规范化的运维服务体系，确保生产运行稳定；\n2、负责集群容量规划、扩容及性能优化；\n3、维护任务调度框架和策略，数据备份恢复策略；\n4、参与业务架构设计，在设计阶段给出可运维性改进建议。\n\n任职资格\n任职要求：\n1、35岁以下，计算机相关专业，本科及以上学历；至少3年大数据、分布式数据库工作经验；\n2、对大数据基础架构和平台有较深理解，熟悉数据采集、存储、清洗、分析及可视化等方面的相关技术；\n3、熟悉Python、Java、SQL、SHELL中的2个及以上；\n4、熟悉Docker与Kubernete的原理与运维，有实际的容器化经验者优先；\n5、熟悉Linux操作系统、网络、计算机组成原理等；\n6、熟悉Nginx、Tomcat等web应用及中间件的使用和配置；\n7、良好的Trouble shouting思路与经验，能够快速解决线上事故；\n8、具备很强的危机意识和抗压能力、追求卓越的责任心、沟通能力、团队协作，具备很强的创新意识和能力。\n');
INSERT INTO `t_jobdata` VALUES ('56', '大数据分中心应用系统建设岗(001731)', '10-30k', '广州-天河区', '中国工业互联网研究院', 'https://www.liepin.com/job/1950605611.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=17&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=17', '广州', '大数据', '10000.00', '30000.00', '20000.00', '职责描述:\n1.开展国家工业互联网大数据中心广东分中心应用系统建设；\n2.开展中小企业公共服务平台、工业软件商店及产业链监测服务平台建设；\n3.依托国家工业互联网大数据中心，开展产业大数据的汇聚和分析，挖掘数据价值，开展工业经济分析、产业运行监测、科研课题报告等研究工作，完成各类分析报告撰写；\n4.开展项目管理工作，包括但不限于计划管理、成本、质量、风险管理等，跟进项目监控，负责项目验收上线，参与项目管理制度体系建设等；\n5.协助项目负责人统筹管理项目进度。\n任职要求:\n1.中共党员优先；\n2.对工业互联网、工业4.0、工业数字化转型、大数据等相关领域感兴趣，有相关解决方案经验者优先；\n3.具备较强的业务感知能力、总结概括能力、协调组织能力，具有良好的文字和口头表达能力，沟通协调能力强，能够独立撰写各类公文和报告，有项目管理经验者优先。');
INSERT INTO `t_jobdata` VALUES ('57', '医疗大数据销售经理', '20-27k', '南京-秦淮区', '北京深睿博联科技有限责任公司', 'https://www.liepin.com/job/1944622427.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=18&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=18', '南京', '大数据', '20000.00', '27000.00', '23500.00', '职责描述：\r\n1、负责拓展新医院和维护现有医院的项目，对医院端、政府端解决方案销售负责。\r\n2、建立与辖区内医院的合作，维护关键客户和合作渠道，完成相应指标。\r\n3、配合运营体系持续可跟踪服务医院及专家，挖掘客户需求。\r\n\r\n岗位要求:\r\n1，大专及以上学历，医疗信息化背景优先，有一定的行业资源；\r\n2，对医疗大数据领域有一定认知和见解，有兴趣和激情一起加入创业团队；\r\n3，有独立的项目管理、策划和执行能力，有一定的研究和科研思维；\r\n4，客户服务第一的工作思维；\r\n5，有独立的思维能力，具备较强的学习和创新能力。');
INSERT INTO `t_jobdata` VALUES ('58', '大客户营销总监（智慧城市/政务大数据）', '20-35k', '沈阳', '华傲数据', 'https://www.liepin.com/job/1934838793.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=19&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=19', '沈阳', '大数据', '20000.00', '35000.00', '27500.00', '岗位职责：\r\n1、根据公司的营销战略分解落地区域指标；\r\n2、负责区域的政府资源及渠道等的市场开拓工作；\r\n3、区域营销管理及客户业务对接；\r\n4、负责与区域的项目交付团队联动，确保交付质量及客户满意度；\r\n5、经营区域内客户关系，做好客户服务；\r\n\r\n岗位要求：\r\n1、具有3年以上销售总监、区域市场总监的从业经历；\r\n2、熟悉政府采购流程，能够按照公司战略制定区域内营销策略；熟练掌握公司业务，并能够引导客户需求；\r\n3、具备优秀的政务类客户的市场营销与开拓能力，拥有自主开拓客户资源的经历;\r\n4、具有良好的亲和力、沟通能力与抗压能力；\r\n5、具有团队管理经验与跨组织、跨团队资源的统筹协调能力；\r\n6、在当地具备一定的客户关系；\r\n7、具有优秀的公开演讲及市场宣导能力；\r\nPS：政府大数据项目、政府客户资源、能自主BD、具有成功的政府项目谈单经验');
INSERT INTO `t_jobdata` VALUES ('59', '售前解决方案（大数据）', '30-60k', '上海-青浦区', '广东美云智数科技有限公司', 'https://www.liepin.com/job/1948956947.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=20&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=20', '上海', '大数据', '30000.00', '60000.00', '45000.00', '岗位职责：\n1、专注客户大数据解决方案撰写并参与0-1项目产品拓展交流；负责行业客户需求对接并参与和产品团队的深度沟通，支持前端行业团队的解决方案匹配及落地；\n2、在行业产品研发部门，构建产品方案竞争力地图，挖掘行业价值场景和数据分析等关键需求、沉淀行业业务模型及数据资产来赋能产品组合的持续规划，形成数据分析主题和数据分析模型，通过数据模型支持用户数据分析场景\n3、基于行业标杆客户场景，产出客户案例和最佳实践，为销售团队定期赋能。\n任职要求：\n1、本科及以上学历，5年以上工作经验，有车企行业甲方及ISV乙方工作经验优先；\n2、熟悉1到多个工业软件如：MES、MOM、APS、SRM、大数据、数据中台等产品，有过B端产品交付经验优先；\n3、有5年级以上行业售前/咨询/实施/产品/研发等相关复合型经验，有带领团队负责大型复杂项目经验优先。');
INSERT INTO `t_jobdata` VALUES ('60', '大数据产品经理', '20-50k·15薪', '北京-海淀区', '海致', 'https://www.liepin.com/job/1951137455.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=21&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=21', '北京', '大数据', '20000.00', '50000.00', '35000.00', '岗位职责：\n1. 负责公司数据中台及数据应用的需求分析、产品规划及设计；\n2. 负责数据采集、加工、数据体系搭建和展现流程的机制建设和产品设计\n3. 负责数据中台的实时分析产品落地；特别是对企业中流式类数据接入后的实时计算分析产品的设计，对阿里云dataworks等产品熟悉者最佳；\n4. 理解相关产品业务，结合业务部门反馈及市场需求，提出并实施产品改进意见，不断完善产品，提升产品竞争力，支持各类客户对数据产品的复杂需求。\n任职要求：\n1. 正规全日制本科及以上学历，数学、统计学、计算机、通信工程等理工科专业；\n2. 三年及以上的数据分析或数据后台设计相关经验，有大数据平台或可视化大屏产品建设优先考虑；\n3. 优秀的学习能力，快速理解相关产品业务；\n4. 担任过团队核心成员；\n5. 优秀的逻辑思维能力、沟通和协调能力。');
INSERT INTO `t_jobdata` VALUES ('61', '大数据开发（大数据开发方向）', '15-30k', '武汉-汉阳区', '东风汽车公司技术中心', 'https://www.liepin.com/job/1947505211.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=22&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=22', '武汉', '大数据', '15000.00', '30000.00', '22500.00', '职责描述：\n1、负责大数据项目代码开发工作；\n2、参与大数据平台的实时与离线数据处理任务和服务开发；\n3、参与负责大数据技术相关的人才培养。\n任职要求：\n1、计算机科学与技术及相关专业本科及以上学历 \n2、2年及以上Java、J2EE体系开发经验，具有良好的编程习惯；\n3、熟悉掌握Springboot、Mybatis等,熟练使用开发中常用的一些组件；\n4、熟悉JavaScript、CSS、HTML、JQuery等页面相关技术；；\n5、精通SQL，熟悉Mysql关系数据库；\n5、有服务器端及Web前端开发经验，熟悉Spark、Scala');
INSERT INTO `t_jobdata` VALUES ('62', '大数据架构师', '55-65k', '北京', '某银行总行', 'https://www.liepin.com/a/39142363.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=23&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=23', '北京', '大数据', '55000.00', '65000.00', '60000.00', '1. 负责全行大数据平台、AI平台的系统架构设计工作，基于业务场景设计系统解决方案；\n2. 利用Hadoop、Spark等大数据技术对金融数据进行处理，支持建模（算法）的工程化实现；\n3. 负责全行数据现状调研、收集数据问题和痛点，形成数据管理总体报告；\n4. 参与数据标准、数据质量、元数据、词根、数据源的日常管理；\n5. 对现有系统进行架构深入分析及系统优化，进一步提升系统的性能及数据处理能力。\n1. 全日制本科及以上学历，计算机、通讯工程、数据等相关专业；\n2. 具备3年以上大数据相关开发经验，2年以上大数据相关设计经验；\n3. 熟悉Hadoop、Hive、Hbase，Spark以及流式计算等大数据相关技术，并具备开发经验\n4. 最好是在金融行业或互联网金融领域有关相关工作经验者；\n5. 具备良好的沟通能力，团队合作精神，能接受高强度工作。');
INSERT INTO `t_jobdata` VALUES ('63', '大数据总监', '100-160k·14薪', '上海', '某大型专业服务公司', 'https://www.liepin.com/a/38661851.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=24&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=24', '上海', '大数据', '100000.00', '160000.00', '130000.00', '如果你:\n拥有大学本科或以上学历，在校成绩优异\n对数字化战略、机器学习、人工智能(AI)、大数据、电子商务、云技术，以及IT系统/组织设计等前沿科技有深入了解和浓厚兴趣\n·具备一定的领导能力\n·善于进行团队合作\n·中英文流利，具有良好的沟通技巧');
INSERT INTO `t_jobdata` VALUES ('64', '金融科技部大数据风险管理专家', '40-60k·22薪', '上海', '某知名证券公司', 'https://www.liepin.com/a/38934923.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=25&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=25', '上海', '大数据', '40000.00', '60000.00', '50000.00', '该职位BASE北京，上海都可以。\n1、组建和管理大数据风险管理产品、研发团队； 2、高质量响应一二道防线的风险系统、风险数据、风险模型的建设要求； 3、不断优化大数据风险管理技术，包括担不限于： （1）提升风险基础数据的全面、及时、准确、通用性； （2）优化风险模型，提升模型识别精度； （3）引入另类数据，提升风险防范能力； （4）风险技术成果在投资、投研、投顾领域的推广。\n岗位要求：\n1、研究生学历及以上；\n2、牵头过上述工作领域，或深度参与并有显著个人建树；\n3、有5年以上证券公司工作经验，2年以上团队管理经验；\n4、对金融科技领域充满热情和探索\n');
INSERT INTO `t_jobdata` VALUES ('65', '大数据测试工程师', '15-20k', '上海-徐汇区', '奇利匙信息技术(上海)有限公司', 'https://www.liepin.com/job/1951206995.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=26&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=26', '上海', '大数据', '15000.00', '20000.00', '17500.00', '岗位职责：\n1、负责数据类应用系统及数据测试工作\n2、参与开发数据测试工具或自动化解决方案,提升测试效率及质量\n3、完成上级交办的其他工作。\n岗位要求 \n1、大专及以上学历,计算机相关专业优先,至少3年以上开发或测试经验\n2、精通HQL,熟悉Shell/Python /JAVA至少一种编程语言\n3、熟悉大数据相关技术,如,Hadoop/Hbase/Spark/Hive/MySqL/ClickHouse等 \n4、熟悉自动化测试经验，熟悉常见自动化工具、框架;\n5、了解数据仓库、数据建模、数据分析相关技术\n6、拥有较强的逻辑思维能力、数据分析能力和问题解决能力,具有良好的团队协作精神和服务意识,富有进取心,勇于创新。');
INSERT INTO `t_jobdata` VALUES ('66', '大数据开发工程师', '25-45k', '广州-天河区', '中国电信股份有限公司研究院', 'https://www.liepin.com/job/1935274331.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=27&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=27', '广州', '大数据', '25000.00', '45000.00', '35000.00', '职责描述：\n\n1. 负责大数据平台的设计与开发实现\n2.负责大数据应用相关产品需求分析、架构设计以及开发实现；\n3.负责或参与大数据平台及其应用的故障排查、参数优化等；\n4. 对业界大数据技术的发展进行跟进和研究。\n\n任职要求：\n1、JAVA基础扎实，熟练掌握Core Java、多线程、数据结构算法；\n2、熟悉Hadoop/Spark技术栈，掌握大数据生态技术，如Yarn、Hdfs、Kafka、Elasticsearch、Spark、Flink、Zookeeper等大数据组件（熟悉2个以上即可）；\n2、具备大数据平台及各类组件的部署及维护调优能力 ；\n3、熟练掌握SQL语言，掌握Mysql、Oracle、Postgresql等一种或多种关系型数据库使用，有一定的SQL调优经验；\n4、具备良好的团队合作精神，良好的沟通能力。');
INSERT INTO `t_jobdata` VALUES ('67', '高级政务大数据项目经理', '18-30k·16薪', '广州-越秀区', '数字广东', 'https://www.liepin.com/job/1945479611.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=28&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=28', '广州', '大数据', '18000.00', '30000.00', '24000.00', '岗位职责:\r\n1、全程跟进政务大数据相关项目管理，组织大数据项目实施，管理项目里程碑和项目质量，组织研发人员以及实施人员开展项目工作。\r\n2、把控和分析客户需求，确保项目在既定工作范围内完成交付，并深入参与客户访谈、需求管理、方案设计、成果整理等工作。\r\n3、组织梳理政务数据相关业务架构、业务流程、应用规划，输出相关方案报告，方案表达清晰、凝练。\r\n4、负责和项目客户对接，建立和管理客户关系，以确保项目实施成功。\r\n任职资格:\r\n1、本科及以上学历，5年以上大数据项目实施管理经验，有政务大数据项目经验者优先。\r\n2、熟悉大数据架构、数据仓库、数据治理、大数据应用等相关技术和产品。\r\n3、良好的团队协作能力，积极主动，皮实靠谱，能承受一定的工作压力。\r\n3、思维敏捷，具备良好的项目管理能力、逻辑思维能力和人际沟通能力。');
INSERT INTO `t_jobdata` VALUES ('68', '大数据销售', '20-40k', '杭州-滨江区', '智广海联大数据技术有限公司', 'https://www.liepin.com/job/1943689799.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=29&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=29', '杭州', '大数据', '20000.00', '40000.00', '30000.00', '岗位描述：\r\n1、负责面向政府委办局进行大数据相关产品的销售工作，与客户进行商务沟通、谈判、签订合同，完成销售指标；\r\n2、维护公司客户资源，深入挖掘客户产品需求建议，找到市场痛点；\r\n3、根据项目需要，从销售及商务角度配合售前及实施等部门工作开展，推进项目顺利进行，完成任务指标。\r\n\r\n任职要求：\r\n1、专科及以上学历，有政府项目销售经验的优先考虑；\r\n2、了解软件产品技术知识，有售前经验的优先考虑；\r\n3、具有较强的客户沟通能力及公关能力，逻辑思维清晰，目标明确，性格开朗；\r\n4、接受短期出差。');
INSERT INTO `t_jobdata` VALUES ('69', '大数据项目管理副总监', '40-60k·14薪', '上海-徐汇区', '某知名公司', 'https://www.liepin.com/a/38963099.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=30&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=30', '上海', '大数据', '40000.00', '60000.00', '50000.00', '工作职责：\n1、参与部门项目管理制度和流程的制定，贯彻执行并能在过程中改进与优化。\n2、负责项目计划、开发、验证、交付和产品生命周期等各阶段管理工作；\n3、制定项目计划，分解项目任务，检查任务的完成情况，确保项目按计划推进；\n4、管理项目需求，流程化评估、处理需求变更，确保项目整体范围可控；\n5、监控项目状态，识别项目风险，运用项目管理工具和方法对项目进行分析，及时处理风险、问题，做出有效决策，确保实际成果符合计划目标；\n6、管理项目沟通，召开项目例会，定期向项目指导团队汇报项目状态；\n7、在项目重要节点总结项目管理经验、方法、工具、模板等，提升公司项目管理水平。\n\n工作要求：\n1、本科及以上学历，5年以上大数据项目实施管理经验，有管理大数据项目经验者优先；\n2、熟悉敏捷和瀑布式开发流程，管理方式；\n3、良好的团队协作能力，积极主动，思维敏捷，具备良好的项目管理能力、逻辑思维能力和人际沟通能力。\n4、英语口语、书面能力良好，能满足日常交流需要');
INSERT INTO `t_jobdata` VALUES ('70', '大数据开发工程师', '25-35k·13薪', '深圳', '富士康科技集团IPEBG', 'https://www.liepin.com/job/1951266443.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=31&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=31', '深圳', '大数据', '25000.00', '35000.00', '30000.00', '职责描述：\n1.负责大数据开发工作，包括数据迁移、清洗、存储及加工计算；\n2.能够独立负责业务数据的收集整理，搭建业务数据指标体系，对多种数据源进行深度诊断性组合分析，实现数据整合及标准化；\n3.参与数据需求分析及需求设计文档编写；\n4.开展数据测试方案设计与数据验证工作；\n任职要求：\n1.本科以上学历，计算机相关专业毕业，具有5年以上大数据开发相关项目经验；\n2.具备数据开发经验与能力，精通数据仓库建模理论，熟练掌握分布式存储、ETL设计方法，并有相关的项目经验；\n3.有良好沟通能力和责任感，能够承担工作压力，独立分析和解决问题者优先；');
INSERT INTO `t_jobdata` VALUES ('71', '高级大数据测试工程师', '13-20k', '武汉-洪山区', '科大讯飞', 'https://www.liepin.com/job/1950715523.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=33&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=33', '武汉', '大数据', '13000.00', '20000.00', '16500.00', '岗位职责：\n1、负责数据相关平台的测试工作，参与软件产品测试的全流程，包括参与需求分析、设计评审，缺陷分析跟踪和软件质量分析等。\n2、制定测试计划，分配测试资源，构建测试环境，执行测试用例，测试报告编写等。\n3、持续改进产品或项目的整体质量，并通过测试流程和方法创新，努力提升研发的质量和效率。\n4、根据产品测试情况，实施自动化、性能、稳定性等专项测试；\n\n任职资格：\n1、熟练掌握测试相关理论知识及软件测试流程，有5年以上中大型项目测试相关经验，其中至少2年左右数据相关测试经验；\n2、可独立负责复杂系统的测试工作，有较强的测试方案、测试用例设计等能力，且有一定的专项测试经验；\n3、对大数据组件有一定了解，比如MQ，ES，hadoop，spark，hive，flume等；\n4、会使用常用数据库，比如ORACLE，MYSQL，MongoDB等；\n5、熟悉Linux操作系统，能独立搭建较大型项目的全流程测试环境；\n6、具有良好的学习能力和理解能力，能够根据需要快速的进行测试技术攻坚。\n7、沟通表达较好，团队协作能力强；\n8、有python，java等编程经验者优先。\n此岗位为科大讯飞集团统一招聘岗位，人员通过简历筛选、初试、复试、终审等环节后录用');
INSERT INTO `t_jobdata` VALUES ('72', '数据治理（大数据）', '25-50k·14薪', '北京-朝阳区', '中信百信银行股份有限公司', 'https://www.liepin.com/job/1951386251.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=34&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=34', '北京', '大数据', '25000.00', '50000.00', '37500.00', '职位描述：\n\n1、牵头对公、金融市场板块数据治理工作，包括推动基础标准落地、牵头板块指标体系梳理、数据治理管理等工作；\n\n2、牵头对相关板块数据治理工作的落地需求进行梳理，形成对基础数据平台、工具平台的需求输入。\n\n\n\n任职要求:\n\n1、全日制统招本科（含）以上学历，3年以上工作经验；\n\n2、具备商业银行或其他机构数据标准、指标标准、数据质量管理等数据治理相关工作经验者优先；\n\n3、具备较好的组织协调、问题解决、风险管理、沟通及计划能力；\n\n4、熟练使用Office等办公软件，英语达到四级或同等水平 。');
INSERT INTO `t_jobdata` VALUES ('73', '大数据分析师', '15-30k·16薪', '深圳', '华为', 'https://www.liepin.com/job/1938525683.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=35&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=35', '深圳', '大数据', '15000.00', '30000.00', '22500.00', '岗位职责：\n1、负责内存后端平台的建设和规划。数据库规划和搭建。\n2、负责协助算法和代码验证，负责通过机器学习、深度学习进行数据分析，推广预警算法到业务平台\n岗位要求：\n1、需要1年以上熟练掌握python、JAVA，Javascript当加分项\n2、熟练掌握python和mysql，mongodb，redis数据库必须的精通其中一种\n3、熟悉基本的机器学习、深度学习算法。\n4、对react，nodejs这些主流前端框架有一定了解');
INSERT INTO `t_jobdata` VALUES ('74', '大数据开发工程师', '15-30k', '上海-松江区', '美克生能源', 'https://www.liepin.com/job/1951306601.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=36&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=36', '上海', '大数据', '15000.00', '30000.00', '22500.00', '职责描述：\n1、负责公司大数据平台的规划和技术架构，推进大数据项目的落地；\n2、根据业务需求，以数据为依托，结合业务场景，构建数据分析体系；\n3、负责数据统计/数据挖掘算法的设计与实现；\n4、负责大数据相关任务日常运维操作；\n5、学习和研究新技术以满足产品的需求，并对现有技术提出改进建议；\n \n\n任职要求：\n1、计算机或相关专业，本科以上学历，3年以上大数据项目工作经验；\n2、熟练掌握大数据平台、数据仓库的体系架构设计，熟悉数据建模、数据治理等知识\n3、熟练掌握Hadoop及Map-Reduce应用开发，熟练掌握HBase、Hive、Flink、Spark等大数据开发工具；\n4、熟练使用 Java、Python、Shell、SQL 等常用编程语言；具有BI，数据仓库等项目实施经验者优先；\n5、对数据和新技术有一定的敏感度；有较强的逻辑思维能力和创新精神；\n6、良好的编码风格和测试习惯；良好的沟通协调与执行推动能力、团队合作精神及一定抗压能力；\n7、具备独立解决问题的能力，具有较强的工作主动性，能够与团队成员进行有效的沟通与合作；\n8、富有激情和创造力, 有强烈的自学意愿及能力，研究各种优秀的项目并运用到实际项目中；');
INSERT INTO `t_jobdata` VALUES ('75', '大数据开发工程师', '20-40k·13薪', '深圳-南山区', '埃克斯工业(广东)有限公司', 'https://www.liepin.com/job/1951305337.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=37&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=37', '深圳', '大数据', '20000.00', '40000.00', '30000.00', '岗位职责：\n1.  工业大数据系统的设计、开发、文档编写；\n2.  大数据集群的搭建、容量评估、扩容、升级和数据迁移，保证集群环境的稳定运行；\n3.  大数据组件的参数调优，根据业务和数据量适时地调整组件参数；\n4.  编写大数据集群的监控脚本，完善监控报警机制，对突发事件产生应急响应。\n\n任职要求：\n1.  本科及以上学历，计算机相关专业，3年及以上大数据工作经验；\n2.  熟悉Hadoop生态架构和组件，理解各常用组件（Hadoop、Kafka、Hbase、Flink等）的底层原理；\n3.  熟悉Flink者优先考虑；\n4.  熟悉Linux，需要掌握shell脚本的开发；\n5.  熟悉Java、Scala者优先考虑\n6.  熟悉CDH者优先考虑；\n7.  具备较高的trouble shooting能力，有大规模集群维护经验的优先；\n8.  较好的沟通理解能力，性格乐观，态度踏实，积极上进，热爱工作，有自驱力。');
INSERT INTO `t_jobdata` VALUES ('76', '大数据平台经理', '30-60k·22薪', '上海-浦东新区', 'ATL', 'https://www.liepin.com/job/1946333615.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=38&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=38', '上海', '大数据', '30000.00', '60000.00', '45000.00', '岗位职责:\r\n负责公司大数据平台相关技术、基础设施的规划与建设推动\r\n负责数据仓库、计算、分析等功能设计和规划\r\n负责与IT系统接口和协议、相应服务协议的策略的制定和规划建设\r\n负责指定数据质量管理规范，数据获取、运算以及存储相应的策略、流程和规范\r\n管理（30%）+技术（70%）岗位\r\n任职资格:\r\n本科5年以上相关工作经验，有3年以上大数据系统架构与设计经验，对大数据的技术发展趋势有较深的理解；\r\n充分理解数据仓库、数据湖、数据中台概念的异同以及发展过程\r\n数字基本IT系统架构和功能，包括ERP, MES, PLM，SAS等\r\n具有丰富的海量数据处理经验，熟练运用Storm、Hadoop、Spark、HDFS、Hbase、Kafka等核心技术组件；\r\n可独立进行大中型数据平台架构设计和搭建、模型设计、ETL设计等；\r\n具备极强的数据、流程、业务理解能力，能从数据中发现价值；\r\n良好的跨组织协调、学习和沟通能力，乐于接受挑战；具备优秀的项目管理与团队建设能力者优先。');
INSERT INTO `t_jobdata` VALUES ('77', '售前咨询与解决方案专家（财务/供应链/HR/云平台与大数据）', '40-70k·16薪', '北京-东城区', '用友网络科技股份有限公司', 'https://www.liepin.com/job/1949853463.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=1&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=39&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=1&pageSize=40&index=39', '北京', '大数据', '40000.00', '70000.00', '55000.00', '岗位职责：\n1、负责售前阶段客户需求调研和方案介绍\n2、负责售前阶段客户定制化方案的编写与讲解\n3、负责售前阶段客户招标需求与立项报告的编写\n4、负责售前阶段投标方案的编写与讲标\n5、负责售前阶段产品演示与POC展示\n6、参与咨询类项目的部分工作\n7、负责部门安排的交付项目的设计规划方案的编写。\n8、负责专业领域的成果创新\n\n任职要求：\n1、善于沟通，思维敏捷，有优秀的表达能力。\n2、有优秀的方案撰写能力，文字功底扎实。\n3、能出差，抗压性强，吃苦耐劳者优先。\n4、学历：本科以上。');
INSERT INTO `t_jobdata` VALUES ('78', '大数据总监', '50-75k·14薪', '北京', '知名海外教育公司', 'https://www.liepin.com/a/37524583.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=0&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=0', '北京', '大数据', '50000.00', '75000.00', '62500.00', '领导数据平台服务团队，完成大数据平台底层能力的建设，为整个集团提供稳定可靠，快速响应的数据服务，主导推动数据驱动的企业价值观。\n1、具有丰富的数据分析，数据产品，数据仓库工作经验和管理经验，参与过数据分析，智能AI领域的市场产品设计、规划和创新工作；\n2、熟悉和了解全球流行的数据平台的开源或商业产品，具有较深产品思路和想法；\n3、对业务需求敏感，并能积极与业务方沟通，了解业务变化及时调整产品满足业务需求；\n4、关注产品的数据并进行分析，参与产品的优化和改进，领导研发团队实现产品功能并跟进产品运营效果分析。\n\n岗位要求\n1、技术过硬，熟练掌握Java/Python/Scala/Go等一种及以上编程语言；\n2、熟悉大数据生态的计算引擎/调度平台，熟悉Spark/Elasticsearch/kylin/Clickhouse/doris等主流大数据引擎，做过源码分析和优化；\n3、对基于flink流式数据计算平台/实时数据仓库有一定的了解；\n4、丰富的人才培养体系建设经验，善于分享；\n5、统招本科以上学历，海外大学学习经验者优先；\n6、英文为工作语言，有开放包容异国文化的全球视野；\n7、有出色的商业洞察与研究能力，具备好奇心，对行业具备快速学习能力；\n8、互联网或咨询、金融、电信行业10年以上数据分析，数据平台搭建工作经验者优先。');
INSERT INTO `t_jobdata` VALUES ('79', '大数据开发工程师', '30-50k·15薪', '上海-长宁区', '某上海大型互联网公司', 'https://www.liepin.com/a/38879215.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=1&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=1', '上海', '大数据', '30000.00', '50000.00', '40000.00', ' 工作内容\n\n1. 基于主流开源组件，完成大数据计算框架的设计、开发 2. 分析业务场景，进行数据组件选型，设计数据仓库、数据流并落地\n\n 职位要求\n\n1. 具备扎实的计算机科学功底、编程基础和数据结构算法基础 2. 掌握数据仓库体系架构、数据建模方法、数据治理等知识 3. 了解业内主流的大数据解决方案，对前沿技术有持续跟踪和了解 4. 熟练掌握Hbase、Hive、Spark、HDFS等大数据技能 5. 有较好的Java或者Python基础，扎实的SQL基础 6. 熟悉MySQL、Redis、ES、Clickhouse等数据库 7. 精通多线程编程，有分布式开发经验值优先 8. 具有快速解决问题的能力和较强的学习能力');
INSERT INTO `t_jobdata` VALUES ('80', 'BU CEO（被投大数据公司）', '130-180k·14薪', '上海', '某专业服务公司', 'https://www.liepin.com/a/38416193.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=2&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=2', '上海', '大数据', '130000.00', '180000.00', '155000.00', '■事业部CEO，有互联网大厂经验，全盘管理经验\n■10年以上大厂一号位二号位经验，BAT华为经验优先\n■国内或者港股上市经验优先');
INSERT INTO `t_jobdata` VALUES ('81', '大数据中台资深Java研发工程师（架构师）', '20-50k·13薪', '北京-海淀区', '云器科技', 'https://www.liepin.com/job/1945657109.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=3&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=3', '北京', '大数据', '20000.00', '50000.00', '35000.00', '职责描述：\r\n1、参与和负责数据中台的各类大数据开发平台，数据服务平台的开发和集成工作，包括但不限于离线开发平台，实时计算平台，算法应用平台，指标资产服务平台以及各类数据产品服务\r\n2、支持企业级数据中台构建，服务和支持企业数据工程业务核心流程和各类数据应用产品，包括但不限于广告，风控，营销，推荐，流量分析等业务场景\r\n3、以数据驱动业务为目标，建设和完善统一的用户画像，标签，图谱等服务体系\r\n\r\n\r\n任职要求：\r\n1、有扎实的Java技能基础 ，熟悉缓存、消息、搜索，数据库等底层组件\r\n2、有微服务开发经验，对微服务基础的概念，框架和周边组件有较好的理解和实践\r\n3、对大数据平台调度系统，权限管理系统，监控报警系统，数据采集交换系统，指标特征系统，机器学习系统等其中一项或多项技术和相关项目开发经验优先\r\n4、熟悉大数据生态圈相关组件技术，对底层各类计算存储引擎有过开发或深度应用经验的同学优先');
INSERT INTO `t_jobdata` VALUES ('82', '大数据开发工程师', '15-30k·14薪', '西安-高新区', '西安华为', 'https://www.liepin.com/job/1951104649.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=4&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=4', '西安', '大数据', '15000.00', '30000.00', '22500.00', '岗位职责：\n1.负责大数据应用项目的可行性分析，制定软件开发、实施计划并亲自落实、执行；组织、协调软件项目所需的资源，及时解决软件项目开发、实施中遇到的各种问题；\n2.利用目前正在发展的大数据分布式平台前沿技术的应用，开展大数据相关项目；\n3.负责大数据系统架构，业界数据仓库建模及新的建模方法的发展；\n4.负责DW，BI架构体系的专项建设；\n5.理解业务诉求，转化为对数据的建模，帮助大数据开发人员更好的理解业务需求；管理跟进数据开发和业务分析为主的项目,完成各项目例行报告汇总和整理;\n6.与公司内部各部门进行沟通，协调各项资源，确保项目整体成功；\n7.深入分析公司数据治理需求，规划数据治理框架和数据标准，设计数据治理的增值应用服务场景和实施路线，包含数据标准管理、主数据管理、元数据管理、数据质量管理、数据生命周期管理等领域的规划。\n职位要求：\n1.本科及以上学历\n2.3年以上大数据相关项目经验；\n3.熟悉Java,pythons hadoop、storm、hive、spark、Kafka、Phoenix等应用；\n');
INSERT INTO `t_jobdata` VALUES ('83', '医疗大数据销售经理', '15-25k', '哈尔滨-松北区', '北京深睿博联科技有限责任公司', 'https://www.liepin.com/job/1946556379.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=5&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=5', '哈尔滨', '大数据', '15000.00', '25000.00', '20000.00', '职责描述：\n1、负责拓展新医院和维护现有医院的项目，对医院端、政府端解决方案销售负责。\n2、建立与辖区内医院的合作，维护关键客户和合作渠道，完成相应指标。\n3、配合运营体系持续可跟踪服务医院及专家，挖掘客户需求。\n\n岗位要求:\n1，大专及以上学历，医疗信息化背景优先，有一定的行业资源；\n2，对医疗大数据领域有一定认知和见解，有兴趣和激情一起加入创业团队；\n3，有独立的项目管理、策划和执行能力，有一定的研究和科研思维；\n4，客户服务第一的工作思维；\n5，有独立的思维能力，具备较强的学习和创新能力。');
INSERT INTO `t_jobdata` VALUES ('84', '大数据风控总经理', '80-100k·14薪', '深圳', '某国内银行公司', 'https://www.liepin.com/a/37950253.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=6&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=6', '深圳', '大数据', '80000.00', '100000.00', '90000.00', '1、负责制定和检视线上线下全渠道业务的贷前、贷中及贷后各环节的风险政策与流程，具体包括客户准入、分层、评分、授信、定价、用信、还款及额度等信贷流程各阶段的政策与策略；\n2、通过对各类风险指标与报表的分析，关注各类资产和客群的风险变动，对全渠道风险政策与策略进行跟踪评价，并及时优化调整相应的风险政策与策略。\n3、与模型开发人员、产品和运营团队、研发团队紧密配合，开发基于模型应用的产品策略、定价策略、授信策略、调额策略及其他贷后管理策略；\n4、负责相关策略和规则的汇报，获得审批后、提出系统实施需求，并完成投产测试和部署工作；对各产品运营、风险政策进行监控分析，完成分析报告，通过数据分析不断改进产品策略和规则。\n任职要求：\n1、全日制本科及以上学历，统计、数学、金融、计量经济等相关专业；\n2、10年以上银行零售信贷/消费金融公司/互联网金融公司等业务风控相关工作经验，熟悉了解个人信贷风险要点和全生命周期风控体系；\n3、熟悉风险规则工作，对个人借款客户风险分析具有分析的经至少具有相关工作背景；\n4、熟悉征信及大数据应用；具备较强逻辑思维能力、沟通协调能力及团队合作精神。');
INSERT INTO `t_jobdata` VALUES ('85', '大数据平台开发工程师', '15-20k', '南京-鼓楼区', '中储智运', 'https://www.liepin.com/job/1950793877.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=7&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=7', '南京', '大数据', '15000.00', '20000.00', '17500.00', '职责描述：\n1、负责参与公司数据中台的统一调度平台、实时数仓平台、离线数仓平台、资产管理平台等平台建设，为海量数据和业务系统提供可靠的业务能力支撑。\n2、负责大数据平台的基础工具和平台的研发和维护; \n3、大数据前沿开发技术的研究和推广。\n任职要求：\n1、全日制本科、计算机、统计或其它相关专业本科及以上学历，5年以上开发经验，2年以上大数据相关研发和运维经验;\n2、精通Java编程语言 ，能进行Hadoop或Flink组件相关开发;\n3、熟悉Hadoop平台开源产品，熟悉Flink、 Spark一种或者多种计算引擎;\n4、熟悉Kafka、HBase、 HDFS、 Hive、 Presto等开源组件中的一种或多种;\n5、深度理解软件工程，具备分布式、高性能等开发经验，有过大数据平台开发经验者优先;\n6、肯钻研，能抗压，有较强的解决问题和沟通协调的能力。');
INSERT INTO `t_jobdata` VALUES ('86', '大数据架构师', '50-65k·15薪', '上海-浦东新区', '量投网络科技', 'https://www.liepin.com/job/1939538157.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=8&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=8', '上海', '大数据', '50000.00', '65000.00', '57500.00', '岗位职责：\r\n1、数据服务平台和数据开发平台的架构工作。利用自研、开源或者商业组件，实现数据开发平台和服务平台的功能；\r\n2、设计相关平台的功能模块，并能带队开发完成相关功能模块的开发工作；\r\n3、针对各类数据应用场景，设计场景实现的架构，并能够带队开发实现相关场景。\r\n\r\n任职资格：\r\n1、本科及以上学历，5年以上数据开发经验，2年以上大数据开发经验；\r\n2、有扎实的Java语言基础或Python语言基础，熟悉Linux,shell；熟悉Docker，有Kubernetes集群使用经验者优先，熟悉Greenplum者优先；\r\n3、对数据产品和平台有一定的理解和思考，具备设计和开发数据产品的经验；\r\n4、熟悉常用的大数据组件，如Hive,Kafka,Spark,Flink等，有大数据产品开发经验和流数据处理经验者优先；\r\n5、有开源项目参与经验及二次开发经验者优先；\r\n6、具备较强学习能力,对技术有好奇心，有热情和渴望。');
INSERT INTO `t_jobdata` VALUES ('87', '大数据开发工程师', '15-30k', '武汉-汉阳区', '浙江吉利控股集团', 'https://www.liepin.com/job/1951456253.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=9&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=9', '武汉', '大数据', '15000.00', '30000.00', '22500.00', '工作职责\n1.负责基于spark，flink的离线/实时数据计算\n2.负责大规模业务,日志等数据的收集、清洗、入库、分析等工作\n3.负责数据治理,接口开发等工作, 提升数据易用性及数据质量 \n4.理解并合理抽象业务需求,发挥数据价值,与业务团队紧密合作\n任职要求\n1、具有大数据相关领域3年及以上开发经验;\n2、熟悉主流大数据工具,包括但不限于Hadoop,hbase,ES,kafka,redis,flume,kafka,hive，zk等；  \n3、具有海量数据实际开发经验,能熟练使用Spark、Flink进行离线和实时数据开发及优化；\n4、熟悉java,scala或者python编程语言;掌握Jvm GC调优;\n5、熟悉mysql等主流数据库,熟悉sql语言;\n6、熟悉linux操作系统，熟悉shell开发；\n7、熟悉高性能,高可用,高拓展者优先,具有车联网以及营销相关大数据开发经验优先；\n8、善于学习,积极主动,有团队合作精神。');
INSERT INTO `t_jobdata` VALUES ('88', '大数据平台负责人', '100-170k·15薪', '上海', '某上海互联网上市公司', 'https://www.liepin.com/a/38955827.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=10&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=10', '上海', '大数据', '100000.00', '170000.00', '135000.00', '岗位职责：\n1-负责集团数据平台中长期战略，参与公司总体数据技术架构的设计，制定有关数据平台的规范与使用流程\n2-带领技术团队，设计，研发，运维公司数据中台各模块，保持数据系统的稳定性，提升数据研发效率，通过大数据技术赋能公司各业务条线，提升业务价值\n3-在实时数仓、湖仓一体，增强分析，自动机器学习等领域负责关键技术调研与落地\n4-协同数据产品团队，设计、规划数据中台的产品化与商业化的实施路径，负责技术实现与产品落地，打造金融领域的下一代数据中台解决方案\n5-负责公司用户行为分析、用户标签与画像系统的设计研发，更紧密打造数据平台与智能数据应用（CRM、智能客服、风控决策、智能营销等）的闭环\n\n岗位要求：\n1-计算机、软件工程等相关专业，本科或者以上学历\n2-8年以上Java开发经验，熟悉常用的Java框架，理解框架的原理与运行机制\n3-熟悉Hadoop/Spark/Impala/Clickhouse/Flink/Hbase/ES等两种或以上技术，具有开源代码优化经验者优先，具有阿里云、Azure、AWS等云厂商数据平台开发与深度使用经验的优先\n4-5年以上大数据研发条线管理经验，组织过中等规模以上大数据相关数据平台的选型、开发与落地，对高性能、高可靠，海量数据分析场景有深入理解\n5-善于沟通交流，有良好的团队合作与协调能力，能够提升团队的综合能力，有强烈责任性，业务结果导向\n');
INSERT INTO `t_jobdata` VALUES ('89', '资深解决方案专家-政务大数据', '30-45k·14薪', '长沙', '大数据基础设施服务商', 'https://www.liepin.com/a/39047105.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=11&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=11', '长沙', '大数据', '30000.00', '45000.00', '37500.00', '岗位职责：\n1、理解数字政府客户的大数据需求、功能需求，基于政府客户政务大数据项目提供业务咨询、技术咨询、规划、设计、推广等专业服务。\n2、结合政务大数据项目实践，基于技术架构和优势产品，根据政务大数据业务要求进行业务流程改造，输出满足市场需求的政务大数据解决方案，负责项目售前阶段的技术交流、方案设计、项目立项、概念验证等工作。\n3、完成政府项目投标工作，负责投标阶段技术方案和技术应标全流程工作 \n4、作为技术专家担任政务大数据项目售前负责人，统筹管理项目所涉及的技术团队和合作伙伴工作。\n5、跟踪政务大数据行业进展及市场动态，不断创新完善设计的方法论和解决方案，能够突破创新。\n\n任职要求：\n1、本科及以上学历，五年及以上大数据相关的规划、建设经验，熟悉大数据技术架构知识。 \n2、熟悉政府数据资产的建设与应用，参与主导过大中型政务大数据规划、设计和交付。 \n3、熟悉政务数据库（人口库、法人库、事项库、电子证照库等），熟悉Hadoop、Hive、 Spark等大数据常用技术。有海量数据分析、数据挖掘及数据清洗经验者优先。有数据治理、数据开发、数据分析、数据建模经验者优先。\n4、逻辑思维清晰，积极主动，善于思考，责任心强，具备较强的学习能力及理解能力。对技术、市场具有强烈的敏锐度，并能及时掌握政务大数据新的技术发展趋势和业务发展动向，对关键技术有独到见解，能够从业务的角度来进行技术架构设计完善。\n5、能够进行业务调研、业务梳理，并根据用户的需求，编制需求说明书、可研、设计文档、技术管理文件，能够独立开展政务项目的技术汇报。');
INSERT INTO `t_jobdata` VALUES ('90', '资深大数据分析师', '50-80k', '深圳', '广发银行深圳分行', 'https://www.liepin.com/job/1917376559.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=12&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=12', '深圳', '大数据', '50000.00', '80000.00', '65000.00', '职责描述：\r\n根据分行及部门的规划，进行分行大数据、机器学习、人工智能工作的规划，组织进行数据类产品的实施,具体包括：\r\n1. 负责大数据平台规范化及建设、大数据用户标签画像体系建设、大数据洞察分析与商业应用落地工作			\r\n2. 负责大数据分析挖掘模型的建立、应用、监控优化			\r\n3. 负责重点大数据分析项目方案制定、项目实施落地及优化		\r\n4. 负责用户标签画像、数据挖掘模型等的业务落地			\r\n5. 责大数据及人工智能、区块链方面新技术的研究及应用			\r\n6.完成上级交代的其它工作\r\n\r\n\r\n任职要求：\r\n1、计算机、数学、统计等相关专业本科以上学历； \r\n2、5年以上数据处理工作经验，有丰富的大数据分析项目经验，并在重点项目中担任重要角色，有银行或金融行业数据类项目经验优先；\r\n3、熟悉大数据、云计算、AI、区块链等行业技术发展趋势；\r\n4、熟悉大数据解决方案包括：hadoop生态圈、spark、greenplum、kafka、storm等；\r\n5、对金融行业技术发展趋势有较深入了解和追踪，对技术市场有一定的敏感度，对公司的技术发展及产品应用能提供决策性建议；\r\n6、具备较强的学习和独立解决疑难技术问题的能力； \r\n7、工作认真、作风严谨、责任心强，具备积极的工作态度和良好的团队合作精神，服从工作安排，能承受一定工作压力。');
INSERT INTO `t_jobdata` VALUES ('91', '大数据平台架构师', '40-60k·24薪', '上海-徐汇区', '世界500强知名公司', 'https://www.liepin.com/a/38821915.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=13&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=13', '上海', '大数据', '40000.00', '60000.00', '50000.00', '工作职责：\n\n1、参与集团大数据平台的整体规划，包括技术架构、研发体系和运维体系等，促进平台稳定高效运行，以及数据的安全、准确；\n\n2、负责特征标签、数据采集分析、风险管理等数据系统的技术框架及各组件的选型、部署、优化和管理，提供各项数据服务的最 佳实践指导，并推动落地；\n\n3、协同实施部门不断优化各类大数据平台工具及计算引擎的稳定性、性能和易用性，包括核心ETL作业的优化等；\n\n4、重难点问题的攻关解决，技术管理和人才培养，紧跟最 新技术趋势，持续创新、引 领。\n\n\n\n任职要求：\n\n1、本科以上学历，5年及以上大数据平台架构/研发相关经验；\n\n2、有大型企业PB级大数据平台建设的实战经验，熟悉大数据生态圈主流平台工具的底层架构和技术原理，如Hadoop/Kafka/Flink/Clickhouse/Hologress等；\n\n3、精通Linux系统，精通Java/C++/Scala等语言中的至少一种（Java优  \n 先），熟悉ansible/puppet/saltstack等自动化部署工具中的至少一种；\n\n4、自我驱动力强，有良好的逻辑思维能力，面对复杂情况能够独立应对和总结，有较强的跨部门沟通协调能力，高效推进工作；\n\n5、熟悉阿里云生态体系优 先；熟悉数仓架构/数据ETL优 先；有带人经验优 先。');
INSERT INTO `t_jobdata` VALUES ('92', '大数据总监', '100-150k·14薪', '北京-朝阳区', '某知名互联网公司', 'https://www.liepin.com/a/38891971.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=14&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=14', '北京', '大数据', '100000.00', '150000.00', '125000.00', '1. 深入理解数据产品需求，紧跟技术发展趋势，带领团队进行设计并搭建业界前沿的数据服务整体技术架构。\n2. 带领团队解决技术选型、关键核心模块的研发等技术挑战及疑难问题，包括低延时实时计算、大规模历史数据存储及分析、数仓设计以及算法建模支持等。\n3. 对接公司内、外部不同业务线的数据存储及服务需求，开发并维护融合多数据源的数据仓库，提供多场景、高效的数据查询分析工具。\n4. 负责优化分布式框架，解决大计算量下的各种问题，为公司批处理和流式计算能力提供支撑。\n5. 基于技术框架的选型，协助运维管理并实施高效的监控、系统优化和平台扩容。\n6. 负责大数据部核心团队的组织规划、管理培养和绩效考核，提高团队在全公司甚至行业的技术影响力。\n任职资格：\n1.计算机等相关理工科专业本科及以上学历，有较好的理论及计算机工程基础、快速学习能力。\n2. 5年以上互联网优秀企业技术开发与交付工作经验，3年以上团队管理经验。\n3. 精通 Hadoop、Spark、Flink、Hive、Kafka、ES、Doris、Redis、Zookeeper 等大数据相关技术及中间件，并能结合业务场景进行架构设计。\n4. 数据平台搭建上有多年的从0到1再到n的成功经历，深入了解数据仓库体系，并有成功的业务场景落地经验。\n5. 熟悉流式数据处理框架，能够根据数据特征采用不同的技术方案，有大数据治理服务经验。\n6. 乐观向上，自驱力强，善于沟通及跨部门协作，具备敏锐的洞察力和良好的抗压能力。\n7. 具备前沿技术视野，有显著的研发和工作成绩，有一定行业影响力。');
INSERT INTO `t_jobdata` VALUES ('93', '大数据解决方案工程师', '12-21k', '成都', '清华四川能源互联网研究院', 'https://www.liepin.com/job/1949719347.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=15&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=15', '成都', '大数据', '12000.00', '21000.00', '16500.00', '职责描述：\n1.基于公司已有软件模块和开源组件，协调多方资源，完成大型工业能源客户的项目交付和管理，开展需求确认、制定交付计划，并顺利完成项目验收和签收；\n2.负责处理客户的各类故障，提供事务的应急响应和技术支持，要求能够熟悉客户的网络环境和应用系统架构，协助客户分析问题和排查问题；\n3.负责项目所需分析报告、汇报材料等的整理和编写；\n4.负责提供在线、远程、上门产品培训服务。\n任职要求：\n1.本科及以上学历，计算机相关专业优先；\n2.至少2年以上互联网或软件产品售后技术支持工作经验，有IT软件、互联网行业项目管理者优先；\n3.有一定网络基础，熟悉Linux系统，了解tcp/ip协议、http协议等常用的网络协议，能够熟练使用常用的网络工具排查问题；\n4.具有软件开发经验，熟悉shell、python或其它至少一种脚本语言；熟悉Java语言者优先；\n5.了解物联网数据采集、常见工业数据采集传输协议者优先；\n6.熟悉大数据相关技术者优先；熟悉数据分析算法者优先\n7.具备较强的独立分析及解决问题的能力，良好的沟通协调能力，责任心强，具备良好的服务意识；\n8.工作积极主动，能力强，可以独当一面。');
INSERT INTO `t_jobdata` VALUES ('94', '大数据平台基础架构工程师', '40-70k', '深圳-福田区', '某深圳大型基金证券公司', 'https://www.liepin.com/a/39277229.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=16&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=16', '深圳', '大数据', '40000.00', '70000.00', '55000.00', '岗位职责：\n1、负责大数据平台的规划、建设和运维保障，为平台的稳定、高效运行负责，支撑业务快速发展；\n2、制定大数据平台开发对接规范，负责大数据平台接入应用的架构审核、业务监控、持续交付、应急响应等工作；\n3、发现并解决大数据平台的重大故障及性能瓶颈，提升产品整体质量，改善用户体验，控制系统成本。\n任职要求：\n1、计算机或数据科学等相关专业；\n2、5年及以上大数据平台规划及运维经验，熟悉主流大数据平台，如Cloudera，星环大数据，华为大数据等；\n3、熟悉大数据组件hadoop、hbase、hive、storm、spark、kafka、flink等原理，能够对系统可靠性、性能进行分析，排除系统隐患和提高系统性能；\n4、深入理解linux系统，能够独立排查及解决操作系统层的各类问题；\n5、熟悉python、shell，具备一定的开发能力，能够根据需求开发大数据平台监控和运维工具；\n6、具有金融行业大数据平台基础架构经验、具有开源项目开发经验者优先。');
INSERT INTO `t_jobdata` VALUES ('95', '大数据运维工程师（银行）', '20-25k·16薪', '武汉-黄陂区', '某武汉大型银行公司', 'https://www.liepin.com/a/39297873.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=17&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=17', '武汉', '大数据', '20000.00', '25000.00', '22500.00', '岗位职责：\n1、承担全行大数据平台的建设与维护工作\n2、承担全行大数据平台关键技术的攻关和推广应用\n3、实施全行大数据层面的安全策略，执行相关安全防范措施\n4、承担大数据层面的性能分析及优化，承担大数据层面故障的处理、分析与总结\n5、为信息科技部其他团队提供大数据层面的基础性技术支持\n6、协助建立、完善运行知识库\n7、完成领导交办的其它工作\n岗位要求：\n1、3年或以上大数据平台建设或运维经验，有银行大数据平台研发或运维经验优先');
INSERT INTO `t_jobdata` VALUES ('96', '需求分析师-大数据', '10-13k·14薪', '沈阳-铁西区', '凯捷咨询(中国)有限公司', 'https://www.liepin.com/job/1950572343.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=18&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=18', '沈阳', '大数据', '10000.00', '13000.00', '11500.00', '•负责系统的业务场景和流程设计。\n•根据用户建议，持续优化和提升系统体验。负责产品待办事项。\n•与项目方合作设计服务模式，优化服务流程，规划能力，设计服务产品。\n•负责培训和指导其他团队成员完成任务。\n•负责推动产品落地和变现。\n•负责增值支持解决方案/服务的成功交付。\n•对团队产品负责。\n•较强的英语书面和口头沟通能力\n•精通数据分析相关的规划和产品设计。\n•敏捷项目专家。\n•云解决方案专家。\n•丰富的数据分析功能，提供咨询、实施、运营支持的产品规划设计。\n•产品设计关注产品质量、业务流程和交付成果，对产品质量负责。\n•在为指定行业的客户提供过程信息技术服务方面有良好的管理记录。\n•精通信息技术项目的转型与转型。\n•有效的全球和中国本地业务和IT团队合作。\n•有并行推进多个系统需求的Scrum经验。\n•具有在多个系统上管理多个并行项目的大型程序的经验。');
INSERT INTO `t_jobdata` VALUES ('97', '大数据开发工程师', '15-20k·14薪', '上海-静安区', '上海弼博信息技术有限公司', 'https://www.liepin.com/job/1951581953.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=19&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=19', '上海', '大数据', '15000.00', '20000.00', '17500.00', '岗位职责：\n1.负责大数据应用项目的可行性分析，制定软件开发、实施计划并亲自落实、执行；组织、协调软件项目所需的资源，及时解决软件项目开发、实施中遇到的各种问题；\n2.利用目前正在发展的大数据分布式平台前沿技术的应用，开展大数据相关项目；\n3.负责大数据系统架构，业界数据仓库建模及新的建模方法的发展；\n4.负责DW，BI架构体系的专项建设；\n5.理解业务诉求，转化为对数据的建模，帮助大数据开发人员更好的理解业务需求；管理跟进数据开发和业务分析为主的项目,完成各项目例行报告汇总和整理;\n6.与公司内部各部门进行沟通，协调各项资源，确保项目整体成功；\n7.深入分析公司数据治理需求，规划数据治理框架和数据标准，设计数据治理的增值应用服务场景和实施路线，包含数据标准管理、主数据管理、元数据管理、数据质量管理、数据生命周期管理等领域的规划。\n职位要求：\n1.本科及以上学历，计算机或数学相关专业；\n2.3年以上大数据相关项目经验；\n3.熟悉hadoop、storm、hive、spark、Kafka、Phoenix等应用；\n4.英语良好；\n5.优秀的团队协作、解决问题的能力。');
INSERT INTO `t_jobdata` VALUES ('98', '大数据总监', '40-50k', '常州', '某国内新能源上市公司', 'https://www.liepin.com/a/39300255.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=20&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=20', '常州', '大数据', '40000.00', '50000.00', '45000.00', '职位名称：大数据部负责人\n汇报对象：全球IT负责人\nBase：江苏常州\n工作职责：\n1、	负责大数据平台整体规划与分步实施落地，赋能业务，服务管理；\n2、	协同构建公司数据管理体系、文化，推动数据治理平台实施、落地；\n3、	探索、构建高价值数据应用场景，开发数据解决方案，探索适合业务需求的算法应用，持续挖掘数据价值，打造高价值数据产品和服务\n4、	持续构建和完善湖仓一体化平台，建立高效交付体系\n5、	负责大数据项目管理与交付，包括项目开发、落地实施、内外部资源协调、项目计划跟踪、风险管控、质量管控等；\n6、	打造和持续提升大数据运营能力，包括数据运营、平台运营、数据文化推广、数据质量提升等；\n7、	构建和完善培训知识库，提高客户满意度；\n\n任职要求：\n1、	大学本科以上学历，计算机、数学、统计学类专业为佳，有DAMA相关专业认证证书者优先考虑\n2、	具备5年以上规模以上企业大数据工作经验，2年以上不低于20人团队管理经验，有数据治理平台成功交付经验者优先。\n3、	较强的团队管理、项目管理和资源协调能力，具备超强的场景构建能力，具备良好业务视角，有至少一个以上业务域应用系统实施交付经验\n4、	具备数据架构能力，精通离线大数据、和实时数仓技术体系，能熟练运用主流数据开发技术栈进行品质交付，具备较好的算法功底\n5、	优秀的统筹、协调、沟通能力和团队合作精神，具备强烈的上进心、责任心和敬业精神，自我驱动，目标导向');
INSERT INTO `t_jobdata` VALUES ('99', '大数据工程师', '15-30k·16薪', '深圳-南山区', '某深圳大型通信公司', 'https://www.liepin.com/a/39295011.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=21&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=21', '深圳', '大数据', '15000.00', '30000.00', '22500.00', '负责华为云数据湖(大数据，数仓）相关项目的方案、交付\n1.作为集成交付项目TL/TD，对数据湖建设/搬迁方案设计和履行，对项目成功交付负责\n2、客户需求分析和数据湖落地方案设计\n3、基于数据湖技术、应用规划，帮助客户挖掘数据价值\n4、支持&指导ISV将应用迁移到华为数据湖\n5、挖掘客户业务对产品诉求，帮助研发优化数据湖产品的使用\n技能要求：\n1.服务方案设计能力：\n     具备独立设计大数据\\数仓\\数据中台的方案设计能力；\n2.服务方案交付能力： \n     良好的项目风险识别和技术问题管理能力，可以主导区域内华为云重大项目交付和风险问题管理。\n      可以独立带队完成项目交付，主导技术方案；\n3.业务知识： \n    掌握大数据平台主流应用场景的技术架构；或数仓平台主流应用场景的技术架构；\n  专业要求：\n1.具备编程基础：具备Java基础，SQL，Python，Shell至少熟悉一种；\n2.熟悉Hadoop生态主流产品（包含AWS,Azure,阿里，CDH等厂商的商用大数据平台）的原理和开发使用；\n3.熟悉主流分布式数据库（如 AWS,Azure,阿里等的 云数仓产品，Postgres,Vetica等主流 分布式数据仓库）（2和3，至少满足一个）\n4.具备互联网、金融、汽车行业的行业知识（至少一个），理解该行业的基本技术架构，业务架构；\n5.具备独立带团队完成数据中台、数仓的建设经历\n优先：\n1.具有华为HCIE-Bigdat，AWS，Azure,阿里等厂商等效大数据证书；\n2.具有Oracle，DB2，Terdata 等效数仓/数据库证书\n3.有咨询公司大数据或数据治理咨询经验者优先。');
INSERT INTO `t_jobdata` VALUES ('100', '大数据工程师', '15-30k·16薪', '广州-越秀区', '某深圳大型通信公司', 'https://www.liepin.com/a/39294851.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=22&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=22', '广州', '大数据', '15000.00', '30000.00', '22500.00', '负责华为云数据湖(大数据，数仓）相关项目的方案、交付\n1.作为集成交付项目TL/TD，对数据湖建设/搬迁方案设计和履行，对项目成功交付负责\n2、客户需求分析和数据湖落地方案设计\n3、基于数据湖技术、应用规划，帮助客户挖掘数据价值\n4、支持&指导ISV将应用迁移到华为数据湖\n5、挖掘客户业务对产品诉求，帮助研发优化数据湖产品的使用\n技能要求：\n1.服务方案设计能力：\n     具备独立设计大数据\\数仓\\数据中台的方案设计能力；\n2.服务方案交付能力： \n     良好的项目风险识别和技术问题管理能力，可以主导区域内华为云重大项目交付和风险问题管理。\n      可以独立带队完成项目交付，主导技术方案；\n3.业务知识： \n    掌握大数据平台主流应用场景的技术架构；或数仓平台主流应用场景的技术架构；\n  专业要求：\n1.具备编程基础：具备Java基础，SQL，Python，Shell至少熟悉一种；\n2.熟悉Hadoop生态主流产品（包含AWS,Azure,阿里，CDH等厂商的商用大数据平台）的原理和开发使用；\n3.熟悉主流分布式数据库（如 AWS,Azure,阿里等的 云数仓产品，Postgres,Vetica等主流 分布式数据仓库）（2和3，至少满足一个）\n4.具备互联网、金融、汽车行业的行业知识（至少一个），理解该行业的基本技术架构，业务架构；\n5.具备独立带团队完成数据中台、数仓的建设经历\n优先：\n1.具有华为HCIE-Bigdat，AWS，Azure,阿里等厂商等效大数据证书；\n2.具有Oracle，DB2，Terdata 等效数仓/数据库证书\n3.有咨询公司大数据或数据治理咨询经验者优先。');
INSERT INTO `t_jobdata` VALUES ('101', '大数据及人工智能研发岗', '25-50k', '广州-天河区', '某大型世界500强银行公司', 'https://www.liepin.com/a/39287321.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=23&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=23', '广州', '大数据', '25000.00', '50000.00', '37500.00', '岗位职责：\n1. 负责对用户的数据需求提出全流程解决方案。\n2. 负责大数据与人工智能领域研发任务。\n3. 参与大数据与人工智能领域的前瞻性研究。\n4. 参与我行数据中台、数字化转型前瞻性研究和规划。\n5. 负责将规划及前瞻性研究成果在我行零售业务领域落地。\n任职要求：\n1. 熟悉大数据、人工智能领域的理论、常用算法、框架，至少在如下一个领域有深入研究：计算机视觉、自然语言处理、知识图谱、机器学习、强化学习。\n2. 具有联邦学习、多方安全计算等领域的实践经验。\n3. 具备较强的数据洞察能力、数据分析能力、逻辑思维能力与团队协作能力。\n4. 了解大数据及人工智能领域前沿知识，具备积极主动的工作态度和快速学习能力，对新技术与应用有强烈的求知欲和学习能力，有较高的外文资料阅读和翻译能力。\n5. 参与过金融行业数据中台建设或金融行业数字化转型优先。\n6. 了解银行个人金融/信用卡等业务知识优先。\n7.全日制大学研究生及以上学历，计算机、电子信息科学、人工智能及大数据相关专业，6年及以上工作经验，至少3年在大数据人工智能领域的工作经验。');
INSERT INTO `t_jobdata` VALUES ('102', '高级大数据测试', '20-22k·13薪', '上海-虹口区', '某北京大型IT服务公司', 'https://www.liepin.com/a/39286089.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=24&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=24', '上海', '大数据', '20000.00', '22000.00', '21000.00', '岗位职责:\n1. 负责大数据各数据层，数据集市，BI报表等相关产品的测试工作，包含数据清洗逻辑，数据口径，数据准确性等各个方面，对产品质量负责\n2. 根据需求，确定测试方法及内容，排定测试计划，编写测试用例，独立执行测试工作，\n3. 对团队内其他测试人员的测试案例及测试脚本进行评审，提供优化方案\n4. 与项目相关人员就需求和项目进度，测试范围进行有效沟通，保证产品质量，提升客户满意度\n5. 参与大数据各层的设计评审，提供反馈和优化建议，帮助改进项目质量\n6. 对整个大数据测试的方案及测试方法提出优化建议，协助推动大数据自动化测试的实施\n岗位要求:\n1. 本科及以上学历\n2. 5年以上大数据测试工作经验，熟悉数据测试方法和测试流程。有金融行业相关经验优先。\n3. 熟悉数据清洗过程（ETL），数据模型的基本概念，了解数据仓库，数据集市，BI报表等数据产品的基本工作原理及测试方法，具备相关测试经验\n4. 熟悉Hadoop，Spark，Hbase，Kafka等分布式开源项目及工作原理\n5. 熟练掌握 Hive Sql 编写，具备编写复杂SQL能力，能够对复杂SQL进行调优\n6. 了解数据治理，数据质量管理相关知识\n7. 了解数据仓库或大数据性能测试方法\n8. 具有清晰的逻辑思维和较强的学习能力，良好的沟通协调能力和语言表达能力，工作积极主动，踏实负责，抗压能力强');
INSERT INTO `t_jobdata` VALUES ('103', '大数据研发工程师', '40-60k', '北京', '中国电信股份有限公司网络安全产品运营中心', 'https://www.liepin.com/job/1946697371.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=25&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=25', '北京', '大数据', '40000.00', '60000.00', '50000.00', '职位描述\r\n1、负责公司数据安全产品的数据仓库的开发与优化；\r\n2、参与数据治理工作，提升数据易用性及数据质量；\r\n3、负责数据模型的设计、离线/实时的ETL工作，为业务提供定制化的数据支持，并优化计算任务性能；\r\n4、理解并合理抽象业务需求，发挥数据价值，与业务团队紧密合作。\r\n5、汇聚中国电信全网dns、netflow、安全等数据，打造业界领先的存储、计算等分布式系统，为海量数据和大规模业务系统提供可靠的基础设施；\r\n职位要求\r\n1、扎实的编程和算法基础，熟练掌握 C/C++、Java、Golang、Python等一种或多种编程语言，能适应多语言开发环境；\r\n2、熟悉大数据处理工具/框架中的一项或多项，包括但不限于 Hadoop, clickhouse，Mapreduce, Hive, Storm, Spark, Druid, kafka, hbase，ES等精通SQL；\r\n3、能快速理解业务背景，对数据敏感，有大数据处理、数据平台、数据仓库开发经验，具备丰富的海量数据加工处理经验者优先；\r\n4、优秀的自我驱动力和责任心，良好的沟通表达能力和团队合作精神，学习能力强，能够站在用户的角度去理解问题。');
INSERT INTO `t_jobdata` VALUES ('104', '产业投资总监（智慧城市/大数据）', '25-40k', '苏州-工业园区', '苏州园区某国企', 'https://www.liepin.com/a/38470873.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=26&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=26', '苏州', '大数据', '25000.00', '40000.00', '32500.00', '工作职责：\n1、负责智慧城市、新基建、大数据投资项目的开发及项目洽谈；\n2、负责项目投资的可行性分析，评价项目投资可行性及风险性；设计合理的投资方式、投资架构、投资策略，设计并跟踪投资项目的落地；\n3、负责公司投资项目退出交易设计、文案起草、跟踪等基础工作；\n4、掌握、跟踪相关法律法规及政策动向，对公司投融资提出前瞻性的意见及决策参考。\n\n\n岗位要求：\n1、基本要求：全日制硕士及以上学历，经济、金融、管理相关专业；\n2、经验要求：3年以上智慧城市、新基建、大数据投资分析相关工作经验，成功参与过以上项目投资的优先；\n3、能力要求：熟悉智慧城市、新基建、大数据行业开发和投资管理相关政策及流程，具有较强的文字功底、书面及现场报告能力；具有较强的逻辑分析能力。至少跨学科的了解过企业经营管理、项目运作与管理、投资决策建模与管理等；\n4、其他要求：责任心强，工作认真细致，具有较强的自我学习能力与创新能力，具有良好的团队协作能力及组织沟通能力；能根据工作需求出差。\n\n');
INSERT INTO `t_jobdata` VALUES ('105', '大数据分析师', '20-30k', '上海-徐汇区', 'DotC United Group', 'https://www.liepin.com/job/1951596549.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=27&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=27', '上海', '大数据', '20000.00', '30000.00', '25000.00', 'Web3.0项目（基于现有大数据框架，开发大数据数据分析业务；；\n-负责产品数据质量与效率的优化；\n-负责基于大数据的分析挖掘运用于产品数据运营场景；\n-实现结构化数据的高性能运算、量化分析（如聚档、分类、回归分析、文本挖掘、图像处理、机器学习）、推荐算法等。\n职责要求:\n-有大型互联网公司大数据平台及数据开发经验者优先；\n-有大规模离线计算，实时计算，OLAP数据仓库和海量数据存储经验者优先；\n-精通大数据相关技术，包括但不限于hadoop /hive /flume /dolphinscheduler /hbase /kafka/spark；\n-至少熟练掌握如下一种语言：Java/Python/shell/HiveQL/ClickHouse，以及在数据处理过程中完成不同平台功能模块的开发、互调；\n-熟悉数据结构&算法、数理统计、大数据分析算法等基础知识；学习能力强，对于新技术、数据应用创新有浓烈的兴趣，敢于迎接挑战；\n-有知识图谱构建相关经验优先；\n-具备极强的交付意识与学习能力，有较强的产品理解、沟通、团队协作能力，细致耐心、积极主动；');
INSERT INTO `t_jobdata` VALUES ('106', '能源大数据专家', '45-70k·15薪', '北京', '某北京大型计算机软件公司', 'https://www.liepin.com/a/39302827.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=28&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=28', '北京', '大数据', '45000.00', '70000.00', '57500.00', '工作地点：北京\n工作职责：\n1、理解能源行业客户的大数据需求、功能需求，基于能源大数据项目提供业务咨询、技术咨询、规划、设计、推广等专业服务。\n2、负责能源大数据产品售前解决方案工作。参与前期的项目交流、需求引导、产品介绍、方案设计等工作。\n3、熟悉数据建模，数据安全，数据融合等数据应用业务，能够找到目标市场及客户，结合能源数据特点制定解决方案。\n4、持续关注和研究能源大数据行业政策动态、市场主流竞品公司和产品，协同产品和交付团队完善公司对应解决方案和产品线。\n5、对于项目需求，能够整合各种资源，快速包装解决方案。\n\n任职资格：\n1．博士，能力突出者可适当放宽至研究生。；\n2．熟悉能源大数据领域，有行业资源或客户开发能力；\n3．有敏锐的市场洞察力，较强的需求挖掘和分析应用能力。');
INSERT INTO `t_jobdata` VALUES ('107', '大数据总监（VP级别）', '70-75k·14薪', '上海', '某数据智能公司', 'https://www.liepin.com/a/39293905.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=29&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=29', '上海', '大数据', '70000.00', '75000.00', '72500.00', '关键信息：具备数据开发经历，有过大体量数据处理经验，比如日增10T以上。有过ID mapping经验。\n\n薪酬包：\n- 现金部分，base70K，14-18薪。\n- 股票部分：10W+，具体可谈，具有现金价值。\n岗位职责：\n1、负责公司数据部门中长期发展，参与公司总体数据技术架构的设计，制定有关数据平台的规范与使用流程\n2、带领大数据团队，完成平台工具的设计研发，以及优化；提升平台工具使用效率，通过大数据技术赋能公司各业务线，提升业务价值\n3、负责数据基础工具及数据仓库建设，核心数据指标可视化及监控，制定并实施数据规范，推进数据治理，提升数据质量\n4、承接业务侧数据模型线上开发需求，制定完整的数据开发需求评审、开发、测试、上线及后期运维保障流程，并且对线上任务稳定性负责\n5、分业务线量化大数据集群的计算和存储成本，通过数据分析和技术升级，优化集群、运维成本等\n\n任职资格：\n1、计算机、软件工程等相关专业，本科及以上学历\n2、精通数仓架构，有丰富的数据治理经验，对数据质量、可用性、安全性和一致性有全面的管理经验\n3、熟悉hadoop/Spark/Impala/Clickhouse/Flink/Hbase/ES等两种或以上技术，具有开源代码优化经验者优先，具有阿里云、Azure、AWS等云厂商数据平台开发与深度使用经验的优先\n4、5年以上大数据开发条线管理经验，组织过中等规模以上大数据相关数据平台的选型、开发与落地，对高性能、高可靠、海量数据分析场景有深入理解\n5、有较好的团队管理、跨职能合作、整合协调资源、系统规划等能力，有强烈的责任感，目标导向强');
INSERT INTO `t_jobdata` VALUES ('108', '产品经理(大数据领域）\r\n', '20-30k·20薪', '上海-浦东新区', '某央企研究院', 'https://www.liepin.com/a/37376709.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=30&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=30', '上海', '大数据', '20000.00', '30000.00', '25000.00', '职责：负责金融领域产品规划、设计，并牵头进行产品的管理：\n1、负责了解客户的需求，并对需求进行分析、管理；\n2、负责产品功能的定义、规划,并完成相关设计；\n3、负责在产品的整个生命周期内，协调研发、营销、运营等，管理相应产品线，确定和组织实施相应的产品策略，以及其他一系列相关的产品管理活动，实现产品的落地；\n4、负责产品的竞品分析以及研究产品的发展趋势，输出分析报告；\n5、研发基于行业场景的创新金融产品，并复制推广。\n\n任职资格：\n知识：熟悉产品研发、运营全流程，具备项目管理知识。\n技能：\n1、有较强的客户沟通能力，能挖掘客户需求；\n2、有较强的产品设计能力及开发能力；\n3、了解前后端技术、通信知识；对技术实现方面有一定了解；\n4、具有对市场发展趋势有敏锐的洞察力、创新意识；\n5、熟悉互联网或软硬件产品的整体实现过程，包括从需求分析到产品发布；\n6、较强的沟通能力及语言表达能力、需求调研能力、需求引导及需求管理能力；\n7、对创新工作充满热情，能适应短时出差；\n8、了解金融机构数据应用，贷前，贷后风控流程，掌握机器学习，隐私计算知识原理；\n经验：\n1、具有5年以上数据应用相关经验。');
INSERT INTO `t_jobdata` VALUES ('109', '大数据总监', '65-90k·16薪', '北京', '某北京计算机软件公司', 'https://www.liepin.com/a/38899261.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=31&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=31', '北京', '大数据', '65000.00', '90000.00', '77500.00', '大数据平台总监\n工作职责\n1. 深入理解数据产品需求，紧跟技术发展趋势，带领团队进行设计并搭建业界前沿的数据服务整体技术架构。\n2. 带领团队解决技术选型、关键核心模块的研发等技术挑战及疑难问题，包括低延时实时计算、大规模历史数据存储及分析、数仓设计以及算法建模支持等。\n3. 对接公司内、外部不同业务线的数据存储及服务需求，开发并维护融合多数据源的数据仓库，提供多场景、高效的数据查询分析工具。\n4. 负责优化分布式框架，解决大计算量下的各种问题，为公司批处理和流式计算能力提供支撑。\n5. 基于技术框架的选型，协助运维管理并实施高效的监控、系统优化和平台扩容。\n6. 负责大数据部核心团队的组织规划、管理培养和绩效考核，提高团队在全公司甚至行业的技术影响力。\n\n任职资格\n1. 计算机等相关理工科专业硕士及以上学历，有较好的理论及计算机工程基础、快速学习能力。\n2. 5年以上互联网优秀企业技术开发与交付工作经验，3年以上团队管理经验。\n3. 精通 Hadoop、Spark、Flink、Hive、Kafka、ES、Doris、Redis、Zookeeper 等大数据相关技术及中间件，并能结合业务场景进行架构设计。\n4. 数据平台搭建上有多年的从0到1再到n的成功经历，深入了解数据仓库体系，并有成功的业务场景落地经验。\n5. 熟悉流式数据处理框架，能够根据数据特征采用不同的技术方案，有大数据治理服务经验。\n6. 乐观向上，自驱力强，善于沟通及跨部门协作，具备敏锐的洞察力和良好的抗压能力。\n7. 具备前沿技术视野，有显著的研发和工作成绩，有一定行业影响力。');
INSERT INTO `t_jobdata` VALUES ('110', '华东大区总监（医疗信息化/大数据）', '30-50k', '上海-黄浦区', '神州医疗', 'https://www.liepin.com/job/1951344607.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=32&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=32', '上海', '大数据', '30000.00', '50000.00', '40000.00', '职责描述： \n    市场：江浙沪\n1、结合年度市场战略目标与方向，制定全国年度市场工作规划； \n2、给各业务单元赋能，合理分解销售目标，执行并完成销售计划，包括销售指标、客户回款目标的成等。实施业绩跟踪，及时分析，保障达成既定业务指标； \n3、管理销售团队，推动整个团队的销售目标达成。负责对华东大区营销人员进行业务指导和专业培训，定期召开营销工作会议，全面准确掌握各业务单元的营销运行状况； \n4、负责医疗大数据市场的开发、维护，采取有效措施促进客户开发、制高点突破和终端提升，全面落实产品的覆盖、渠道营销、销售和持续有质量发展； \n\n 任职要求： \n1、本科及上学历，5年以医疗信息化，医疗大数据行业营销经验； \n2、思维活跃、有积极进取和团队合作的精神及接受挑战的性格； \n3、为人诚实、正直，性格开朗、责任心强，擅长与人沟通；\n4、有一定的组织协调能力，能承担一定的工作压力； \n5、具有一定的市场分析判断能力，良好的客户服务意识 。');
INSERT INTO `t_jobdata` VALUES ('111', '大数据风控负责人——风控部一级部门副总或总助', '80-110k', '深圳-南山区', '某国内银行公司', 'https://www.liepin.com/a/37867803.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=33&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=33', '深圳', '大数据', '80000.00', '110000.00', '95000.00', '地点：广州或是深圳，可以偶尔去梅州出差。\n\n职责描述：负责风控策略，建模，反欺诈等线上风控工作。\n1、负责制定和检视线上线下全渠道业务的贷前、贷中及贷后各环节的风险政策与流程，具体包括客户准入、分层、评分、授信、定价、用信、还款及额度等信贷流程各阶段的政策与策略；\n2、通过对各类风险指标与报表的分析，关注各类资产和客群的风险变动，对全渠道风险政策与策略进行跟踪评价，并及时优化调整相应的风险政策与策略。\n3、与模型开发人员、产品和运营团队、研发团队紧密配合，开发基于模型应用的产品策略、定价策略、授信策略、调额策略及其他贷后管理策略；\n4、负责相关策略和规则的汇报，获得审批后、提出系统实施需求，并完成投产测试和部署工作；对各产品运营、风险政策进行监控分析，完成分析报告，通过数据分析不断改进产品策略和规则。\n\n任职要求：\n1、全日制本科及以上学历，统计、数学、金融、计量经济等相关专业；\n2、10年以上银行零售信贷/消费金融公司/互联网金融公司等业务风控相关工作经验，熟悉了解个人信贷风险要点和全生命周期风控体系；\n3、熟悉风险规则工作，对个人借款客户风险分析具有分析的经至少具有相关工作背景；\n4、熟悉征信及大数据应用；具备较强逻辑思维能力、沟通协调能力及团队合作精神。');
INSERT INTO `t_jobdata` VALUES ('112', '大数据开发（年薪25万）', '12-17k·15薪', '广州-白云区', '泓信供应链', 'https://www.liepin.com/job/1951600157.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=35&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=35', '广州', '大数据', '12000.00', '17000.00', '14500.00', '岗位职责:\n\n1、基于业务和应用的需求，负责对公司所有的数据进行离线或实时数据处理及应用的开发工作；\n\n2、完成大数据平台的需求开发工作，为数据分析及业务开展提供数据支持；\n\n3、保障大数据平台的日常工作稳定，及时处理有问题的作业，解决系统及数据问题；\n\n4、能适应快速的工作节奏，并能独立地展开工作；\n\n任职要求:\n\n1、本科以上学历，软件、计算机、数学等相关专业；\n\n2、3-5年开发经验，熟练使用java、scala等至少一种高级语言，以及shell、python等脚本语言；\n\n3、熟练使用spark、flink等计算引擎的开发，具有大数据项目实践经验；\n\n4、熟悉hdfs、Hive、HBase、kafka、flume等hadoop大数据生态技术；\n\n5、精通SQL，熟悉常用的关系型数据库、非关系性数据库和数据仓库，具有SQL性能优化经验；\n\n6、有大规模集群应用开发经验优先；\n\n7、对新技术敏感，有较强的钻研学习能力者优先；');
INSERT INTO `t_jobdata` VALUES ('113', '东莞大数据讲师', '12-18k', '东莞-厚街镇', '慧科教育科技集团有限公司', 'https://www.liepin.com/job/1951586101.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=36&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=36', '东莞', '大数据', '12000.00', '18000.00', '15000.00', '职责描述：1、负责大数据教育方向的教学研发工作，包括教学体系开发、课程内容设计等；\n2、负责教学方案设计和教学资料的制作，包括课程大纲、教学课件等；\n3、负责远程教学的过程性设计和在线教学内容研发；\n4、将产业经验转化为教学资源，设计实验室方案或实训类项目的教学内容。\n任职要求：1、本科及以上学历，计算机相关专业，有3年以上大数据行业经验或教学研发经验；\n2、对Hadoop的MapReduce原理有深入研究，掌握Hadoop、Hive和Hbase等；\n3、熟悉Spark、Storm、Zookeeper、YARN等大数据相关技术；\n4、有大数据实际项目开发者优先；\n5、教育研发能力强，授课能力突出（需有经验和项目业绩说明）；\n6、热爱职业教育事业，有前瞻性和市场洞察能力，敢于拼搏，有创业精神；\n7、良好沟通技巧、学习能力，具有良好的职业操守；\n8、注重用户运营，在知名教育机构有管理经验者优先。');
INSERT INTO `t_jobdata` VALUES ('114', '常州大数据讲师', '12-18k', '常州-武进区', '慧科教育科技集团有限公司', 'https://www.liepin.com/job/1951585931.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=2&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=37&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=2&pageSize=40&index=37', '常州', '大数据', '12000.00', '18000.00', '15000.00', '职责描述：1、负责大数据教育方向的教学研发工作，包括教学体系开发、课程内容设计等；\n2、负责教学方案设计和教学资料的制作，包括课程大纲、教学课件等；\n3、负责远程教学的过程性设计和在线教学内容研发；\n4、将产业经验转化为教学资源，设计实验室方案或实训类项目的教学内容。\n任职要求：1、本科及以上学历，计算机相关专业，有3年以上大数据行业经验或教学研发经验；\n2、对Hadoop的MapReduce原理有深入研究，掌握Hadoop、Hive和Hbase等；\n3、熟悉Spark、Storm、Zookeeper、YARN等大数据相关技术；\n4、有大数据实际项目开发者优先；\n5、教育研发能力强，授课能力突出（需有经验和项目业绩说明）；\n6、热爱职业教育事业，有前瞻性和市场洞察能力，敢于拼搏，有创业精神；\n7、良好沟通技巧、学习能力，具有良好的职业操守；\n8、注重用户运营，在知名教育机构有管理经验者优先。');
