INSERT INTO `t_jobdata` VALUES ('118', '大数据架构师', '40-55k·15薪', '杭州-萧山区', '上海聚纬企业管理咨询有限公司', 'https://www.liepin.com/job/1950669891.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=1&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=1', '杭州', '大数据', '40000.00', '55000.00', '47500.00', '杭州某公司（对标阿里P8, 公司给期权）\n\n职责描述：\n1、参与公司大数据平台和数据中台建设，承担相关服务、平台、产品的技术架构设计和研发工作，打造面向未来、业界一流的大数据技术；\n2、参与建设业内领先的大数据技术解决方案，承载集团内丰富的数据业务场景的落地，驱动业务发展突破，同时满足稳定性、安全合规、数据质量、成本效能等方面的严苛要求；\n3、团队工作范围涉及但不限于：数据研发平台，智能建模，数据集成，数据资产管理，数据安全隐私合规，数据质量，实时计算，web数据采集挖掘，任务和资源调度系统等等。\n\n任职要求：\n1、全日制本科及以上学历，计算机等相关专业毕业，5年以上相关工作经验；\n2、工作思路清晰，较好的沟通能力和技术学习能力，拥有良好的编码习惯，有很强的自学能力和自我提高的愿望；\n3、计算机和JAVA基础扎实，熟悉JVM、IO、多线程、并发、网络、数据库等，理解面向对象、设计模式、分布式等相关技术；\n4、熟练使用主流JAVA技术栈框架，如Spring、SpringBoot、MyBatis、Netty等；\n5、熟悉一种或多种大数据相关技术如：Hadoop、Flink、Spark、Hive、Storm、搜索引擎技术等优先。');
INSERT INTO `t_jobdata` VALUES ('119', '大数据开发专家', '30-60k·16薪', '杭州-余杭区', '知名互联网公司', 'https://www.liepin.com/a/39299905.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=2&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=2', '杭州', '大数据', '30000.00', '60000.00', '45000.00', '岗位职责\n1、参与搭建大数据离线分析的物理架构与逻辑模型设计，提供行业内的数据清洗与标准化方案；\n2、建设大数据的实时/准实时查询分析能力，深挖行业大数据价值，为前沿业务提供支持；\n3、参与大数据平台优化与运维，保障平台稳定。\n\n胜任力要求：\n1、统招本科及以上学历，4年以上大数据开发相关经验，精通数据仓库分层建模与ETL设计开发，具备体系化的数据中心建设经验，有大型项目实践经验；\n3、熟悉Hadoop生态（Hive/HBase/Yarn）相关技术并有相关开发经验，深入了解技术原理并能够调优；\n4、熟悉MPP架构（Greenplum/Clickhouse/Presto）的大数据分析平台；\n5、能够熟练使用python或者java一种开发语言，熟练使用linux；\n6、具备良好的学习、沟通能力及团队协作精神，对工作积极严谨负责。');
INSERT INTO `t_jobdata` VALUES ('120', '大数据架构规划师', '50-80k', '北京-西城区', '中国某某集团', 'https://www.liepin.com/a/35253393.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=3&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=3', '北京', '大数据', '50000.00', '80000.00', '65000.00', '岗位职责：\n岗位职责：\n1、研究电信业务发展趋势及大数据技术在行业的应用，了解业务发展方向，从整体架构视角推动战略落地。\n2、负责中国电信大数据平台、应用、产品的架构设计和技术演进；制定数据架构规范，指导团队落地。\n3、基于中国电信特点，对海量数据采集、处理及存储、应用方案的技术选型和架构实现技术进行详细规划和设计，并参与部分核心代码的开发。\n4、根据战略和业务需要，持续优化数据架构和数据模型，指导开发人员完成数据模型详细设计和开发等。\n5、参与数据中台规范制定，负责规范解释和全网培训。\n6、深入研究大数据相关技术和产品，持续跟踪业内先进技术。\n7、协助处室领导制定工程建设规划并推动项目实施。\n岗位要求：\n1、研究生及以上学历，通信/计算机等相关专业; 身体健康，年龄原则上在35周岁及以下，或博士，条件优秀的可适当放宽。\n2、熟悉数据中台、数据仓库、数据技术、数据治理及主流数据产品的现状和发展趋势，主持或参与过数据中台、数据仓库建设和数据产品研发项目，开展过数据架构相关规划及演进工作。\n3、具有大数据技术通用能力，熟悉Hive、Hbase、ES、Flink、Kafka、Spark、Storm、Clickhouse、Doris等\n4、熟悉业务模型和数据建模方法，熟悉数据处理流程及运营体系; 有作为技术负责人系统化解决问题的成功案例；有海量数据实践经验优先；\n5、熟练掌握SQL语言查询技能，熟悉Shell/Scala/Java/Python等至少一种编程语言，具有编程能力。\n6、能力素质：具备良好的职业道德，具备一定的公文写作能力和沟通协调能力，工作敬业、责任心强，能够严格保守企业秘密。');
INSERT INTO `t_jobdata` VALUES ('121', '医学大数据分析师 (MJ000022)', '10-20k·13薪', '北京-东城区', '中电药明', 'https://www.liepin.com/job/1950954053.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=4&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=4', '北京', '大数据', '10000.00', '20000.00', '15000.00', '工作职责：\n1、负责公司临床试验和真实世界研究统计方案的设计和审核，包括但不限于样本量计算、统计分析计划、数据库的管理等；\n2、临床项目大数据的数据治理、数据检索、统计分析，建模；临床数据库挖掘及分析等。\n3、检索国内外文献，进行医学前沿跟踪，结合公司产品特点提供医学支持及专业的统计分析支持 ；\n4、参与临床试验方案及临床统计报告的撰写。\n \n任职要求：\n1、医学、生物、流行病学、数据分析等相关专业背景，硕士以上学历，1年以上工作经验\n2、熟练掌握SQL，R or SAS or Python；\n3、扎实的统计和编程技能\n4、良好的沟通表达及协作能力\n');
INSERT INTO `t_jobdata` VALUES ('122', '医疗大数据销售经理', '15-20k', '成都', '北京深睿博联科技有限责任公司', 'https://www.liepin.com/job/1944887047.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=5&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=5', '成都', '大数据', '15000.00', '20000.00', '17500.00', '职责描述：\r\n1、负责拓展新医院和维护现有医院的项目，对医院端、政府端解决方案销售负责。\r\n2、建立与辖区内医院的合作，维护关键客户和合作渠道，完成相应指标。\r\n3、配合运营体系持续可跟踪服务医院及专家，挖掘客户需求。\r\n\r\n岗位要求:\r\n1，大专及以上学历，医疗信息化背景优先，有一定的行业资源；\r\n2，对医疗大数据领域有一定认知和见解，有兴趣和激情一起加入创业团队；\r\n3，有独立的项目管理、策划和执行能力，有一定的研究和科研思维；\r\n4，客户服务第一的工作思维；\r\n5，有独立的思维能力，具备较强的学习和创新能力。');
INSERT INTO `t_jobdata` VALUES ('123', '大数据总监', '100-160k·14薪', '北京', '某大型专业服务公司', 'https://www.liepin.com/a/38661931.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=6&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=6', '北京', '大数据', '100000.00', '160000.00', '130000.00', '如果你:\n拥有大学本科或以上学历，在校成绩优异\n对数字化战略、机器学习、人工智能(AI)、大数据、电子商务、云技术，以及IT系统/组织设计等前沿科技有深入了解和浓厚兴趣\n·具备一定的领导能力\n·善于进行团队合作\n·中英文流利，具有良好的沟通技巧');
INSERT INTO `t_jobdata` VALUES ('124', '大数据开发工程师', '25-40k', '上海', '花旗', 'https://www.liepin.com/job/1950839427.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=7&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=7', '上海', '大数据', '25000.00', '40000.00', '32500.00', '职责描述：\nResponsibilities:\n\nArchitect and design automation solutions for medium complexity enterprise infrastructure lifecycle including provisioning, configuring, maintaining and decommissioning.\nWork with enterprise infrastructure providers and application development teams to guide and co-develop automation workflows.\nMonitor and control all phases of development process and analysis, design, construction, testing, and implementation as well as provide user and operational support on applications to business users\nUtilize in-depth specialty knowledge of applications development to analyze complex problems/issues, provide evaluation of business process, system process, and industry standards, and make evaluative judgement\nHas the ability to operate with a limited level of direct supervision.\nCan exercise independence of judgement and autonomy.\nAppropriately assess risk when business decisions are made, demonstrating particular consideration for the firm\'s reputation and safeguarding Citigroup, its clients and assets, by driving compliance with applicable laws, rules and regulations, adhering to Policy, applying sound ethical judgment regarding personal behavior, conduct and business practices, and escalating, managing and reporting control issues with transparency.\n\n1.为中等复杂度的企业基础架构生命周期（包括资源调配、配置、维护和停用）构建和设计自动化解决方案。\n2.与企业基础架构提供商和应用程序开发团队合作，指导和共同开发自动化工作流。\n3.监控开发过程和分析、设计、构建、测试和实施的所有阶段，并向客户提供应用程序的用户和操作支持。\n4.利用应用程序开发的深入专业知识来分析复杂的问题/问题，提供业务流程、系统流程和行业标准的评估，并作出评估性判断。\n\n\n\n\n任职要求：\nQualifications:\n\nAbove 3 years of relevant experience in EAP Big Data, Java, Spring, Hive, Impala, Shell Scripting, SQL\\NoSQL technologies (SQL Server, Oracle, Couchbase, Mongo DB, etc.) and Cloud Native Technologies.\nCompetent with Java Spark and/or PySpark development activities\nStrong communication skills, both written and oral.\nExperience in all aspects of Application Development & Delivery.\nPrior experiences with DevOps CI/CD tools like Git and Jenkins.\nPrior experience working in a DevOps culture and willing to drive it. You are comfortable working with CI/CD tools (ideally IBM UrbanCode Deploy, TeamCity or Jenkins), monitoring tools and log aggregation tools. Ideally, you would have worked with Docker/Kubernetes.\nAbility to work under pressure and manage deadlines or unexpected changes in expectations or requirements\n\n1.统招本科及以上学历。\n2.3年以上在EAP大数据、Java、Spring、Hive、Impala、Shell脚本、SQL\\NoSQL技术（SQL Server、Oracle、Couchbase、Mongo DB等）和云本机技术方面的相关经验。\n3.能够胜任Java Spark和/或PySpark开发。\n4.良好的英语书面和口头沟通能力。\n5.有使用DevOps CI/CD工具（如Git和Jenkins，IBM UrbanCode Deploy，TeamCity）的经验。\n6.有在DevOps文化中工作的经验，并愿意推动其发展。\n7.熟练使用CI/CD工具、监控工具和日志聚合工具。可使用Docker/Kubernetes。\n\n');
INSERT INTO `t_jobdata` VALUES ('125', '高级大数据开发工程师', '10-18k', '烟台-福山区', '烟台匕禾网络科技有限公司', 'https://www.liepin.com/job/1951595539.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=8&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=8', '烟台', '大数据', '10000.00', '18000.00', '14000.00', '岗位职责：\n1、大数据开发框架选型与搭建；\n2、业务功能开发与优化；\n3、大数据开发团队培训。\n\n任职要求：\n1、大数据实际开发经验5年以上；\n2、掌握Kafka、Hadoop大数据开发相关技术；\n3、掌握Spark，flink,Hive等大数据技术；\n4、掌握HBase、MongoDB、Mysql、Oracle数据库；\n5、有大数据框架搭建经验者优先。');
INSERT INTO `t_jobdata` VALUES ('126', '大数据专业产品经理', '15-30k', '北京-海淀区', '联想教育', 'https://www.liepin.com/job/1951576859.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=9&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=9', '北京', '大数据', '15000.00', '30000.00', '22500.00', '职责描述：\n1、负责大数据专业方向的人才培养方案的制定，对最终教学成果负责。包含就业方向规划、课程体系方案、实训项目方案、以及实训室建设方案等； \n2、负责大数据专业方向的校企合作专业共建方案的制定，对经营效果与品牌质量负 责。包含人才培养方案，以及基于校方特点的相关模块的整合设计（如实训室模 块、1+x 技能相关模块等）； \n3、负责大数据专业方向的营销方案的制定，以及售前支持； \n4、负责相关方案的组织开发，以及部分课程的讲授； \n5、参与教师选拔，负责赋能与指导工作。\n\n任职要求：\n1、了解本专业相关行业的相关技术框架，洞察行业市场人才需求趋势，尤其是洞察对大中专学生的就业关键技能要求；\n2、有企业实际工作经验者优先（有一定的开发、运营或实施交付、安装调试、服务支持类的工作经验）；\n3、有担任过团队经理、项目经理者优先；\n4、 具有良好的讲解沟通能力、组织协调能力与问题解决能力；\n5、 其它：有优良的教研经验、专业共建、实训室类产品解决方案设计经验者优先；有优良的营销能力者优先；\n6、技术类专业毕业，计算机、自动化、机械工程等相关专业毕业，硕士学历优先。');
INSERT INTO `t_jobdata` VALUES ('127', '大数据专业建设产品经理', '16-25k', '北京-海淀区', '联想教育', 'https://www.liepin.com/job/1951576471.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=10&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=10', '北京', '大数据', '16000.00', '25000.00', '20500.00', '职责描述：\n1、负责大数据专业方向的人才培养方案的制定，对最终教学成果负责。包含就业方向规划、课程体系方案、实训项目方案、以及实训室建设方案等； \n2、负责大数据专业方向的校企合作专业共建方案的制定，对经营效果与品牌质量负 责。包含人才培养方案，以及基于校方特点的相关模块的整合设计（如实训室模 块、1+x 技能相关模块等）； \n3、负责大数据专业方向的营销方案的制定，以及售前支持； \n4、负责相关方案的组织开发，以及部分课程的讲授； \n5、参与教师选拔，负责赋能与指导工作。\n\n任职要求：\n1、了解本专业相关行业的相关技术框架，洞察行业市场人才需求趋势，尤其是洞察对大中专学生的就业关键技能要求；\n2、有企业实际工作经验者优先（有一定的开发、运营或实施交付、安装调试、服务支持类的工作经验）；\n3、有担任过团队经理、项目经理者优先；\n4、 具有良好的讲解沟通能力、组织协调能力与问题解决能力；\n5、 其它：有优良的教研经验、专业共建、实训室类产品解决方案设计经验者优先；有优良的营销能力者优先；\n6、技术类专业毕业，计算机、自动化、机械工程等相关专业毕业，硕士学历优先。');
INSERT INTO `t_jobdata` VALUES ('128', '大数据开发工程师', '20-30k·14薪', '北京', '某国内计算机软件公司', 'https://www.liepin.com/a/39302821.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=11&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=11', '北京', '大数据', '20000.00', '30000.00', '25000.00', '1.从事网络流量与安全产品的研发，通过对海量流量与行为日志的分析，挖掘网络情报、监测网络性能、发现网络威胁；\n2.可利用大数据分析技术和方法，完成对网络信息安全领域数据的建模和分析工作；\n3.可协助负责人解决产品中的关键技术难题。\n任职要求 1. 本科及以上学历，计算机相关专业，5年以上开发经验，至少2年以上大数据从业经验；\n2. 熟悉Hadoop、Flink、Spark、Kafka和ClickHouse等技术，擅长Flink者优先，可结合业务场景深入钻研；\n3. 了解统计以及数据挖掘、机器学习技术，会使用关联分析、分类预测、聚类分析等常用分析方法；\n4. 工作态度端正，有较强的问题总结分析及抽象能力，对技术充满热情具有钻研精神，勇于承担任务，善于团队合作。\n具备以下者优先：\n1. 有一二线互联网公司工作经验优先；\n2. 有过复杂业务场景的实时数据开发经验者优先；\n3. 有网络信息安全大数据业务处理经验优先。');
INSERT INTO `t_jobdata` VALUES ('129', '大数据平台开发专家', '50-55k·15薪', '北京', '某汽车公司', 'https://www.liepin.com/a/39288115.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=12&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=12', '北京', '大数据', '50000.00', '55000.00', '52500.00', '上市新能源\n朝九晚六\n保底3月+项目奖\n互联网大厂公司优先\n任职资格：8年及以上大数据平台工作经验。\n精通hadoop，hive，spark，flink，trino，ranger，hbase等多种大数据技术栈，有大型大数据平台落地实践经验者优先。\n熟悉prometheus，grafana，alertmanager等开源监控产品。\n熟练掌握java/python/go等开发语言，有丰富的编程和开发经验。\n熟悉oracle，mysql等关系型数据库。\n具备较强的工作责任心和解决问题的能力，良好的沟通表达能力和文档编写能力，具有良好的团队协作精神，有良好的抗压能力');
INSERT INTO `t_jobdata` VALUES ('130', '大数据算法总监', '55-70k·14薪', '重庆-渝北区', '某重庆工业自动化公司', 'https://www.liepin.com/a/39284211.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=13&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=13', '重庆', '大数据', '55000.00', '70000.00', '62500.00', '工作职责：\n1、掌握最新的算法趋势，研究探索大数据前沿技术，主导规划数据算法领域能力及发展节奏，指导团队的研发项目；\n2、洞察并预测业务需求，提取应用场景，负责模型算法开发与改进，深入建设算法体系， 制定相应的算法解决方案；\n3、带领智能算法团队采用常用机器学习、自然语言、数据挖掘等算法来对实验和生产数据进行数据建模，优化实验与生产流程参数，开发和落地在医药领域的智能化应用；\n4、制定技术规划和技术路线，搭建具有数据挖掘与分析能力的平台，为用户提供高质量的科学数据，寻求数据层面的业务价值；\n5、统筹规划大数据算法团队人才队伍配置和建设工作。\n任职要求：\n1、全日制硕士学历，数学、计算机、统计学、信号处理、信息技术等相关专业，至少精通其中一个领域：深度学习，计算机视觉、NLP、强化学习等，有大数据架构和数仓建设经验； \n2、5年以上相关工作经验，有医疗行业经验佳；\n3、熟练掌握至少2种人工智能常用编程语言：Python, R, OpenCV,Matlab, SQL,Scala, Spark, PHP, Java, Weka等；\n4、良好的团队合作精神，有创造性思维，愿意在创业型公司成长；\n5、10人以上算法团队带队经验优先考虑。');
INSERT INTO `t_jobdata` VALUES ('131', '大数据总监', '60-90k·20薪', '上海', '大型券商', 'https://www.liepin.com/a/39054049.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=15&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=15', '上海', '大数据', '60000.00', '90000.00', '75000.00', '工作职责:\n1. 负责整体大数据管理工作，根据公司战略，对集团整体及各板块的大数据体系进行整体规划；\n2. 负责大数据整体平台的架构设计和实施；\n3. 负责大数据应用的可研、实施，利用数据为集团赋能，提升数据价值；\n4. 负责重点大数据技术方案的制定和决策；\n5. 负责大数据项目的可研、方案评审、实施及验收；\n6. 负责团队和项目管理。\n任职资格:\n1. 有8年以上大数据/数据应用相关工作经验，至少3年团队/项目管理经验；\n2. 熟悉 Hadoop 生态圈相关技术及相关产品，大数据技术包括但不限于hadoop、yarn、hive,、kafka、impala、hbase、presto等，大数据产品包括但不限于CDH、星环、Fusioninsight等；\n3. 具备在大型集团或企业的大数据平台搭建及大数据实施经验；\n4. 良好的沟通、团队协作和组织统筹以及项目推动能力，良好的自驱能力以及目标导向能力，能承受工作压力；\n5. 具备大型公司或咨询公司工作经验者优先；\n6. 具备较强的业务理解和沟通能力。');
INSERT INTO `t_jobdata` VALUES ('132', '大数据平台研发工程师', '25-40k', '深圳-罗湖区', '国信证券股份有限公司', 'https://www.liepin.com/job/1936287903.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=16&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=16', '深圳', '大数据', '25000.00', '40000.00', '32500.00', '工作职责:\r\n1.参与构建公司大数据平台建设，包括但不限于数据集成平台，数据服务平台，大数据存储平台，实时数仓，指标平台等，负责相关系统的架构设计以及实施\r\n2.深入了解数据开发日常工作，并梳理和抽象出平台工作，提高数据开发工程师的效率并提升稳定性\r\n3.保障数据平台的稳定性以及平台代码质量\r\n任职资格:\r\n1.本科以上学历，具有大型金融企业，互联网公司的大数据平台研发相关工作经验；\r\n2.具备构建稳定的大数据基础平台能力，具备数据收集，数据清洗，实时计算，实时数仓等系统研发经验\r\n3.扎实编程基础，良好代码风格，熟悉敏捷开发流程以及常用数据结构与算法，熟练使用linux\r\n4.熟悉SQL语法，至少精通go，JAVA一种编程语言以及对应web开发框架，熟悉vue或react native者优先\r\n5.熟悉主流关系型数据库产品如mysql，oracle，熟练掌握 Hive/Spark 等大数据生态主流产品基本原理和调优策略，并可熟练进行Hive、Spark和Flink之上的开发工作，熟悉分布式计算引擎或数据库者优先\r\n6.熟悉多线程，网络优化，分布式架构，缓存，消息队列，云原生等技术，了解主流分布式存储技术如ceph等，熟悉使用kubernetes者优先，熟悉机器学习与深度学习者优先\r\n7.需要有责任感以及工作主动性，有owner意识，沟通能力强，注重团队协作');
INSERT INTO `t_jobdata` VALUES ('133', '大数据开发工程师', '20-30k', '上海-浦东新区', 'TCL实业控股(广东)股份有限公司', 'https://www.liepin.com/job/1951255237.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=17&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=17', '上海', '大数据', '20000.00', '30000.00', '25000.00', '岗位职责：\n1.负责能够深入理解数据需求，并结合数据现状进行需求分析和拆解，能够与数据产品人员对数据需求的理解保持一致；\n2.完成指标开发需求评估、指标开发、交付等工作；\n3.参与数据平台相关数据管理工作，如数据质量规范、数仓建设规范、研发规范 的制定与推动实施落地 ；\n4.参与公司离线和实时数据仓库的迭代，参与数据仓库架构设计，包括离线/实时数据 ETL、计算、管理、监控等。\n\n岗位要求：\n1.本科及以上学历，计算机、电子信息工程等相关专业优先；    \n2. 4年以上数据仓库开发经验，3年以上Java/Scala的开发经验，熟悉数据仓库模型设计与ETL开发 ，掌握Kimball的维度建模设计方法，具备TB级别数据ETL经验；\n3.熟悉分布式数据存储与计算平台应用开发，掌握Hadoop生态相关技术，如HDFS、MapReduce、Hive、Flink、Spark等；\n4.熟悉流式计算并有深入了解，有Flink实时计算系统开发经验；\n5.熟悉常用消息队列及调优，如Kafka、Plusar、RocketMQ等；\n6.熟悉数据仓库领域治理及应用，如元数据管理、数据质量、主数据管理、用户画像等；\n7. 有数据湖开发经验，如Hudi、Iceberg、DeltaLake等；\n8.有良好的业务及产品思维，乐于从使用者角度设计和开发产品，乐于了解日常业务，具备从日常业务中发现问题并解决问题的能力；                                                                                         9.有阿里云ACP等相关认证者优先；\n10.英语可作为工作语言者优先。');
INSERT INTO `t_jobdata` VALUES ('134', '大数据开发工程师', '15-25k', '济南-历城区', '某国内医疗保健上市公司', 'https://www.liepin.com/a/39115977.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=18&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=18', '济南', '大数据', '15000.00', '25000.00', '20000.00', '工作职责\n1、负责实时计算、流式计算的开发及维护工作\n2、负责解决任务在运行中的各种问题、保证高效稳定运行\n3、负责数据收集、整理、分析，对多种数据源进行深度分析，利用ETL工具或开发程序完成数据抽取、清洗、转换、装载等工作；\n4、数据仓库维护，进行数据任务流程调优及准确性改进，进行数据质量监测、校验和提升，及时跟踪处理实施过程中的问题，对实施过程中遇到的问题及时反馈；\n\n任职资格\n1、3年以上数据开发经验，有从0到1的数仓或数据中台项目经验者优先；\n2、对大数据集群扩展、容量规划、资源调度、架构设计、性能调优有一定的了解\n3、对Flink(CDC、CEP)、HBase、Doris、ELK、Kafka、Clickhouse等相关组件有一定的项目实践经验\n4、对实时业务中出现的实时倾斜、背压、流关联等问题有自己的方法论和解决思路\n5、熟悉Flink API 及 Flink SQL的开发方式；\n6、熟悉Java、Scala开发、有一定的shell或python脚本的编写能力；\n7、有风控、医疗、零售等相关业务经验优先；\n8、有大数据组件相关运维经验优先；\n9、熟悉Java、Python至少一门编程语言；');
INSERT INTO `t_jobdata` VALUES ('135', '医疗大数据销售经理', '12-20k', '沈阳', '北京深睿博联科技有限责任公司', 'https://www.liepin.com/job/1944622429.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=19&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=19', '沈阳', '大数据', '12000.00', '20000.00', '16000.00', '职责描述：\r\n1、负责拓展新医院和维护现有医院的项目，对医院端、政府端解决方案销售负责。\r\n2、建立与辖区内医院的合作，维护关键客户和合作渠道，完成相应指标。\r\n3、配合运营体系持续可跟踪服务医院及专家，挖掘客户需求。\r\n\r\n岗位要求:\r\n1，大专及以上学历，医疗信息化背景优先，有一定的行业资源；\r\n2，对医疗大数据领域有一定认知和见解，有兴趣和激情一起加入创业团队；\r\n3，有独立的项目管理、策划和执行能力，有一定的研究和科研思维；\r\n4，客户服务第一的工作思维；\r\n5，有独立的思维能力，具备较强的学习和创新能力。');
INSERT INTO `t_jobdata` VALUES ('136', '大数据售前', '35-45k', '杭州', '某北京通信业上市公司', 'https://www.liepin.com/a/39126707.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=20&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=20', '杭州', '大数据', '35000.00', '45000.00', '40000.00', '工作职责\n1. 负责公安信息化项目售前技术支持工作，包括方案设计.文档编写.技术交流等；\n2. 负责跟进公安类项目的建议书、可研、初步设计、招投标等售前阶段，编制系统设计方案、预算等文档资料，参与行业相关标准制定；\n3. 大数据项目方案的讲解和大型项目解决方案顾问式售前支持，配合公司市场的推广；\n4. 研究并掌握信息化领域前沿技术、最新产品，尤其是公安信息化领域及安防领域；\n5. 与合作伙伴进行技术交流，结合其产品技术特性，共同撰写系统优化.整合方案。\n任职要求\n1. 熟悉公安行业，熟悉公安科信、指挥、大数据、情报、交通等业务方向者优先；\n2. 两年以上大数据售前经验，熟悉技术方案的设计.实施及项目应标流程；\n3. 能够根据客户需求，独立进行公安信息化方案的撰写；\n4. 计算机、通信、电子、自动化及相关专业毕业，大本及以上学历；有软考或者相关培训证书的优先；\n5. 熟悉大数据系统架构，熟悉Hadoop.Spark等大数据生态圈各种组件的技术原理；熟悉目前流行的各种关系型数据库\\MPP数据库\\No-SQL数据库以及内存数据库的架构原理； 熟悉数据数据治理相关的方法及理论，了解数据管理工具；\n6. 良好的客户服务意识和沟通能力，学习能力强.乐于创造.善于接受新事物。\n');
INSERT INTO `t_jobdata` VALUES ('137', '大数据开发工程师', '8-12k', '武汉-江汉区', '亚信科技', 'https://www.liepin.com/job/1951130825.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=21&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=21', '武汉', '大数据', '8000.00', '12000.00', '10000.00', '职责描述：\n1、负责公司项目数据仓储系统架构维护及开发，进行系统改造和升级。\n2、负责新功能需求确认，底层表、中间表、上层表结构设计，数据业务支撑。\n3、负责底层汇总数据流程的优化和改造。提高计算效率，降低计算时间、资源占用\n\n\n任职要求：\n1、 本科及以上学历，计算机或相关专业；2年及以上数据开发经验\n2、 熟悉数据仓库建模理论，了解数据仓库数据分层架构、多维数据模型设计\n3、 熟悉关系型数据库MySQL、 Postgres等，以及相应数据库调优、SQL优化\n4、 熟悉Linux操作系统，熟练掌握常用Shell/Python等脚本工具\n5、 熟悉Hadoop、Hive、MapReduce等大数据技术，具有实际项目经验');
INSERT INTO `t_jobdata` VALUES ('138', '银行大数据开发工程师', '20-40k·16薪', '北京-海淀区', '感易智能', 'https://www.liepin.com/job/1951055379.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=22&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=22', '北京', '大数据', '20000.00', '40000.00', '30000.00', null);
INSERT INTO `t_jobdata` VALUES ('139', '华东大区总监（医疗信息化/大数据）', '30-50k', '杭州-上城区', '神州医疗', 'https://www.liepin.com/job/1951344651.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=23&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=23', '杭州', '大数据', '30000.00', '50000.00', '40000.00', '职责描述： \n    市场：江浙沪\n1、结合年度市场战略目标与方向，制定全国年度市场工作规划； \n2、给各业务单元赋能，合理分解销售目标，执行并完成销售计划，包括销售指标、客户回款目标的成等。实施业绩跟踪，及时分析，保障达成既定业务指标； \n3、管理销售团队，推动整个团队的销售目标达成。负责对华东大区营销人员进行业务指导和专业培训，定期召开营销工作会议，全面准确掌握各业务单元的营销运行状况； \n4、负责医疗大数据市场的开发、维护，采取有效措施促进客户开发、制高点突破和终端提升，全面落实产品的覆盖、渠道营销、销售和持续有质量发展； \n\n 任职要求： \n1、本科及上学历，5年以医疗信息化，医疗大数据行业营销经验； \n2、思维活跃、有积极进取和团队合作的精神及接受挑战的性格； \n3、为人诚实、正直，性格开朗、责任心强，擅长与人沟通；\n4、有一定的组织协调能力，能承担一定的工作压力； \n5、具有一定的市场分析判断能力，良好的客户服务意识 。');
INSERT INTO `t_jobdata` VALUES ('140', '建工大数据平台发展部总经理', '50-80k', '重庆-渝中区', '某重庆大型专业服务公司', 'https://www.liepin.com/a/38437051.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=24&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=24', '重庆', '大数据', '50000.00', '80000.00', '65000.00', '岗位职责\n1、负责建工大数据平台事业发展规划（包括业务发展方向、发展策略、新业务产品及服务规划等）。\n2、负责建工大数据平台业务体系建设（包括产品体系梳理、业务流程梳理、营销方案梳理等）。\n3、负责带领团队完成集团下达的发展部年度业绩指标。\n4、负责建工大数据平台团队建设、激励和管理。');
INSERT INTO `t_jobdata` VALUES ('141', '大数据专家', '40-65k·15薪', '上海', '上海数禾信息科技有限公司', 'https://www.liepin.com/job/1949318929.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=25&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=25', '上海', '大数据', '40000.00', '65000.00', '52500.00', '工作职责：\n1.业务视角探索数据驱动，技术视角追求降本增效；\n2.参与公司数据架构及研发规划，建设大数据平台；\n3.统筹数据治理相关工作，协助数据资产运营；\n5.制定数据资产管理机制、流程规范，持续挖掘数据价值。\n5.参与数仓团队的日常管理，关注团队的技术提升；\n任职资格：\n1. 精通数仓建模理论和OLAP数据立方体，有实践经验，参与过大型数仓重构者优先；\n2. 熟悉数据中台构建的全过程者优先；\n3. 熟悉Hadoop或MaxCompute，有Dataphin/Dataworks数据开发经验者优先；\n4. 熟悉Flink开发经验者优先；\n5. 熟悉Clickhouse或StarRocks（DorisDB）者优先；\n6. 理解数据治理，对数据规范标准制定、元数据管理、数据质量管理、数据安全管理等有实践或深入理解；\n7.  熟悉数仓维护和优化措施，有SLA管理和作业优化经验者优先；\n8. 具备良好的学习能力和分析解决问题能力，责任心强，具有良好的团队合作意识，沟通能力，协调能力，能够承担工作压力；\n9. 本科及以上，5年以上数据领域工作经验，金融行业优先；');
INSERT INTO `t_jobdata` VALUES ('142', '大数据VP', '50-80k·15薪', '上海', '某知名公司', 'https://www.liepin.com/a/38865865.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=26&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=26', '上海', '大数据', '50000.00', '80000.00', '65000.00', '负责大数据平台开发框架的设计、性能调优、数据流监控及日常维护；\n负责大数据团队的整体管理工作，包含数据产品、数据仓库、数据挖掘、算法策略、人工智能等方向。提升技术团队工作能力、工作效率和工作质量；\n带30人左右团队');
INSERT INTO `t_jobdata` VALUES ('143', '大数据负责人', '45-75k·15薪', '深圳-南山区', 'Bananain蕉内', 'https://www.liepin.com/job/1947279257.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=27&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=27', '深圳', '大数据', '45000.00', '75000.00', '60000.00', '工作职责:\r\n1.主导大数据团队的算法/数据框架搭建，并进行优化和落地； \r\n2.负责设计并构建数据平台，落实底层数据平台、存储平台和分析平台的设计和搭建工作；\r\n3.对接业务部门，解决业务实际需求问题；\r\n4.参与大数据平台架构设计、核心编写，解决项目开发过程中的重大技术问题；\r\n5.负责数据平台运行性能、可用性、扩展性等监控与优化调控；负责构建大数据服务体系，提供统一数据产品和工具体系；\r\n6.负责指导数据平台研发成员工作，提升研发能力。\r\n任职资格:\r\n1.本科以上学历，4年以上大数据开发经验，2年以上大数据团队管理经验；\r\n2.有数仓或数据中台经验；\r\n3.熟悉Spark、flink、hive等主流的大数据技术；\r\n4.有算法实际项目经验（机器学习、数据预测等）；\r\n5.有零售、电商、新锐品牌行业经验优先。\r\n\r\n');
INSERT INTO `t_jobdata` VALUES ('144', '高级大数据开发工程师', '20-30k', '深圳', '斯凯荣', 'https://www.liepin.com/job/1938658985.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=28&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=28', '深圳', '大数据', '20000.00', '30000.00', '25000.00', '岗位职责：\n1、负责大数据系统的开发工作\n2、与同事解决日常工作中的问题\n3、对系统存在的问题进行跟踪和定位并及时解决\n4、严格执行工作计划，主动汇报并高效完成任务保证部门及个人工作目标实现\n任职要求：\n1、计算机、软件工程等相关专业，具有3年及以上大数据开发工作经验。\n2、熟悉和使用过Hadoop和Spark生态相关技术，包括Databricks、Delta、K8S、MapReduce、HDFS、Hive、Spark-Pyspark、KAFKA、Impala、Kudu、zookeeper等，3个以上大数据平台项目实施经验，处理或搭建过 Spark on K8S 优先，使用过 Spark on AWS EKS 优先。\n3、熟悉和使用过Python 数据分析组件，如  NumPy、SciPy、Pandas、Matplotlib。\n4、熟悉和使用过MySQL、MongoDB 数据库技术。\n5、具有数仓的开发实施经验，能够独立开发设计数据仓库、ETL设计，一定的应用系统分析与设计能力，有良好、规范的编程习惯和文档编写习惯。\n4、有较强的学习能力，对技术有钻研精神，并有较高的热情，热衷于新技术、新理论、新开发实践的学习和实践。');
INSERT INTO `t_jobdata` VALUES ('145', '销售经理——大数据服务', '15-30k·13薪', '上海', '全球知名数据智能科技平台', 'https://www.liepin.com/a/38592565.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=29&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=29', '上海', '大数据', '15000.00', '30000.00', '22500.00', '工作内容：\n1、负责大数据产品的销售和客户服务，就大数据业务 / 洞察报告 / 建模服务 / 精准营销 等数据服务在各行业范围内新拓、合作、维护，努力完成公司下达的业绩目标；\n2、充分理解业务以及行业特点，开拓客户资源，根据客户需求结合公司已有的业务产品，为客户提供专业的咨询及数据服务支持，并给出相应的解决方案，引导合作；\n3、负责项目洽谈与承接等工作，参与项目各个环节的把控，能够完成客户拓展、维护，并给与专业意见。处理合作中出现的各种问题，确保客户数量的稳定增长；\n4、对数据行业及精准营销行业现状保持高度的敏感性，对客户、竞争者、媒体、数据发展趋势时刻关注，紧密跟进。\n* 任职资格：\n1、本科及以上学历，3年以上to B的大客户销售经验，有大数据服务、一方企业数据软件服务公司、咨询公司等经验优先；\n2、熟悉大数据服务 / 洞察报告 / 建模服务 / 精准营销等业务，拥有数据服务需求客户资源者优先；有丰富行业经验者优先；\n3、有强烈的目标感、具备持续学习能力和组织协调能力、抗压能力强，认可公司文化；\n4、热爱销售工作，对销售漏斗和业务关键节点的问题有较强的识别能力，有客情处理及推进能力。有销冠、销售类奖项取得者优先。');
INSERT INTO `t_jobdata` VALUES ('146', '大数据BD', '15-30k·14薪', '北京-东城区', '金保信社保卡科技有限公司', 'https://www.liepin.com/job/1951093591.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=30&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=30', '北京', '大数据', '15000.00', '30000.00', '22500.00', '岗位职责：\n1、负责大数据产品的市场开拓与销售工作，完成销售指标；\n2、负责市场营销计划的制定更新并对结果负责，对销售活动进行管理；\n3、负责合作伙伴及市场营销相关方案的制定及执行；\n4、负责市场调研和需求分析，掌握竞争对手市场动态，为公司发展提供建议。\n\n任职要求：\n1、统招本科及以上学历;\n2、熟悉大数据征信行业，有银行业销售经验者优先;\n3、具备较强的市场分析、营销、推广能力和良好的人际交往能力；\n4、具备强烈的责任感，工作积极主动，能吃苦耐劳，有较强执行力，和抗压能力。\n');
INSERT INTO `t_jobdata` VALUES ('147', '大数据平台架构师 (MJ000060)', '40-70k', '深圳', '跨越速运', 'https://www.liepin.com/job/1951622697.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=31&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=31', '深圳', '大数据', '40000.00', '70000.00', '55000.00', '1、负责公司大数据方向的数据处理架构和模型设计，结合公司实际业务情况进行技术选型；\n2、带领团队完成ETL任务调度系统设计，业务数据ETL流程处理，并确保数据质量；\n3、负责数据多维分析引擎性能优化，协助团队解决开发过程中的技术难题；\n4、参与数据平台产品的整体评估、设计、架构及关键模块的研发；\n5、制定数据开发、主数据、数据质量、数据服务等规范。\n\n1.计算机、通信、数学相关专业毕业，大学本科以上学历，6年以上的工作经验；\n2.熟悉Java，Scala、SQL等常用开发语言；\n3.基于开源hadoop生态构建的大数据基础架构，包括但是不限于HDFS/YARN/Hive/Spark/Flink/HBase/ES/Presto等分布式系统\n4.扎实的计算机基础及编程能力，熟悉常用算法和设计模式；\n5.具有强烈的责任心以及团队合作精神，具有较强沟通能力，积极向上。\n');
INSERT INTO `t_jobdata` VALUES ('148', 'RD75-大数据开发', '25-50k·13薪', '深圳-福田区', '深圳市客路网络科技有限公司', 'https://www.liepin.com/job/1951621969.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=32&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=32', '深圳', '大数据', '25000.00', '50000.00', '37500.00', '岗位职责：\n\n * 负责电商平台大数据应用层数据的开发和管理，包括用户画像，商品画像等；\n * 负责电商平台流量效率的数据洞察分析，定期输出详细报告，为产品以及策略优化提供数据支持；\n * 负责电商平台流量和流量效率看板的搭建，优化和维护；\n\n任职要求：\n\n * 5 年以上相关工作经验，熟悉银行数据仓库模型设计与ETL开发经验 ，掌握Kimball的维度建模设计方法，具备海量数据加工处理（ETL）相关经验；\n * 熟练运用大数据计算平台来处理数据，包括但不限于Flink、Hadoop、Spark等，掌握一门或多门编程语言，如Java、Python等；\n * 良好的数据敏感度，能从海量数据提炼核心结果，需要具备数据统计的基础知识，能够在数据探索上有自己的洞见分析能力；\n * 有良好的业务及产品感觉，能够超越需求，有自己独到的见解和思考。可以主动并乐于了解日常业务，具备从日常业务中发现问题并解决问题的能力；\n * 对数据挖掘和机器学习有所了解，包括常用的机器学习算法和数据建模过程的优先，有企业级数据智能应用场景实践的优先；\n * 自我要求高，有较强的责任心以及独立思考和分析问题的能力，代码风格良好。\n\n企业福利\n关注环境：人性化的办公环境，咖啡厅、室内草坪、健身房、浴室、睡眠舱......应有尽有；\n关注氛围：扁平化的管理，开放&激情的国际化团队，高颜值+高学历，每个人都有那么一点传奇；\n关注成长：业内独角兽，业务飞速发展，带给你高成长性的工作；\n关注生活：入职即享10天带薪年假；六险一金；双休；\nKLOOK关心你的生活与工作平衡，提供环境让你在工作之余学习、健身和成长；\n关注玩乐：员工可享受1000元/年的旅游基金，还可以跟Homie同富游：团队足迹踏遍国家50+，等你来一起占领地球。\n\n');
INSERT INTO `t_jobdata` VALUES ('149', '大数据工程师（新疆）', '10-15k', '乌鲁木齐-水磨沟区', '中兴通讯股份有限公司', 'https://www.liepin.com/job/1951620283.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=33&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=33', '乌鲁木齐', '大数据', '10000.00', '15000.00', '12500.00', '工作职责:\r\n1、计算机相关专业，有大数据、服务器相关专业基础；\r\n2、负责产品项目验收、设备调试、开通、运行维护、设备初验、终验等相关工作；\r\n3、做好设备问题的跟踪，反馈及疑难问题的处理、信息技术的收集、整理；\r\n4、沟通能力强、长期在山西发展或者定居。\r\n任职资格:\r\n1、具备较强的自学能力，了解通信、电子、计算机基础知识；\r\n2、有良好的沟通能力和良好的团队合作精神；\r\n3、做事认真、踏实，具有一定的创造力；\r\n4、有较好的服务意识，较好的压力承受能力和应变能力，能够适应出差；\r\n5、对通信原理、信号与系统、计算机网络基础有较好的了解优先；\r\n6、有操作系统、数据库学习经验的，熟悉LINUX、ORACLE、无线系统（GSM、UMTS、LTE、5G等无线系统）学习经验或参与过网规网优相关课题技术研究、大数据挖掘或AI建模经验者优先考虑。');
INSERT INTO `t_jobdata` VALUES ('150', '大数据销售VP', '20-30k', '深圳-南山区', '布瑞克(苏州)农业互联网股份有限公司', 'https://www.liepin.com/job/1951617857.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=34&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=34', '深圳', '大数据', '20000.00', '30000.00', '25000.00', '职责描述：\n1.负责大客户开拓，建立稳定的客户关系；\n2.制定行之有效的销售策略，完成销售目标，进行商务谈判，参与销售合同具体条款的制定及合同签订；\n3.完成区域政府，部委等大数据的商务合作 ，完成各地区渠道客户的项目合作，并完成协议签订，为项目规划奠定有利基础。\n\n任职要求：\n1.本科及以上学历，有丰富的销售经验，从事过政府项目优先，从事过大数据项目优先；\n2.有较强的商务谈判能力，客户对接能力。');
INSERT INTO `t_jobdata` VALUES ('151', '大数据开发工程师(J10011)', '12-18k', '济南-历城区', '漱玉平民大药房', 'https://www.liepin.com/job/1951616653.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=35&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=35', '济南', '大数据', '12000.00', '18000.00', '15000.00', '职责描述：\n1、负责实时计算、流式计算的开发及维护工作\n2、负责解决任务在运行中的各种问题、保证高效稳定运行\n3、负责数据收集、整理、分析，对多种数据源进行深度分析，利用ETL工具或开发程序完成数据抽取、清洗、转换、装载等工作；\n4、数据仓库维护，进行数据任务流程调优及准确性改进，进行数据质量监测、校验和提升，及时跟踪处理实施过程中的问题，对实施过程中遇到的问题及时反馈；\n任职要求：\n1、3年以上数据开发经验，有从0到1的数仓或数据中台项目经验者优先；\n2、对大数据集群扩展、容量规划、资源调度、架构设计、性能调优有一定的了解\n3、对Flink(CDC、CEP)、HBase、Doris、ELK、Kafka、Clickhouse等相关组件有一定的项目实践经验\n4、对实时业务中出现的实时倾斜、背压、流关联等问题有自己的方法论和解决思路\n5、熟悉Flink API 及 Flink SQL的开发方式；\n6、熟悉Java、Scala开发、有一定的shell或python脚本的编写能力；\n7、有风控、医疗、零售等相关业务经验优先；\n8、有大数据组件相关运维经验优先；\n9、熟悉Java、Python至少一门编程语言；');
INSERT INTO `t_jobdata` VALUES ('152', '大数据销售VP', '20-30k', '北京-朝阳区', '布瑞克(苏州)农业互联网股份有限公司', 'https://www.liepin.com/job/1951615163.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=36&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=36', '北京', '大数据', '20000.00', '30000.00', '25000.00', '职责描述：\n1.负责大客户开拓，建立稳定的客户关系；\n2.制定行之有效的销售策略，完成销售目标，进行商务谈判，参与销售合同具体条款的制定及合同签订；\n3.完成区域政府，部委等大数据的商务合作 ，完成各地区渠道客户的项目合作，并完成协议签订，为项目规划奠定有利基础。\n\n任职要求：\n1.本科及以上学历，有丰富的销售经验，从事过政府项目优先，从事过大数据项目优先；\n2.有较强的商务谈判能力，客户对接能力。');
INSERT INTO `t_jobdata` VALUES ('153', '大数据运维产品经理', '15-30k', '杭州-余杭区', '浙江数新网络有限公司', 'https://www.liepin.com/job/1951614597.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=37&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=37', '杭州', '大数据', '15000.00', '30000.00', '22500.00', '职责描述：\n1. 负责大数据运维产品的功能和业务流程设计，绘制产品原型图，编写相关需求文档并跟进协调产品研发的全过程；\n2. 分析调研业界同类产品和趋势，结合内部业务情况对产品进行规划;\n3. 负责解决客户遇到的各种问题，协助开发排查与解决线上问题。\n\n任职要求：\n1. 计算机相关专业本科及以上学历，2年以上的相关工作经验；\n2. 熟悉大数据生态诸如Hadoop、Hbase、Spark、Flink、Kafka 、Redis等集群管理、故障处理、开发或运维；\n3. 有运维与监控体系构建或研发经验者优先。\n\n上班时间：9:00-18:00，午休：11:30-13:30，双休。\n福利待遇：五险一金+餐补+出差补+团建 +生日会&礼金+节假日礼品等。');
INSERT INTO `t_jobdata` VALUES ('154', '大数据开发工程专家', '60-90k·16薪', '北京-海淀区', '荣耀终端', 'https://www.liepin.com/job/1951607437.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=38&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=38', '北京', '大数据', '60000.00', '90000.00', '75000.00', '职责描述：\n1. 构建从数据采集、数据接入、数据处理到数据统计和服务的完整数据解决方案，实现数据闭环，提升数据价值 \n2. 搭建处理海量数据的大数据平台，能够持续优化并改进现有的技术框架，保证高可用、稳定、低延迟的优质服务体验 \n3. 推动数据治理，规范化和标准化数据的开发、访问和使用 \n\n\n\n任职要求：\n1. 构建从数据采集、数据接入、数据处理到数据统计和服务的完整数据解决方案，实现数据闭环，提升数据价值 \n2. 搭建处理海量数据的大数据平台，能够持续优化并改进现有的技术框架，保证高可用、稳定、低延迟的优质服务体验 \n3. 推动数据治理，规范化和标准化数据的开发、访问和使用 \n');
INSERT INTO `t_jobdata` VALUES ('155', '大数据算法工程师', '17-25k·13薪', '上海-徐汇区', '上海飞络信息科技有限公司', 'https://www.liepin.com/job/1951605501.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=3&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=39&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=3&pageSize=40&index=39', '上海', '大数据', '17000.00', '25000.00', '21000.00', '岗位职责：\n负责安全场景的数据建模和开发。\n1.需求分析：对安全产品逻辑和数据处理流程进行分析，明确所需数据及必要的特征并提出数据结构和量化方案。\n2.方案设计：明确所需模型及技术实现步骤，进行方案设计和汇报等工作。\n3.建模开发：宽表开发及数据预处理，模型基线开发及训练，评估模型和标签上线发布等开发工作。\n4.试点验证：效果验证，试点汇报等工作。\n5.总结汇报：发布运营报告，收集需求迭代开发。\n任职要求：\n1.计算机.统计.数学.专业。\n2对大数据生态有较好认识，具备spark,hive,hadoop,kafka,qoop等大数据组件开发.调优经验。\n3良好的数据敏感度，具备电商，金融风控，IOT安全相关经验佳。\n4 良好的团队协作沟通能力。\n');
INSERT INTO `t_jobdata` VALUES ('156', '大数据算法开发', '15-30k·14薪', '保定-莲池区', '蜂巢能源科技股份有限公司', 'https://www.liepin.com/job/1951565331.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=0&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=0', '保定', '大数据', '15000.00', '30000.00', '22500.00', '职责描述：\n1.算法策略设计\n（1）负责电池外特性大数据的分析；\n（2）电池安全预警算法的开发；\n（3）故障诊断算法的开发；\n（4）SOH、RUL算法开发；\n2. 算法实现及部署\n（1）协助设计人员进行数据统计、算法实现，批量验证等编程类工作；\n（2）实时算法部署；\n（3） 离线算法部署；\n3.AI算法开发\n（1）基于 LR、Xgboost等传统机器学习电池模型开发；\n（2）基于深度学习电池模型开发；\n\n任职要求：\n1、学历：硕士3年以上，博士1年以上；\n2、熟练三元锂磷酸铁锂等锂电池特性，了解可反应电池潜在热失控隐患特征，锂电池老化机理，电池管理系统原理，熟练电池数据分析；\n3、优秀的数学模型能力，丰富的机器学习算法应用经验；\n4、熟悉机器学习算法和深度学习算法，会使用pandas、numpy、matplotlib、sklearn、pytorch、Tensorflow等库，熟悉spark，Hadoop等大数据技术；熟悉linux操作具有良好的编程习惯和代码编写能力；');
INSERT INTO `t_jobdata` VALUES ('157', '大数据算法开发', '15-30k·14薪', '常州-金坛区', '蜂巢能源科技股份有限公司', 'https://www.liepin.com/job/1951565329.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=1&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=1', '常州', '大数据', '15000.00', '30000.00', '22500.00', '职责描述：\n1.算法策略设计\n（1）负责电池外特性大数据的分析；\n（2）电池安全预警算法的开发；\n（3）故障诊断算法的开发；\n（4）SOH、RUL算法开发；\n2. 算法实现及部署\n（1）协助设计人员进行数据统计、算法实现，批量验证等编程类工作；\n（2）实时算法部署；\n（3） 离线算法部署；\n3.AI算法开发\n（1）基于 LR、Xgboost等传统机器学习电池模型开发；\n（2）基于深度学习电池模型开发；\n\n任职要求：\n1、学历：硕士3年以上，博士1年以上；\n2、熟练三元锂磷酸铁锂等锂电池特性，了解可反应电池潜在热失控隐患特征，锂电池老化机理，电池管理系统原理，熟练电池数据分析；\n3、优秀的数学模型能力，丰富的机器学习算法应用经验；\n4、熟悉机器学习算法和深度学习算法，会使用pandas、numpy、matplotlib、sklearn、pytorch、Tensorflow等库，熟悉spark，Hadoop等大数据技术；熟悉linux操作具有良好的编程习惯和代码编写能力；');
INSERT INTO `t_jobdata` VALUES ('158', '大数据测试工程师（杭州）', '18-23k·13薪', '杭州', '某北京大型IT服务公司', 'https://www.liepin.com/a/39288091.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=2&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=2', '杭州', '大数据', '18000.00', '23000.00', '20500.00', 'Service Type: Data QA　大数据测试\nTechnical/Non-technical\nRequirement Skill Description\nService Description 1、供应商将提供拥有相应技能及能力的资源以在下述任务中协助连通：（统称“服务”）\n2、执行数据仓库及BI报表等测试工作，包括文档评审，测试案例编写，测试执行，缺陷提交等具体任务\nService Scope 1、熟悉数据清洗过程（ETL），数据模型的基本概念，熟悉数据仓库，数据集市，BI报表等数据产品的基本工作原理及测试方法\n2、熟悉ETL工具(比如Informatic，Kettle等)，熟悉数据集市，报表工具（比如Tableau, PowerBI等）\n3、熟练操作至少一种主流数据库，熟练SQL脚本和存储过程编写。\n4、熟练操作Windows及Linux操作系统，熟悉Linux基本命令\n5、熟悉标准研发流程及测试流程\n6、了解Jmeter工具，会使用该工具进行接口测试或性能测试\n7、熟悉一种主流编程语言（Java或Python等），有基于该语言编写自动化测试脚本的经验\n8、了解Hadoop, Spark, Hbase等大数据相关组件的工作原理及测试方法，了解Apache Kylin者优先\nService Requirement 1、有金融，保险等复杂业务逻辑测试经验\n2、有大型系统的测试经验\n3、有较强的问题分析与解决能力，条理逻辑清晰。学习新知识的能力强\n4、有良好的沟通能力，可以很好的与业务分析团队，开发团队进行交流合作');
INSERT INTO `t_jobdata` VALUES ('159', '大数据与人工智能应用技术特级专家', '150-250k', '北京', '某北京互联网/电商上市公司', 'https://www.liepin.com/a/39286575.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=3&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=3', '北京', '大数据', '150000.00', '250000.00', '200000.00', '\"1、结合企业现状及行业趋势制定公司数字化转型战略，组织推进实施数字化转型，构建整体数字化技术架构及治理架构；\n2、研究人工智能与大数据技术领域最新进展，并应用到业务中；\n3、创造并实施能够有效帮助内外部客户实现或提升数字化的产品、服务及解决方案；\n4、以全新视角对企业自身所处的市场环境和价值链进行审视和构思，将数字化技术与企业自身核心优势相结合，通过数据分析认知市场趋势和适应未来的创新商业模式，以创新的商业模式与市场、客户建立全新的关系；\n5、负责培养企业数字化团队，指导数字化建设专业人员的职业规划和技能发展；\"\n\"1、海外博士学历，统计学、经济学，数学、计算机科学相关专业优先；\n2、担任海外知名公司、科研机构高级管理人员或高级技术人员优先，5年以上数据分析/数据科学行业经验，有重大项目参与经验优先；\n3、扎实的数据分析理论和技术基础，有开发、算法背景优先；能根据数据提供合理的见解推动产品的开发和迭代；\n4、精通数据治理及数据资产管理，熟悉数据集市、平台、智能决策以及大数据相关技术者优先；\n5、具有国际化视野、开阔的战略视野，洞悉信息、数字技术发展态势，有敏锐的数字化洞察力、市场洞察力。\"\n');
INSERT INTO `t_jobdata` VALUES ('160', '大数据架构师', '25-35k·17薪', '上海-浦东新区', '某上海大型基金证券公司', 'https://www.liepin.com/a/39282793.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=4&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=4', '上海', '大数据', '25000.00', '35000.00', '30000.00', '工作职责\n统筹技术方案设计工作，开展技术测试和选型，落实系统架构设计，对具体技术方案进行细化设计，对技术开发人员进行技术指导，建立代码开发规范，负责代码评审，把控开发质量和开发进度。\n\n任职资格\n1、	全日制本科及以上学历，计算机相关专业；\n2、	8年以上的java大数据大型应用的开发经验；\n3、	精通hadoop大数据平台相关组件的开发和测试能力，对Hive, 图数据库，elasticsearch及 spark/flink 等软件组件都有丰富的开发、排错实践经验；\n4、	精通springboot及springcloud 微服务开发框架，熟悉高复杂度分布式微服务应用管理和设计编排工作；\n5、	要求至少领导过2-3个金融机构的大型web应用和大数据分析应用的整体技术架构设计工作，并主导项目的全部技术管理过程的工作；\n6、	拥有管理10人以上开发团队的技术管理经验，对金融行业领域尤其是期货证券行业有一定的业务经验持；\n7、	熟悉多种开发设计管理方法论，如企业架构设计，敏捷开发、测试驱动开发以及DDD领域驱动设计；\n8、	严谨的逻辑思维能力，高水平的沟通能力，对技术充满热忱，有快速地学习能力和丰富的问题解决能力，具备高度个人驱动力和执行力，同时具备良好的团队合作精神。');
INSERT INTO `t_jobdata` VALUES ('161', '大数据架构师', '40-60k', '合肥', '某知名新能源上市公司', 'https://www.liepin.com/a/37047749.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=5&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=5', '合肥', '大数据', '40000.00', '60000.00', '50000.00', '岗位职责：\n1、 负责公司产品的开发及优化，保障软件系统发布运行；\n2、 参与产品的研发，负责功能设计、编码实现；\n3、 制定模块开发计划，监控开发进度及质量，保证开发任务如期完成；\n4、 参与制定平台总体数据架构及相关技术解决方案；\n5、 解决产品中的问题和技术难题；\n6、 保证产品的高性能和高可用性；\n7、 参与制定设计及实现规范，指导设计、实现及部署工作；\n8、 协助公司进行技术决策，进行技术风险评估。\n\n1、 负责公司产品的开发及优化，保障软件系统发布运行；\n2、 参与产品的研发，负责功能设计、编码实现；\n3、 制定模块开发计划，监控开发进度及质量，保证开发任务如期完成；\n4、 参与制定平台总体数据架构及相关技术解决方案；\n5、 解决产品中的问题和技术难题；\n6、 保证产品的高性能和高可用性；\n7、 参与制定设计及实现规范，指导设计、实现及部署工作；\n8、 协助公司进行技术决策，进行技术风险评估。\n\n1、计算机、自动化或数学相关专业，本科学历8年/硕士学历5年以上工作经验；\n2、精通数据仓库建模方法论，对于数据治理有一定的经验，精通SQL编程；\n3、精通Hive、Spark等分布式开源软件,具备系统优化与性能调优能力者优先；\n4、精通大数据、云计算概念，掌握Hadoop、Hive、Hbase等大数据主流技术及开源框架者优先；\n5、精通JAVA等面向对象编程，具备独立组件和平台开发能力；\n6、自学能力强，优秀的分析及解决问题能力，责任心强，优秀的沟通能力和团队精神；\n7、有数据挖掘、AI人工智能算法相关经验者优先。');
INSERT INTO `t_jobdata` VALUES ('162', '大数据测试', '12-25k', '北京-朝阳区', '阳光保险集团', 'https://www.liepin.com/job/1951411457.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=6&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=6', '北京', '大数据', '12000.00', '25000.00', '18500.00', '职责描述：\n1、能够根据实际业务需求制定完整的测试方案并制定测试计划，保证数据的正确性以及合理性\n2、参与各种评审会议，设计测试用例并执行，定位产品软件中的缺陷或问题\n3、负责数据质量保证工作，能在现有的数据质量测试方法基础上进行优化，提升测试效率\n                                          \n\n任职要求：\n1、3年以上的测试经验，有数据产品测试经验者优先；\n2、熟练掌握SQL语言，了解常用数据库；\n3、了解大数据组件：Hive、spark、hbase等；\n4、具有良好的团队沟通和协作能力  ；\n5、有一定的数据敏感性，能根据实际的业务推送数据测试的落地工作；\n6、熟悉常见的自动化测试框架优先。\n\n\n');
INSERT INTO `t_jobdata` VALUES ('163', '大数据开发工程师', '10-19k', '上海-青浦区', '格创东智(深圳)科技有限公司', 'https://www.liepin.com/job/1950578135.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=7&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=7', '上海', '大数据', '10000.00', '19000.00', '14500.00', '职责描述：\n 1.负责产品整体架构设计与数据架构管控，设计、搭建、维护、优化、开发等工作；\n 2.参与数据存储设计、业务数据体系的设计及数据建模；\n 3. 负责ETL流程优化、关键问题解决\n 4. 负责大数据平台数据分析、监控数据分析、数据挖掘等工作\n\n任职要求：\n1. 大学统招本科及以上学历，计算机相关专业\n2. 精通Mysql、Oracle、SqlSever等关系型数据库中的一种，具备SQL调优能力及Procedure 编写能力 \n3. 2年以上大数据开发相关工作经验；                                         \n4.  熟悉数据仓库、建模和集成、数据库设计和性能调化、数据质量监控和分析、数据治理                                   \n5. 具备良好的团队协作能力和沟通能力，热爱开发工作，具备良好的编程习惯\n6. 有LCD/OLED/半导体 等行业经验，有MES/自动化项目实施相关经验');
INSERT INTO `t_jobdata` VALUES ('164', '数据分析工程师（大数据方向）', '12-35k', '北京-昌平区', '中移动金融科技有限公司', 'https://www.liepin.com/job/1951246245.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=8&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=8', '北京', '大数据', '12000.00', '35000.00', '23500.00', '职责描述：\n1、根据用户行为数据进行增长相关分析，形成分析报告，为产品改进提供数据支持和决策建议；\n2、大数据全景用户标签画像体系建设，包括设计、开发、上线运营、并应用于可视化画像、精准营销、个性化推荐、智能服务、智能风控等业务场景；\n3、推动基础数据建设，包括各类数据采集埋点、数据指标体系搭建和分析体系搭建，实现数据可视化；\n4、能够根据数据现状协同开发对数据的生产、存储、应用等制定埋点治理解决方案，提升用数效率。\n任职要求：\n1、 全日制本科及以上学历，计算机、大数据、统计、信息技术、人工智能、金融科技等相关专业，有头部互联网公司工作经验者优先；\n2、具有2年及以上数据分析或数据产品经理工作经验，有扎实的算法和数据结构基础，熟练掌握SQL编程语言；\n3、认真细致，逻辑性强，热爱学习，具有良好的数据敏感度，能从海量数据中挖掘分析出对业务和算法有价值的结论，独立且高效地输出分析报告，为业务侧提供数据支持和决策依据；\n4、具备强烈的责任感及执行力，较强的沟通协调能力和团队合作精神。');
INSERT INTO `t_jobdata` VALUES ('165', '销售总监（智慧城市项目、大数据局资源）', '25-40k', '昆明-呈贡区', '上海维智卓新信息科技有限公司', 'https://www.liepin.com/job/1949309631.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=9&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=9', '昆明', '大数据', '25000.00', '40000.00', '32500.00', '\n岗位职责：\n1、负责政府客户（智慧城市方向）拓展、商务推进和客户签约工作。\n2、及时发现并跟进现有客户的需求、并能及时提供产品沟通、答疑和问题解决。\n3、协调内部技术、产品、研究等专家资源、处理商务合作过程中客户问题。\n4、负责客户关系管理，加强客户合作与沟通，建立良好的客情关系。\n5、能独立负责地级市以上区域智慧城市拓展工作\n\n任职要求：\n\n1、本科及以上学历，5-10年工作经验，至少3年在智慧城市方向行业的工作经验，有LBS经验优先考虑；\n2、对智慧城市或相关政府行业有丰富的商务接洽经验，对智慧城市方向流程与销售开发有很好的认知；\n3、具备0-1的市场突破能力及独立在一个市场的突破能力；\n4、参与政府标书的撰写，具备技术行业领域背景；\n5、善于沟通、较强问题解决和协调处理的能力。\n6、乐于学习新知识，较强的自我驱动和自我管理能力。\n7、具备较好的行业洞察力和商业敏感度，包括互联网数据行业数据分析能力。');
INSERT INTO `t_jobdata` VALUES ('166', '大数据开发工程师', '13-25k·13薪', '武汉-江夏区', '光庭信息', 'https://www.liepin.com/job/1949116663.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=10&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=10', '武汉', '大数据', '13000.00', '25000.00', '19000.00', '职责描述：\n1、负责数据仓库（离线、实时）工具建设、开发和维护\n2、负责大数据基础架构和技术体系的规划建设\n3、负责数据采集、数据处理的自动化与智能化体系建设\n4、负责大数据平台数据质量建设\n5、负责数据平台稳定性保障体系建设\n岗位要求：\n1、全日制本科或以上学历（含学位），3年以上相关工作经历\n2、掌握分布式系统原理，对存储、计算、消息队列、集群管理中的一项或多项有深入理解和认识\n3、乐于挑战行业难题，喜欢探寻新技术\n4、对HDFS/RocksDB/LevelDB/Memcache/Redis/MySQL/HBase/Kafka的2项或以上有开发经验\n5、对Spark/MapReduce/Storm/Hive/Presta/Impala的一项或多项有开发经验\n6、对Yarn/Mesos/K8s的一项或多项有开发经验');
INSERT INTO `t_jobdata` VALUES ('167', '大数据项目经理--天津', '12-20k·15薪', '天津-河东区', '盈天地', 'https://www.liepin.com/job/1944682411.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=11&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=11', '天津', '大数据', '12000.00', '20000.00', '16000.00', '岗位职责：\r\n1、负责大数据项目或金融数字化转型项目整体规划，分析产品需求，制定项目计划，带领团队项目实施。负责公司驻点项目的团队管理，负责与客户、公司及团队内外部的多方之间的沟通和协调工作，高效完成项目交付；\r\n2、负责商务沟通，挖掘客户需求，项目调研和分析、概要设计、详细设计、撰写相关文档。\r\n3、按照甲方项目管理要求，执行项目管理过程，负责项目过程管控，对项目成果负责；\r\n4、项目过程中协调各项资源，统筹项目进度，并对项目过程中的问题、风险把控。\r\n5、建立清晰、透明、高效的沟通机制，推进团队的内外部沟通协调，收集和准备项目管理状态报告。\r\n6、把握项目进度／质量，规范相应流程规则和项目完成的标准化。\r\n岗位要求：\r\n1、具备大数据相关知识，3年以上项目管理及实施团队管理经验。\r\n2、精通大数据项目流程，熟悉数据采集，治理和挖掘，熟悉产品质量控制。\r\n3、对项目过程管理有较好的理解、良好的技术文档撰写能力。\r\n4、优秀的沟通能力、组织协调能力，良好的团队激励和团队合作意识。\r\n5、必须具备优秀的自我驱动能力，执着的心态，强烈的责任心和解决问题的能力。\r\n6、具备独立担当的能力，适应短期出差。：');
INSERT INTO `t_jobdata` VALUES ('168', '大数据etl工程师', '20-30k·14薪', '北京', '通用环球医疗集团有限公司', 'https://www.liepin.com/job/1950455885.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=12&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=12', '北京', '大数据', '20000.00', '30000.00', '25000.00', '职责描述：\n负责集团下多家医院大数据平台开发相关业务。\n\n任职要求：\n1. 3年以上医疗信息系统（HIS、EMR、信息平台等）实际经验，能力突出者可适当放宽；\n2. 熟悉医院业务流程，熟悉医疗信息系统（HIS、EMR、LIS、PACS等）及相关数据结构，如东华、北大医信等；\n3. 熟悉关系型数据库设计原理，精通SQL；\n4. 熟悉一种或多种ETL框架(Kettle, Sqoop， DataX等)；\n5. 需要有一定开发能力，具备java和python能力优先；\n6. 有医疗大数据公司从业经历者优先考虑；\n7. 具备以下技术栈优先：hive、flink、dataX、dolphinscheduler、java。\n');
INSERT INTO `t_jobdata` VALUES ('169', '大数据平台负责人', '100-130k·18薪', '北京', '某国内大型能源公司', 'https://www.liepin.com/a/38052507.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=13&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=13', '北京', '大数据', '100000.00', '130000.00', '115000.00', '岗位职责：\n1.打造集团数据平台，包括数据采集、实时数据流、数据仓库、调度系统、查询引擎等，降低数据的使用门槛，实现数据价值；\n2.打造业界采集、存储、计算等分布式系统，为海量数据和大规模业务系统提供可靠的基础设施；\n3.负责大数据平台数据治理（元数据、数据目录、数据政策、数据质量等）功能的技术方向评估、技术选型、架构设计\n4.负责全面了解公司业务，进行深层次的数据分析，为数据开发项目提供指导性的意见，从数据角度为公司产品开发、业务运营提供决策支持建议；\n5.对全链路数据质量负责，进行实时监控，分析，最终提供低延时，高可用等指标；\n6.对接数据平台上的各种业务方，满足不断发展的业务系统建设需求；\n7.对接各类数据源系统，包括集团内部的各种queue，关系数据库，非关系型数据库，日志等系统。\n职位要求：\n1.计算机、数学相关专业本科及以上学历，5年以上开发经验；\n2.扎实的Java开发功底，理解IO、多线程、集合、并发包，对JVM原理有较好的了解；\n3.存储方向：对HDFS、Hive、Redis、MySQL、HBase、Kafka的一项或多项有经验者优先；\n4.计算方向：对Spark、Storm、Flink、Hive、Druid的一项或多项有经验者优先,主导或参与过基于sparkstreaming或flink等流计算方案落地优先；\n5.资源管理方向：一项或多项有经验者优先；\n6.追求优雅的设计和优秀的代码质量，高标准，强悍的编码和trouble-shooting能力，优秀的团队沟通与协作能力；\n7.熟悉数据挖掘、机器学习的基本概念和流程，对数据敏感，理解数据应用的各个环节，能够与数据科学家和应用开发同学无缝合作；\n');
INSERT INTO `t_jobdata` VALUES ('170', '大数据开发工程师', '40-60k', '上海-长宁区', '国内一线银行', 'https://www.liepin.com/a/38590891.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=14&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=14', '上海', '大数据', '40000.00', '60000.00', '50000.00', '职责描述：\n1. 负责部门数据集市建设，满足数据分析、工具建设需求；\n2. 参与各项数据工作的需求分析、代码等评审工作；\n3. 参与、规范数据集市相关项目的开发工作，并不断改进；\n4. 参与数据集市的日常运维，保障应用网站、批量调度等正常运作。');
INSERT INTO `t_jobdata` VALUES ('171', '大数据架构师', '50-80k', '北京-朝阳区', 'Michael Page', 'https://www.liepin.com/job/1950630607.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=15&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=15', '北京', '大数据', '50000.00', '80000.00', '65000.00', '\nWhat you get to do:\n1. Responsible for building our client general data platform, and continuously optimizing and iterating the platform to improve its user experience and meet the requirements of different products.\n2. Deeply understand the business requirements of each product, build a data warehouse model, and reasonably plan the data warehouse structure, and implementation plans and steps.\n3. Continuous data governance, data security and cost optimization.\n4. Research and innovation based on the new technologies, promote the implementation, and application of new technologies.\n5. Participate in the training of company data talents.\n6. Establish a good technical influence in the industry inside and outside the company.\n\n\nQualifications:\n1. More than 5 years of experience in big data area, and more than 3 years of experience as a data architect.\n2. At least once led the design and development of the data platform.\n3. Has own solutions to the industry\'s conventional data problems, and has own solutions and key paths/methods for complex problems.\n4. Familiar with big data technologies commonly used in the industry, including but not limited to Hadoop, Spark, Hbase, Hive, Flink, Kafka, ClickHouse, Kylin, etc.\n5. Deeply understand the principles of distributed computing and storage technology, and be able to apply them to projects.\n6. Has good communication and expression skills, be able to clearly express the ideas and be able to successfully implement and implement them.\n7. Strong communication skills in English.\n\n\n');
INSERT INTO `t_jobdata` VALUES ('172', '大数据副总监', '90-100k', '北京', '某重庆大型互联网/电商公司', 'https://www.liepin.com/a/39088707.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=16&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=16', '北京', '大数据', '90000.00', '100000.00', '95000.00', '1、负责整个数据管理体系的规划及建设，从整个体系流程、制度、工具、平台等所有能力上保障公司数据相关工作的稳定、安全、可靠、合规；\n2、负责大数据工具平台的规划建设、架构设计，并在工作中根据业务发展不断提升团队、平台的水平和效率；\n3、基于数据驱动，统筹公司级数据产品、数据治理和数据资产管理等相关工作，为业务提供数据价值；\n4、根据互联网行业内新大数据技术方向和公司业务发展，制定大数据底层平台的技术演进图，把握技术发展方向，推进公司大数据中台的建设；\n5、负责团队部门的日常技术管理工作以及部门人员的统筹规划，加强团队成员培养和技能提升；\n任职要求：\n1、10年以上数据平台、数据体系建设等相关工作经验，作为项目负责人参与过数据中台能力建设或数据体系搭建的相关经验；\n2、熟练掌握数据体系建设的各个环节，深入理解数据质量管理、数据标准管理、企业级数据建模、主数据管理等方法；\n3、有五百强中大型金融行业、消费金融、银行零售业及大型数据平台建设经验者。');
INSERT INTO `t_jobdata` VALUES ('173', '大数据专家（岚图汽车）', '25-50k', '武汉', '东风汽车', 'https://www.liepin.com/job/1931512963.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=17&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=17', '武汉', '大数据', '25000.00', '50000.00', '37500.00', '岗位职责:\r\n1、负责大数据平台架构，产品需求，技术方向，解决方案定义;\r\n2、负责大数据平台搭建方案设计，并梳理从车端到服务的完整业务流程和分解业务线；\r\n3、负责数据在完整的从车端到生态服务的融合、分析与模型建立机制；\r\n4、运用数据分析软件及关键指标定义，生产智能网联业务所需的数据报告，形成数据价值。\r\n任职资格:\r\n1. 3年以上互联网数据分析经验；\r\n2. 具有熟练建模能力，熟练使用数据分析开发工具及语言\r\n\r\n说明：本岗位招聘单位为岚图汽车科技公司。');
INSERT INTO `t_jobdata` VALUES ('174', '医疗大数据销售经理', '15-30k', '西安', '北京深睿博联科技有限责任公司', 'https://www.liepin.com/job/1943134705.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=18&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=18', '西安', '大数据', '15000.00', '30000.00', '22500.00', '职责描述：\r\n1、负责拓展新医院和维护现有医院的项目，对医院端、政府端解决方案销售负责。\r\n2、建立与辖区内医院的合作，维护关键客户和合作渠道，完成相应指标。\r\n3、配合运营体系持续可跟踪服务医院及专家，挖掘客户需求。\r\n岗位要求:\r\n1，大专及以上学历，医疗信息化背景优先，有一定的行业资源；\r\n2，对医疗大数据领域有一定认知和见解，有兴趣和激情一起加入创业团队；\r\n3，有独立的项目管理、策划和执行能力，有一定的研究和科研思维；\r\n4，客户服务第一的工作思维；\r\n5，有独立的思维能力，具备较强的学习和创新能力。');
INSERT INTO `t_jobdata` VALUES ('175', '大数据开发工程师（石家庄）', '10-14k', '石家庄-裕华区', '上海瑞禾通讯技术有限公司', 'https://www.liepin.com/job/1950074695.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=19&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=19', '石家庄', '大数据', '10000.00', '14000.00', '12000.00', '1、负责大数据Hadoop平台组件（如HDFS/Yarn/Spark/Hive/Kafka/PG等组件)的研发、维护及优化；\n2、负责大数据平台开发和维护，负责海量据的处理、分析、挖掘；\n3、负责大数据分析模型的开发、优化；\n4、负责高并发、大存储的数据系统，实时计算处理系统的研发；\n5、完成上级领导交办的临时性工作任务。\"										\n										\n										\n										\n										\n');
INSERT INTO `t_jobdata` VALUES ('176', 'CTO 技术总监（互联网/大数据）', '100-150k·15薪', '深圳-南山区', '某深圳大型互联网公司', 'https://www.liepin.com/a/36613715.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=20&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=20', '深圳', '大数据', '100000.00', '150000.00', '125000.00', '岗位职责：\n一、战略发展规划（10%）：\n1、自上而下战略分解：根据公司、产研中心发展战略规划，分解出本部门的客户层目标、内部工作流程层目标、学习成长层目标，并制定详细的策略、行动计划，支撑公司和产研中心战略目标的实现；\n2、自下而上战略支撑：从本部门的职责出发，目标导向、问题导向、结果导向，持续更新管理理念、提高核心能力素养，持续完善部门的工作方法和流程，带领本部门团队实现远景目标。\n二、技术体系建设和升级（10%）：\n1、推进团队的技术架构和业务架构发展。深入理解业务，并结合行业的成熟实践，推进本部门系统的技术架构、业务架构、数据架构的持续发展。\n三、工作流程、方法建设（20%）：\n1、负责执行、执行、优化本团队内部、与外部团队工作相关的工作流程、方法的改进，提升团队的工作效率和输出质量；\n四、日常项目交付保障（40%）：\n1、参与产品需求分析，制定开发策略、技术方案及计划、敏捷项目管理，统筹资源和任务分配，保证项目的开发进度和质量；\n五、团队管理与发展（20%）：\n1、根据公司产品发展方向，及时追踪、收集本领域新技术、新动态的资料，通过技术培训、交流等方式，建立开发团队的追求创新的文化氛围和过程，提高开发团队的技术和业务能力；\n2、负责本部门的团队的管理、成员成长方向设计。负责团队的人才发展、团队发展，包括工作任务/目标管理、团队文化/氛围建设、内外部工作关系建设、绩效发展。\n3、常用的数据结构与算法；\n4、MySQL、PolarDB数据库应用开发、性能调优；\n5、Redis、ElasticSearch、OSS、Hbase等NoSQL技术；\n6、Http协议、网络编程、操作系统、web服务等技术；\n\n任职要求：\n1、有至少50~100人（总监岗）以上团队成功管理经验，在客户导向、组织发展、执行力、个人形象塑造等方面有突出的成功经验。\n2、在熟悉所在领域的业务流程基础上，能进行中型规模、中等复杂度的业务或问题的解决方案设计，有自己的见解，有创新的办法，表现出解决问题的能力；\n3、参与/组织/实施相关专业方向、架构发展的决策/设计/执行；\n4、对专业领域具有分析和实施/组织实施能力；\n5、具备良好的沟通协调和团队协作能力，有强烈的责任心、客户意识和积极主动的工作态度。\n6、大厂优先。薪资面议。\n\n有以下生活服务·O2O·物流/仓储·大数据 行业经验 ，加分。');
INSERT INTO `t_jobdata` VALUES ('177', '大数据开发工程师', '10-18k', '深圳-福田区', '民太安财险公估', 'https://www.liepin.com/job/1949127595.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=21&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=21', '深圳', '大数据', '10000.00', '18000.00', '14000.00', '一、岗位职责：\n1、负责公司大数据平台的技术工作，包括需求分析、架构设计、研发以及性能分析工作；\n2、负责对入库的各类数据进行清洗、分析，建立数据仓库；\n3、负责进行数据计算，重组，报表数据提取等数据开发工作。\n\n二、任职条件：\n1、本科及以上学历，计算机相关专业; \n2、2年以上数据采集、清洗整理、数据分析相关工作经验;\n3、熟悉Linux开发环境，熟练使用java、python语言；\n4、精通数据库技术，具有数据库设计的经验，熟悉SQL的使用与开发；\n5、有大数据分析相关的技术使用经验优先，比如Flink、Kettle、Hive、Spark、Storm等； \n6、熟悉开发常见算法，精通数据结构; \n7、有互联网或车联网公司大数据开发工作经验的优先。\n8、有一定的ETL开发经验，了解日常作业的部署和调度，具有相关ETL开发工具者优先考虑。\n9、熟悉一种或以上主流报表开发工具，熟悉smartbi工具优先考虑；');
INSERT INTO `t_jobdata` VALUES ('178', '大数据产品经理', '13-18k', '广州-海珠区', '省广集团', 'https://www.liepin.com/job/1951061417.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=22&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=22', '广州', '大数据', '13000.00', '18000.00', '15500.00', '岗位职责：\n1、负责大数据产品的规划和落地，包括市场调研、需求分析、产品定位、产品架构、模型算法及详细功能的设计，PRD等文档编写。\n2、深度关注大数据行业动态和了解市面主流平台及模式，敏锐把握大数据发展趋势和前沿产品思路和新的方向，并转化为产品业务的落地和提升。\n3、对外负责与业务团队对接，收集业务需求，形成高效可行的系统化解决方案，对内和开发测试团队紧密配合，推动大数据产品的落地，并对结果负责。\n\n岗位要求：\n1、3年以上互联网to B数据产品（包括但不限于大数据产品、数据中台等）相关工作经验，有广告营销行业经历优先。\n2、具备较强产品洞察力和敏锐感，善于发掘行业潜在需求，具有一定的行业前瞻性。\n3、有产品大局观，同时注重产品细节体验，并对数据有较强敏感度。\n4、熟练使用Axure、墨刀、Sketch等工具进行产品原型设计，有数据建模项目经验优先。\n5、具备较强的数据分析能力、逻辑思维能力，能够深入挖掘数据价值，多方面审查数据维度。');
INSERT INTO `t_jobdata` VALUES ('179', '大数据架构师', '45-65k·16薪', '西安', '某知名上市公司', 'https://www.liepin.com/a/38403979.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=23&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=23', '西安', '大数据', '45000.00', '65000.00', '55000.00', '1. 负责工业大数据技术、应用场景等调研及相关资料收集整理，工业大数据分析平台架构设计及规划\n2. 工业大数据相关的大数据描述、采集、传输、分析等理论方法及核心技术及应用技术的研究\n3. 制定平台工业大数据相关技术规划、标准制定，并且推动团队遵循标准；\n4. 负责关键项目中的技术难题，牵头项目关键架构设计和技术难点攻关\n\n1. 计算机、软件工程及相关专业，本科及以上学历，至少5年以上大数据项目相关工作经验，有工业大数据项目经验者优先考虑\n2. 精通Hadoop、HBase、Kafka、Hive、Spark等组件的工作原理，熟悉Hadoop生态系统\n3. 熟练掌握海量数据分析的相关模型、算法，有制造行业大数据分析模型、算法经验者优先\n4. 熟悉数据库开发，精通面向对象设计、设计模式，熟练MySQL、Redis等数据库\n5. 精通Java，python中的一种或多种语言，具备海量数据处理以及性能优化的能力。\n6. 有大数据挖掘和分析、机器学习相关项目经验者优先');
INSERT INTO `t_jobdata` VALUES ('180', '大数据数据建模专家', '25-50k·14薪', '北京-丰台区', '亿海蓝(北京)数据技术股份公司', 'https://www.liepin.com/job/1949082085.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=24&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=24', '北京', '大数据', '25000.00', '50000.00', '37500.00', '岗位职责\n针对航运物流领域的关键决策场景要求，设计有效的大数据解决方案，参与并指导团队进行方案的研发实现，支撑智慧决策问题的解决。\n1、基于船舶资料和航行轨迹等数据，进行航运物流领域的大数据分析和模型构建，如：根据航运数据特点，确立多维水运挖掘数据和已知指标数据(如运输价格，商品价格) 相关性模型建立；\n2、指导团队进行船舶行为分析、航运情报和交通状态预测等关键模型建设；\n3、跟踪模型表现和优化升级，支撑模型算法在关键项目中的落地应用；\n4、协助公司各业务系统的数据看板和报表设计，支撑经营决策，提升运营效率；\n5、追踪人工智能、机器学习领域最新研究及应用进展，向业务应用转化；\n6、参与公司数字化创新和解决方案制定和实施。\n\n岗位要求\n1、应用数学、统计学、金融学或计算机类专业，硕士以上学历；\n2、具有独立的统计分析、模型建设和算法优化经验，能够熟练运用大数据相关分析工具；\n3、熟悉常用数据挖掘和机器学习的算法模型，并有实践经验；\n4、具备扎实的数理分析和逻辑推断能力，充分掌握概率统计等分项方法；\n5、具备数据驱动的勘探能力、业务数字化洞察力，较强的大数据解决方案设计能力；\n6、熟悉Python等编程技能，熟悉Hive/Spark等主流数据开发平台；\n7、有交通领域大数据建模经验者优先（图论、LBS、网络交通流分析等）；\n8、有大数据应用产品（数据集市）搭建和架构设计经验者优先；\n9、有金融风控、大宗商品贸易、金融期货以及价格预测分析经验优先。');
INSERT INTO `t_jobdata` VALUES ('181', '大数据分析师', '16-35k', '厦门-思明区', '厦门市规划数字技术研究中心', 'https://www.liepin.com/job/1950487675.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=25&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=25', '厦门', '大数据', '16000.00', '35000.00', '25500.00', '(一)岗位职责\n1、理解智慧城市大数据应用领域的业务，挖掘数据分析需求，组织和落地数据分析项目；\n2、 负责多源时空大数据分析挖掘及可视化研究；\n3、 参与大数据应用服务方案或相关研究成果的编制等；\n4、 辅助沉淀相关数据分析应用的产品。\n(二)基本条件及要求\n1、全日制硕士及以上学历，数学、计算机、地理信息、数据科学、人工智能等相关专业背景，博士学历优先考虑；\n2、具备城市规划、城市建设发展、轨道交通等领域数据分析建模、大数据应用3年以上数据分析工作经验；具备构建时空大数据挖掘分析模型及可视化表达的能力（有机器学习算法应用工作经验者优先）；\n3、熟练使用至少一门编程语言（熟练使用python、matlab者优先），熟悉ArcGIS者优先；\n4、具备编制“时空数据+业务数据/管理数据/城市运行数据”大数据应用服务方案的能力，能为政务服务、智慧城市等提供技术支持；\n5、具备较突出的组织协调和沟通汇报能力，积极的工作态度和服务意识；具有良好的文字总结能力，能够独立胜任撰写材料；\n6、具有严谨、细致、踏实的工作作风；求知欲强，有钻研探索精神；喜欢挑战，有较高的自我期望和成长诉求。\n（三）薪资待遇\n1、提供同行业内具有竞争性的薪酬待遇，年薪面议；\n2、采用合同聘用制，依法缴纳五险一金。');
INSERT INTO `t_jobdata` VALUES ('182', '大数据系统运维(008221)', '25-40k', '深圳-福田区', '中信银行信用卡中心', 'https://www.liepin.com/job/1946405291.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=26&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=26', '深圳', '大数据', '25000.00', '40000.00', '32500.00', '岗位职责:\r\n1、负责Hadoop、Hive、Hbase、Spark等大数据平台的规划、部署、监控、优化;\r\n2、负责大数据平台的运营管理、方案评审、组件优化;\r\n3、负责大数据平台的异常与故障处理，应急响应，保障平台持续稳定运行;\r\n4、持续跟踪业界技术发展动态，并结合业务发展需要，研究引入新兴技术。\r\n任职资格:\r\n1、熟悉Hadoop大数据生态圈，熟悉Hive、Hbase、Yarn、Spark、kafka等组件的工作原理，并且有实际部署运维经验；\r\n2、深入理解Linux系统，熟悉运维体系架构；\r\n3、熟悉shell脚本及Python编程;\r\n4、具备良好的团队协作意识与主动意识。\r\n\r\n优先考虑：\r\n有自动化运维平台构建经验或Hadoop组件源码阅读与分析能力者。');
INSERT INTO `t_jobdata` VALUES ('183', '大数据主管', '15-20k', '武汉', '武汉市仟吉食品有限公司', 'https://www.liepin.com/job/1950609807.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=27&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=27', '武汉', '大数据', '15000.00', '20000.00', '17500.00', '职责描述：\n1.负责大数据平台技术建设，熟悉hive,sqoop,yarn,Oozie,Spark等组件的安装、维护工作；\n2.负责大数据平台ETL设计开发工作，负责数据质量设计，将各个业务平台的数据资产纳入大数据平台管理；\n3.负责大数据平台模型规范设计，模型设计，模型质量把控工作，保证数仓模型达到建设标准，为前端报表提供数据来源；\n4.负责数据平台的数据运维工作，解决实际开发过程中组件使用问题，保证数据开发过程流畅进行；\n5.负责大数据部门管理，指导团队内成员按规范完成工作;\n6.主导大数据平台项目建设，完成仟吉整体的数据指标模型设计并落地实现。\n\n任职要求：\n1.本科及以上学历，计算机及信息系统等相关专业，5年左右大数据相关经验；\n2.具有完整的Hadoop体系平台建设经验，有相关项目经历，掌握大数据平台项目建设步骤；\n3.熟练掌握Hadoop体系各组件技术原理，安装部署步骤，工具使用方案，具备解决常规组件在实际运行中Bug的能力；\n4.熟练掌握数据模型规范设，积累有零售业模型规范设计经验，了解设计过程中各项关键点；\n5.熟练掌握Sql语法，可以进行Sql优化，掌握存储过程和UDF函数的开发；\n6.了解常见的ETL工具的运用，可以熟练使用相关工具进行ETL链路开发；\n7.有项目管理，部门管理经验者优先。\n\n你将获得：\n1.每周双休，五险一金；\n2.地铁上盖，时尚办公环境；\n3.吃货联盟，自助Coffee，生日卡券；\n4.年度体检，技术津贴，定制培训；\n5.烘焙DIY，新员工茶话会，即刻跑团，部门Party。');
INSERT INTO `t_jobdata` VALUES ('184', '大数据运维工程师', '45-50k', '深圳-福田区', '某世界500强百货公司', 'https://www.liepin.com/a/39040543.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=28&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=28', '深圳', '大数据', '45000.00', '50000.00', '47500.00', '岗位职责：\n1. 负责公司大数据平台的运维，扩容，调优。\n2. 负责数据集成自动化工具研发，集群监控工具研发。\n3. 负责大数据自运化运维的建设。\n4. 负责相关运维文档编写，解答集群用户各类问题咨询。\n\n任职要求：\n1. 熟悉Linux，熟练使用shell、perl、python等至少一门脚本语言，熟悉golang并有一定的开发经验。\n2. 至少3年以上大数据运维开发经验，熟悉hive, 精通SQL，熟悉大数据集群各大组件常见问题运维，集群性能调优; \n3. 熟悉数据仓库建模及ETL工具如sqoop,datax的使用，熟悉自动化运维工具(ansible)的使用。\n4. 熟悉DorisDB，ClickHouse运维，有一定的数据集成开发经验。\n5. 熟悉常见BI工具如Tableau,PowerBi报表工具的基本使用。\n6. 熟悉prometheus,grafana的监控工具的使用，熟悉Azure基础环境的使用\n7. 良好的沟通理解能力，做事认真负责，较高的团队合作能力和解决问题能力及抗压能力。');
INSERT INTO `t_jobdata` VALUES ('185', '大数据算法高级经理', '40-70k·18薪', '上海', '知名新能源公司', 'https://www.liepin.com/a/37643411.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=29&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=29', '上海', '大数据', '40000.00', '70000.00', '55000.00', '主要职责：\n\n1.     基于业务场景（车载/商用车/储能 电池系统），负责大数据算法开发。\n\n2.     挖掘大数据价值，提前布局未来业务，进行业务拓展\n\n3.     建立大数据算法平台\n\n4.     依据业务场景，建立大数据算法开发流程，并对集群提出优化方向\n\n \n\n要求：\n\n1.     有过大数据算法开发经验，并有落地产品\n\n2.     在新能源领域有相关经验优先考虑\n\n3.     能带领团队完成高效集群的建立，提升内存、CPU利用率，满足日益增长的计算需求；\n\n4.     有丰富的分布式算法部署经验，能部署实时高效交互的云车交互系统；\n\n5.     有丰富的工业AI算法经验，最好有运用迁移学习、非平衡问题、传感器视觉等解决与我司类似业务问题的成功项目经验。\n\n	6. 有丰富的数据挖掘经验，制定算法，包括预测性维护等算法开发');
INSERT INTO `t_jobdata` VALUES ('186', '大数据总监', '100-130k·15薪', '上海-浦东新区', '某上海互联网上市公司', 'https://www.liepin.com/a/38724697.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=30&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=30', '上海', '大数据', '100000.00', '130000.00', '115000.00', '岗位职责：\n\n1. 依据公司多元化业务发展战略，搭建适配不同业务阶段的数据架构，完备数据中台基础；\n\n2. 不断通过新技术优化数据体系、数据治理，完善数据仓库、数据集市、报表体系；\n\n3. 通过丰富数据生态，为业务运营与经营决策提供数据支撑，实现数据的业务价值转化；\n\n4. 整合内外部技术与基础产品，带领团队设计并落地符合业务场景需要的数据产品和解决方案；\n\n5. 与各业务部门协调配合，完成支持业务发展的数据相关需求；\n\n6. 负责数据开发团队日常管理工作，组织、管理数据开发资源，培养和组建梯队，提升数据开发人员的技术、效率及团队凝聚力。\n\n\n\n任职要求：\n\n1. 全日制本科及以上学历，计算机相关专业，8年以上金融或互联网大数据开发应用经验，有互联网金融背景熟悉零售信贷业务优先；\n\n2. 精通大数据处理及分布式系统相关技术，如Hadoop、Mapreduce、Spark、Hive、HBase等；\n\n3. 精通实时计算及查询搜索相关技术，如Flink、Kafka、Clickhouse、Presto、Druid、Impala、Kylin等；\n\n4. 熟悉主流的应用开发框架，如Spring、Spring MVC、SpringBoot等；\n\n5. 熟悉数据分析和数据建模方法论，具备企业级数据仓库和BI项目经验，对数据行业发展有深刻的理解；\n\n6. 具备3年及以上综合性数据团队管理经验。具备15人+复合型团队管理经验');
INSERT INTO `t_jobdata` VALUES ('187', '大数据开发工程师', '35-55k', '深圳-坪山区', 'BYD', 'https://www.liepin.com/job/1947794141.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=31&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=31', '深圳', '大数据', '35000.00', '55000.00', '45000.00', '岗位要求\r\n1、熟悉大数据系统、分布式服务系统和数据仓库知识；\r\n2、理解行业业务知识和核心数据，具有良好的数据思维和数据敏感性；\r\n3、熟悉Postgresql/MySQL/maxcompute数据库，精通pl/sql编程,精通存储过程和函数；\r\n4、有丰富的主题建模经验，对数据治理，元数据管理有实际项目经验；\r\n5、本科以上学历。\r\n岗位职责：\r\n1.负责数据服务开发及数据可视化开发\r\n2.负责数据产品开发与维护');
INSERT INTO `t_jobdata` VALUES ('188', '大数据运维工程师', '12-20k', '南京-鼓楼区', '南京瑞海文信息科技有限公司', 'https://www.liepin.com/job/1951118723.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=32&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=32', '南京', '大数据', '12000.00', '20000.00', '16000.00', '职责描述：\n负责基于Cloudera Manager/CDH的大数据集群平台搭建及相关维护工作\n负责系统的运维和主动预防，搭建监控机制并及时发现集群问题，持续提升平台可用性和稳定性\n跟踪并处理系统事件，对系统问题及故障解决跟踪优化，负责服务状况与服务质量报告，确保集群服务质量\n为客户提供大数据分析的必要支持\n\n\n\n任职要求：\n本科及以上（条件优秀可以大专），3年以上企业级集群环境的运维经验\n熟悉CDH/Hadoop生态圈，对HDFS,HBase,Impala,Spark,Yarn,Hive等参数调优，性能优化有实际经验\n基于Hadoop大数据体系有深入认识，有CDH集群搭建和管理经验，节点调优经验\n实际处理过各类集群在线版本升级，数据迁移，集群扩容，稳定性监控等工作\n能适应差旅，具有团队合作意识');
INSERT INTO `t_jobdata` VALUES ('189', '大数据开发工程师', '30-35k·13薪', '北京-东城区', '上海投中信息咨询股份有限公司北京办事处', 'https://www.liepin.com/job/1951133409.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=33&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=33', '北京', '大数据', '30000.00', '35000.00', '32500.00', '岗位职责\n1、负责企业大数据数据中台建设\n2、负责企业画像功能开发及实施\n3、负责数据指标系统的开发\n\n任职资格\n1、熟练掌握Java/scala开发，具备扎实的程序设计基本功和学习能力 \n2、熟练使用spark streaming、flink等大数据流式计算引擎，有大数据实时计算开发经验优先，对源代码有一定研究者优先； \n3、了解数据仓库维度建模相关知识，对数仓有深入理解，有设计及开发指标系统相关经验优先； \n4、掌握Kylin、superset等大数据BI相关工具，有大数据实时统计分析经验优先，参与过大数据BI项目优先； \n5、了解常用的机器学习分类算法优先；\n6、有参与工商大数据、金融相关业务领域的数据开发者优先；\n7、有较强的人际沟通、协调能力及自我学习能力');
INSERT INTO `t_jobdata` VALUES ('190', '大数据架构师', '50-80k·13薪', '上海', 'IQVIA 艾昆纬', 'https://www.liepin.com/job/1950207285.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=34&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=34', '上海', '大数据', '50000.00', '80000.00', '65000.00', 'Job Responsibilities\n\n•	Participates/leads teams in the design, development and delivery of technology/service based projects or components of larger, complex projects.\n•	Reviews and analyzes client requirements/problems.\n•	Proposes and delivers cost effective solutions to meet these requirements.\n•	Performs qualitative/quantitative analyses to assist in the identification of client issues and develop client specific solutions.\n•	Designs, structures and delivers client reports and presentations.\n•	Recommends improvements and alternative solutions.\n•	Provides follow-up with internal and/or external client to ensure client satisfaction.\n•	Proactively develops broader and deeper knowledge of technology/services solutions and trends for the pharmaceutical/healthcare/life sciences market.\n•	Begins to develop practice specific subject matter expertise, either in technology & applications consulting or functional areas for the pharmaceutical/healthcare/life sciences industry.\n•	Ability to manage work streams, assigning tasks and driving them to completion. May assist with business development activities.\n\n\nRequirements\n\n•	Bachelor above degree\n•	Experienced with BD activities. Over 5 years of related experience in consulting or services delivery, ideally in pharmaceutical / healthcare/life sciences industry\n•	Experienced with data governance advisory framework (MDM, meta data management, data quality management and etc.).\n•	Solid project management, client influencing and relationship building skills.\n•	Strong technical architecture / design or development experience desired.\n•	Works willingly and effectively with others in and across the organization to accomplish team goals.\n•	Experienced with developing consultative relationships with senior level managers and executives at clients in the pharmaceutical/healthcare/life sciences industry.\n•	Ability to manage multiple projects, juggle priorities and deliver on tight deadlines.\n•	Knowledge of consulting methodologies, tools and techniques related to functional area.\n•	Knowledge of key issues and current developments in the industry.\n•	Excellent presentation, communication and client influencing skills. \n•	Fluent English skill\n');
INSERT INTO `t_jobdata` VALUES ('191', '医疗大数据销售经理', '15-30k', '石家庄', '北京深睿博联科技有限责任公司', 'https://www.liepin.com/job/1943134703.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=35&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=35', '石家庄', '大数据', '15000.00', '30000.00', '22500.00', '职责描述：\r\n1、负责拓展新医院和维护现有医院的项目，对医院端、政府端解决方案销售负责。\r\n2、建立与辖区内医院的合作，维护关键客户和合作渠道，完成相应指标。\r\n3、配合运营体系持续可跟踪服务医院及专家，挖掘客户需求。\r\n岗位要求:\r\n1，大专及以上学历，医疗信息化背景优先，有一定的行业资源；\r\n2，对医疗大数据领域有一定认知和见解，有兴趣和激情一起加入创业团队；\r\n3，有独立的项目管理、策划和执行能力，有一定的研究和科研思维；\r\n4，客户服务第一的工作思维；\r\n5，有独立的思维能力，具备较强的学习和创新能力。');
INSERT INTO `t_jobdata` VALUES ('192', '自动驾驶大数据总监', '100-120k', '北京', '国内某新势力车企', 'https://www.liepin.com/a/39056985.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=36&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=36', '北京', '大数据', '100000.00', '120000.00', '110000.00', '1、负责大数据部门团队组织与管理工作；\n2、负责智能驾驶大数据平台架构的规划与设计、搭建、管理、运维、调优，实现数据驱动和赋能；\n3、负责大数据平台技术框架的供应商选型与技术难点攻关；\n4、 研究跟进智能驾驶数据前沿技术，制定系统相关的技术接口和规范；\n5、负责同技术供应商合作洽谈，制定技术标准，协调内外部接口，验收监管合作方；\n任职要求：\n 1、10年以上数据平台搭建与开发相关经验，全日制统招本科及以上学历，计算机、信息管理、自动化等相关专业优先；\n2、熟悉基本的统计理论，掌握逻辑回归、决策树、SVM、神经网络、深度学习等基本的经典统计和机器学习建模理论与方法； \n3、熟悉Hadoop、Hive、Presto、Spark、Storm，Flink，Hbase，Kafka等大数据技术体系中的一种或多种技术，对某个技术方向有独特见解；\n4、 具备良好的数据敏感度，能从繁杂、海量的数据中挖掘数据价值；强烈的好奇心，热爱数据探索，并勇于创新；\n5、 严密的数据逻辑思考能力，能基于数据分析、归纳总结，分析问题的本质，对问题进行解构； \n6、乐于接受挑战，良好的沟通技巧和团队合作；\n7、 坚定的数据believer，坚信数据可以揭示真相、数据驱动价值；');
INSERT INTO `t_jobdata` VALUES ('193', '软件销售经理/大数据销售经理', '20-40k', '深圳-福田区', '国双科技', 'https://www.liepin.com/job/1934653595.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=37&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=37', '深圳', '大数据', '20000.00', '40000.00', '30000.00', '岗位职责：\r\n1. 负责公司大数据产品与服务的销售；\r\n2. 负责公司客户的开发、拓展与客户经营维护；\r\n3.  负责调用公司资源为客户提供解决方案，以及相应的招投标工作；\r\n4. 负责客户漏斗的管理/客户关系维护过程管理/销售预测实现；\r\n5. 负责客户合同签订和回款等工作；\r\n6. 负责客户的实施交付及售后服务支持的协调和关系维护；\r\n\r\n任职要求：\r\n1. 10年以上销售经验，至少3年以上的软件产品或数据服务销售经验；\r\n2. 具备良好的沟通能力、表达能力与工作热情、具有客户需求挖掘能力；\r\n3. 对国内大数据应用有所了解；熟悉云计算、大数据及人工智能等新兴技术发展趋势；\r\n4. 具有大数据产品及服务销售经验者优先；\r\n5. 具有大型企业或政府客户资源者优先；\r\n6. 本科以上学历。');
INSERT INTO `t_jobdata` VALUES ('194', '高级大数据工程师 (MJ000054)', '20-35k·13薪', '深圳', '跨越速运', 'https://www.liepin.com/job/1951068213.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=4&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=38&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=4&pageSize=40&index=38', '深圳', '大数据', '20000.00', '35000.00', '27500.00', '岗位描述：\n1、深入理解业务，构建系统的大数据绩效成本体系，以及维护、持续优化;\n2、根据业务需求进行数据模型的调研、设计、开发及验证工作，并持续进行模型的优化，基于绩效业务逻辑构建数仓体系;\n3、与业务团队紧密合作，构建全面、精准反映业务状况及风险的指标体系，基于监控指标体系及时发现业务问题;\n4、大数据平台数据运营，推广大数据分析成果，主动推动数据驱动业务;\n5、参与大数据ETL开发和优化，离线数据或实时数据接入的开发;\n6、参与大数据数据质量校验相关工作,以精准的数据驱动业务;\n6、完成公司安排的其它相关的工作任务。\n\n任职要求：\n1. 具有5年以上大数据相关开发经验\n2. 精通hql开发，有性能优化相关经验，有presto、flink、clickhouse、DorisDB使用经验优先\n3. 精通数仓建设的理论并有实施经验，有一定的画图基础\n4. 熟悉Hadooap架构和生态（如：kylin、kafka、Flink、canal、hdfs、hive、hbase、yarn、ElasticSearch等），熟悉相关原理 。\n5. 对Hadoop、spark有一定的深入研究优先考虑（如：spark streaming、spark sql等）\n6. 有丰富的Java开发经验加分\n7.具有团队合作、良好的沟通技巧和主动挑战困难能力,服从管理。\n');
INSERT INTO `t_jobdata` VALUES ('195', '大数据专家（实时计算）', '60-90k·15薪', '深圳', 'vivo', 'https://www.liepin.com/job/1951198077.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=0&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=0', '深圳', '大数据', '60000.00', '90000.00', '75000.00', '岗位职责\n1、负责公司级大数据实时计算平台和多维分析平台建设，打造行业一流的大数据技术平台；\n2、负责公司实时数仓、广告、算法、监控等业务场景的大数据技术解决方案输出，支撑业务良性可持续发展；\n3、负责团队大数据实时计算组件（flink）的研发和性能优化，以及大数据计算组件平台级支持服务；\n4、跟进相关计算组件社区最新动态，在确保平台稳定运行的同时升级新特性。\n\n任职要求\n1、本科及以上学历，8年以上大数据领域工作经验；\n2、熟悉大数据领域技术，包括但不限于flink、druid、hadoop、spark，有实时计算方向的研发经验；\n3、优秀的洞察力，能及时了解行业发展趋势，洞察业务需求，做好技术前瞻性布局；\n4、优秀的项目管理能力，主导或参与过大数据平台建设工作；\n5、优秀的团队协作能力，积极乐观，敢于担当，勇于创新。');
INSERT INTO `t_jobdata` VALUES ('196', '无线/承载/大数据/多媒体/云T核心网网络工程师（新疆）', '8-15k', '乌鲁木齐-水磨沟区', '中兴通讯股份有限公司', 'https://www.liepin.com/job/1951620779.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=1&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=1', '乌鲁木齐', '大数据', '8000.00', '15000.00', '11500.00', '职责描述：\n1、负责无线/承载/大数据/多媒体/云T核心网等产品的技术交付工作，负责开通、维护、巡检、项目组织等提供现场技术支持；\n2、负责产品的版本升级、故障处理、网络优化方案制定审核；\n3、负责产品的技术支持，工程开通、维护、验收和运营支撑等工作；\n4、参与产品方案编写、方案评审和客户培训等工作；\n5、远程登录或远程电话技术指导解决现场问题。\n\n任职要求：\n1、本科及以上学历，通讯、计算机、电子、信息自动化等相关专业；\n2、具有良好的沟通能力和良好的团队合作精神；\n3、做事认真、踏实，学习能力强，具有一定的创造力；\n4、有较好的服务意识，工作细心，较好的压力承受能力和应变能力，能够适应出差；\n5、工作常驻地：新疆乌鲁木齐。');
INSERT INTO `t_jobdata` VALUES ('197', '大数据开发工程师', '12-20k', '成都-高新区', '如果新能源科技(江苏)股份有限公司', 'https://www.liepin.com/job/1951620459.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=2&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=2', '成都', '大数据', '12000.00', '20000.00', '16000.00', '职责要求：\n1.参与数据中台数仓建设与数据治理相关工作；\n2.负责数据存储、数据仓库、数据接口、离线和实时计算应用的设计、开发和维护工作；\n3.负责项目实施过程中的数据源分析、数仓模型设计、ETL开发、性能优化、及数据问题解决；\n4.参与指标开发、报表开发、性能优化、数据质量监控和模型部署相关工作；\n5.协同数据中台相关同事，参与中台项目开发，促成项目落地执行；\n6.上级领导安排的其他任务；\n技能要求：\n1.有三年以上大数据开发经验并参与大数据数仓建设项目；具备至少1年实时流计算开发经验；\n2.精通python/java开发语言，掌握机器学习、深度学习及其计算模型开发与部署；\n3.掌握ETL开发技术，熟练SQL/HQL,有一定的SQL性能优化经验，具备海量数据处理经验；\n4.掌握Hadoop、Hive、Impala、HBase、Spark、Flink、Kafka、ES等技术并在项目中有实际使用经验；\n5.具备数据产品思维，掌握数据分析常用方法，熟练运用Python进行数据分析或建模，主导过数据分析项目优先；\n6.具备独立思考的能力，逻辑严谨，对数据敏感，善于发现.探索并解决问题，自我驱动力强；\n7.了解图数据库，有对Neo4j的使用经验者优先，有机器学习模型开发部署经验优先；');
INSERT INTO `t_jobdata` VALUES ('198', '大数据运维工程师', '8-16k', '安顺-平坝区', '软通动力技术服务', 'https://www.liepin.com/job/1951617393.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=3&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=3', '安顺', '大数据', '8000.00', '16000.00', '12000.00', '职责描述：1.负责华为大数据和人工智能服务交付，能主动识别方案技术风险，有一定抗压能力，能够按时保质完成项目交付\n2.依据服务验收指导，能够自行完成平台验收，并能支撑用户验收，沟通协调能力强，能够推动问题快速解决，保障服务顺利转维\n3.积极总结交付问题推动服务质量提升，效率提升，梳理交付经验，形成可复制件，并能主动分享\n\n\n\n\n任职要求：1.学历要求\n全日制统招本科及以上学历，（可适当放宽至专科）计算机，理工专业优先\n2.工作年限要求\n2-4年及以上\n3.基本素质要求\n有良好的沟通表达能力，团队合作能力，态度积极主动，责任心强。具有问题归纳分析能力，有较好的服务和质量意识，具备一定的抗压性\n4.工作年限要求\n有2-4年及以上运维工作经验，有大型互联网公有云，私有云，运维相关经验者优先\n5.1年以上开发或运维工作经验，熟悉至少一种编程语言Java，Python\n6.熟悉linux，有运维工作经验者优先\n7.熟悉数据库，了解docker，K8s，有网络经验者优先\n8.熟悉云服务，有云服务使用经验者优先\n9.风险意识强，对现网有敬畏心\n10.积极乐观，能够迎难而上克服困难达成目标');
INSERT INTO `t_jobdata` VALUES ('199', '大数据运维总监', '25-40k', '武汉-江岸区', '中国电建集团江西省电力建设有限公司', 'https://www.liepin.com/job/1951615125.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=4&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=4', '武汉', '大数据', '25000.00', '40000.00', '32500.00', '工作职责： \n1、 深入理解公司能源数据业务，负责跨团队的重点难点技术攻关工作，引入创新的技术和解决方案，将技术实现与业务场景联系起来，用创新的思路快速解决业务需求问题；\n2、负责数据平台的技术架构规划，主导重点项目的架构设计和核心模块设计研发工作，负责研发技术发展方向，探索技术新领域。\n3、指导大数据、人工智能、移动、区块链、边云协同等共性技术的融合与服务化研究，指导应用统一开发支持与一体化管理研究，指导基于云的统一技术管理和服务研究。\n4、作为主要负责人，参与运维平台建设，设计并落实整体解决方案\n5、作为主要负责人，带领团队为项目提供技术支撑和共享服务。\n\n\n任职资格： \n1．博士，计算机及电气相关专业，能力突出者可适当放宽至硕士； \n2．具备优秀的技术领导力，推动技术能力的沉淀和技术氛围的建设，。\n3．在企业级平台的架构设计与建设，以及实现数据系统的横向拉通和技术能力的复用方面有比较丰富的实践经验。 \n作为核心人员参与过企业级数字化转型工作的整体设计，以及业务转型、流程重塑、技术平台及应用的研发等具体工作。');
INSERT INTO `t_jobdata` VALUES ('200', '大数据运维工程师', '9-10k', '东莞-松山湖', '深圳市天地网通信息技术有限公司广州分公司', 'https://www.liepin.com/job/1951601551.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=5&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=5', '东莞', '大数据', '9000.00', '10000.00', '9500.00', '职责描述：\n1.熟悉Hadoop生态环境，有以下一种或多种大数据技术使用经验者，如flume、Kafka、Hdfs、Hive、MR、elasticsearch、Hbase、spark等；\n2.熟悉Linux操作系统，熟悉Linux shell编程；\n3.熟悉mysql、oracle、SQL server、GP、hana等一种或多种关系型数据库或mpp数据库，熟悉存储过程、函数开发；\n4.具有良好的沟通能力及工作汇报能力，具有清晰的思维逻辑，具有严谨的工作态度；                                                                                                                5.本科，1年以上工作经验。\n\n\n\n任职要求：');
INSERT INTO `t_jobdata` VALUES ('201', '大数据平台工程师', '20-45k·15薪', '保定', '如果科技', 'https://www.liepin.com/job/1951595783.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=6&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=6', '保定', '大数据', '20000.00', '45000.00', '32500.00', '职责描述：\n1、参与项目的需求分析、概要设计、详细设计，技术文档的编写；\n2、负责开发框架的搭建、改进；\n指导软件工程师的日常开发工作，解决开发中的技术问题；\n3、协助完成项目的测试、系统交付工作，对项目实施提供支持。\n4、负责跟进服务器安全、稳定、维护和性能优化等工作。\n\n任职要求：\n1、至少4年以上Java开发经验\n2、精通java,对spring、Spring MVC、MyBatis、Hibernate了解其原理和实现机制，具有WebService和dubbo等相关框架开发经验优先；\n3、精通SQL，熟练使用MySQL、Oracle等数据库，并具有一定的SQL优化能力；熟悉Memcached、Redis、MongoDB等常用NoSQL解决方案、了解各自的优缺点以及使用场景者优先；\n4、熟悉Tomcat等应用服务器的部署和配置；\n5、熟悉Linux操作系统常用命令；\n6、有系统重构经验的优先，有分布式系统开发设计经验者优先。\n7、有大数据平台开发项目经验。\n');
INSERT INTO `t_jobdata` VALUES ('202', '大数据平台工程师', '20-45k·15薪', '北京-海淀区', '如果科技', 'https://www.liepin.com/job/1951595781.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=7&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=7', '北京', '大数据', '20000.00', '45000.00', '32500.00', '职责描述：\n1、参与项目的需求分析、概要设计、详细设计，技术文档的编写；\n2、负责开发框架的搭建、改进；\n指导软件工程师的日常开发工作，解决开发中的技术问题；\n3、协助完成项目的测试、系统交付工作，对项目实施提供支持。\n4、负责跟进服务器安全、稳定、维护和性能优化等工作。\n\n任职要求：\n1、至少4年以上Java开发经验\n2、精通java,对spring、Spring MVC、MyBatis、Hibernate了解其原理和实现机制，具有WebService和dubbo等相关框架开发经验优先；\n3、精通SQL，熟练使用MySQL、Oracle等数据库，并具有一定的SQL优化能力；熟悉Memcached、Redis、MongoDB等常用NoSQL解决方案、了解各自的优缺点以及使用场景者优先；\n4、熟悉Tomcat等应用服务器的部署和配置；\n5、熟悉Linux操作系统常用命令；\n6、有系统重构经验的优先，有分布式系统开发设计经验者优先。\n7、有大数据平台开发项目经验。\n');
INSERT INTO `t_jobdata` VALUES ('203', '大数据产品经理', '20-30k', '北京', '如果科技', 'https://www.liepin.com/job/1950666077.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=8&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=8', '北京', '大数据', '20000.00', '30000.00', '25000.00', '职责描述：\n负责 数据仓库、数据产品、数据工具的功能定义设计和运营 等\n\n1、对接各业务部门报表需求和数据提取需求\n\n2、梳理业务指标、分析维度、数据分析功能、报表展示功能\n\n3、全面负责企业内部运营分析所需要的报表平台设计和企业大屏设计\n\n4、根据个部门业务工作内容、工作中心的调整，通过报表功能有效辅助各部门的经营管理和优化提升\n\n任职要求：\n1、有2年或以上大数据领域产品经理经验\n\n2、有汽车行业从业经验者优先\n\n3、有2年以上数据分析经验；\n\n4、熟悉办公软件，有丰富的方案制定能力与书面表达能力\n\n5、能够独立思考，做事积极主动\n\n6、沟通能力良好，有一定的跨部门沟通协调经验者优先');
INSERT INTO `t_jobdata` VALUES ('204', '大数据开发工程师（银行）', '20-30k·16薪', '宁波', '某知名银行上市公司', 'https://www.liepin.com/a/39303971.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=10&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=10', '宁波', '大数据', '20000.00', '30000.00', '25000.00', '岗位职责：\n1、负责银行大数据分析营销或者风险分析或者数据集市支撑。\n2、负责银行系统搭建、性能指标优化工作。\n3、负责客户经营类客户集市数据应用开发；借助全方位、各个系统触点获取千万级用户数据，打造AI智能化数据应用，助力一线营销人员获客、服务、筛选重要目标客户；\n4、负责银行国际结算业务和金融市场业务数据集市、数据应用系统的研发。\n负责实时数据、数据api和模型数据开发；\n任职资格：\n1、30周岁以下，全日制重点大学本科以及以上学历，计算机、软件工程、通信工程、物理、数学等相关专业；\n2、2年以上软件研发经验；\n3、具备良好的沟通表达能力和团队合作精神，具有较强的工作责任心、主动性及抗压能力；\n4、具体岗位技能要求\n（1）2年及以上数据分析经验，熟练掌握SQL语言，掌握数据分析的一般流程、常用方法，有数据分析项目实践经验；至少熟悉主流数据库技术Oracle/DB2/PostreSql/MySQL中的一种\n（2）熟练掌握数据研发相关算法，熟练构建和优化数据挖掘模型；\n（3）熟悉大数据相关组件，熟悉Hbase/Hive/MR/Spark/storm/flink其中的任意三个组件技术；\n（4）具备扎实的数据仓库理论知识，包括但不限于数据调度、ETL、元数据管理、数据监控、数据建模；\n（5）精通Linux操作系统、熟练使用sas、R或python、shell脚本能力\n（6）了解营销、运营、风险分析的模型设计与开发，有场景化获客建模经验者优先。');
INSERT INTO `t_jobdata` VALUES ('205', '中高级大数据测试工程师', '19-23k·13薪', '杭州-滨江区', '某北京大型IT服务公司', 'https://www.liepin.com/a/39291535.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=11&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=11', '杭州', '大数据', '19000.00', '23000.00', '21000.00', '1、供应商将提供拥有相应技能及能力的资源以在下述任务中协助甲方：（统称“服务”）\n2、执行数据仓库及BI报表等测试工作，包括文档评审，测试案例编写，测试执行，缺陷提交等具体任务\nService Scope 1、熟悉数据清洗过程（ETL），数据模型的基本概念，熟悉数据仓库，数据集市，BI报表等数据产品的基本工作原理及测试方法\n2、熟悉ETL工具(比如Informatic，Kettle等)，熟悉数据集市，报表工具（比如Tableau, PowerBI等）\n3、熟练操作至少一种主流数据库，熟练SQL脚本和存储过程编写。\n4、熟练操作Windows及Linux操作系统，熟悉Linux基本命令\n5、熟悉标准研发流程及测试流程\n6、了解Jmeter工具，会使用该工具进行接口测试或性能测试\n7、熟悉一种主流编程语言（Java或Python等），有基于该语言编写自动化测试脚本的经验\n8、了解Hadoop, Spark, Hbase等大数据相关组件的工作原理及测试方法，了解Apache Kylin者优先\nService Requirement 1、有金融，保险等复杂业务逻辑测试经验\n2、有大型系统的测试经验\n3、有较强的问题分析与解决能力，条理逻辑清晰。学习新知识的能力强\n4、有良好的沟通能力，可以很好的与业务分析团队，开发团队进行交流合作');
INSERT INTO `t_jobdata` VALUES ('206', '医疗大数据销售VP', '35-65k', '北京', '某北京大型互联网公司', 'https://www.liepin.com/a/39288303.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=12&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=12', '北京', '大数据', '35000.00', '65000.00', '50000.00', '销售VP\n1、10年以上独立打单的能力且个人累计业绩不低于8000万。\n\n2、5年以上不低于50人的销售团队管理经验且团队业绩4亿以上。\n\n3、深耕政府客户，医疗和大数据行业优先。\n\n4、具备敏锐的行业洞察力和创新力，具有极强的学习力团队协同力\n\n5、本科以及以上学历，熟悉政府医疗业务。');
INSERT INTO `t_jobdata` VALUES ('207', '大数据工程师（研发）', '22-35k·15薪', '成都', '某大型上市公司', 'https://www.liepin.com/a/39262155.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=13&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=13', '成都', '大数据', '22000.00', '35000.00', '28500.00', '岗位职责：\n1.根据公司业务需求，构建公司的大数据平台；\n2.负责ETL的开发工作，负责业务数据的采集，清洗及转换；\n3.根据业务需要，提供面向业务的报表、数据提取等数据服务；\n4.根据业务目标，对现有数据挖掘，进行分析预测。\n职位要求：\n本科及以上学历，计算机及相关专业；\n熟悉ETL理论及开发流程；\n\n');
INSERT INTO `t_jobdata` VALUES ('208', '大数据研发专家', '50-80k', '杭州', '某大型互联网电商平台', 'https://www.liepin.com/a/39220121.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=14&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=14', '杭州', '大数据', '50000.00', '80000.00', '65000.00', '职位描述：\n1）岗位基本要求：\n 本科及以上学历，具备实时数据/实时数仓开发相关工作经验，4年以上的互联网数仓建设经验；\n 了解数仓理论知识，熟练storm、flink、hive、druid、es等数仓工具的使用和调优；\n 掌握JAVA、Python等，了解Spring、Strusts、MVC等一种以上开源框架，具有实践经验；\n 具备数据库及SQL能力，熟悉MYSQL等开源数据库，并对Hadoop技术体系有所了解和研究，愿意尝试新技术领域；\n 有较强的逻辑分析能力，对数据敏感，对大数据生态技术有强烈热情；\n 重视系统设计和开发规范；重视系统运维，能运用工具和流程做好数据质量验证、数据治理和线上运维；\n 具备项目管理知识，具备良好的沟通协调能力、较强团队合作精神，工作责任心强，愿意接受挑战；\n 有数据挖掘、机器学习基础技术优先；');
INSERT INTO `t_jobdata` VALUES ('209', '高级大数据PaaS开发工程师', '20-40k', '北京-西城区', '中国某某集团', 'https://www.liepin.com/a/33347115.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=15&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=15', '北京', '大数据', '20000.00', '40000.00', '30000.00', '岗位职责：\n1、负责集团级实时/离线/调度等数据计算平台建设；\n2、负责集团级公共基础数据流、公共平台的研发；\n3、参与海量数据处理和高性能分布式计算的架构设计，负责数据处理流程的设计和代码开发，撰写相关文档；\n4、设计及研发PaaS平台的关键组件；\n5、负责研发资源调度框架、数据库、缓存、存储、检索等相关中间件的二次开发优化工作；\n6、参与集群运维工作，支持Hadoop集群底座的运维故障分析、解决、性能优化；\n岗位要求：\n1.本科及以上学历，通信/计算机等相关专业。\n2、熟悉大数据相关组件二次开发、搭建、应用、优化，如：Hadoop/Spark/Yarn/Hive/Kafka/Hbase/Kerberos/Flink/Mysql等。\n3、扎实的计算机基础，掌握常用的数据结构及算法，熟练掌握Java/Golang/Scala/Python中的一项或多项；\n4、愿意承担部分运维职责，熟悉Apache Hadoop部署、性能调优。\n5、能阅读/理解Hadoop等相关开源组件源码。\n6、较强的人际关系能力，有团队精神、较强的执行与推动能力，有一定抗压力。');
INSERT INTO `t_jobdata` VALUES ('210', '大数据分析工程师', '10-20k·13薪', '南京-秦淮区', '南京视察者智能科技有限公司', 'https://www.liepin.com/job/1949119715.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=16&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=16', '南京', '大数据', '10000.00', '20000.00', '15000.00', '1、运用统计学习方法，深入分析和挖掘数据价值，独立完成数据的分析、挖掘、报告撰写等工作，构建完整高效的分析挖掘体系；           \n2、基于现实遇到的各种问题，负责数据分析、统计学习等技术解决方案的研究及实现；   \n3、关注行业及市场最新发展需要，对已有模型的适应性及性能进行持续优化和提升；  \n4、根据公司技术文档规范，提供软件产品实现模型功能的相应的技术文档；\n5、上级安排的其它任务。\n任职资格：\n1、数学、统计学、或计算机（数据挖掘、机器学习）相关专业，统招本科及以上学历； \n2、熟练掌握统计学习相关算法，如回归、时间序列等；       \n3、熟练掌握数据挖掘相关知识算法，如相关性分析、关联分析等；    \n4、熟练掌握至少一门编程语言(c++、python、java等), 具备良好的算法落地能力；   \n5、熟练掌握数据库基本查询语言         \n6、具有机器学习、深度学习等相关业务背景者优先；       \n7、良好的沟通表达和理解能力；');
INSERT INTO `t_jobdata` VALUES ('211', '大数据测试工程师', '10-16k', '广州-黄埔区', '杰创智能科技股份有限公司', 'https://www.liepin.com/job/1951535405.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=17&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=17', '广州', '大数据', '10000.00', '16000.00', '13000.00', '岗位职责：\n1、负责大数据平台相关产品测试工作；\n2、负责需求分析，设计测试方案及测试用例；\n3、负责接口压力测试及脚本开发、维护；\n4、制定测试计划，执行测试用例并输出测试报告；\n5、发现影响项目迭代效率的瓶颈和痛点，提出合理化建议，促进测试流程与规范的把控和推进。\n\n任职要求：\n1、本科及以上学历，3年以上软件测试经验，有大数据项目测试经验优先；\n2、熟悉测试流程并掌握测试技能，对功能测试、性能测试、可靠性测试等有深入的见解；\n3、熟练分布式系统原理，有大数据测试相关经验，熟悉数据库测试；\n4、具备良好的抗压能力及团队合作精神，有敏捷测试经验者优先。');
INSERT INTO `t_jobdata` VALUES ('212', '大数据开发（高级）工程师', '25-40k', '南京', '中汽创智', 'https://www.liepin.com/job/1946523777.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=18&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=18', '南京', '大数据', '25000.00', '40000.00', '32500.00', '职位职责描述：\r\n  负责自动驾驶数据相关业务开发工作。\r\n主要工作内容：\r\n1.	数据仓库搭建和管理\r\n2.	大数据计算应用的开发\r\n3.	构建高效数据处理流水线（pipeline）\r\n4.	解决产品开发过程中的疑难问题、性能问题\r\n5.	积极参与公司大数据平台，仓湖一体的长期建设\r\n6.	配合数字化相关部门完成数据管理、数据安全的体系建设\r\n任职条件：\r\n1.	计算机或者相关专业，本科及以上学历，5年以上数据开发经验\r\n2.	精通SQL或者类SQL语言\r\n3.	熟悉掌握一项数据处理流水线框架（e.g. AirFlow, Beam, Azkaban, Oozie...)\r\n4.	熟悉掌握Hadoop, Hive, Spark, Flink等分布式计算框架\r\n5.	具备一定的数据分析能力，有较好的数据敏感度\r\n6.	具有良好的表达能力，善于与人沟通合作，有良好的团队合作精神及高度责任心\r\n7.	对自己的代码和设计有要求\r\n具体薪资面议');
INSERT INTO `t_jobdata` VALUES ('213', '大数据产品经理', '25-40k·13薪', '北京-朝阳区', '探针资本', 'https://www.liepin.com/job/1946724857.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=19&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=19', '北京', '大数据', '25000.00', '40000.00', '32500.00', '探针资本成立于2017年，是一家专注医疗健康与生命科技的精品投行。创始团队来自业内一线私募股权投资机构、财务顾问机构、管理咨询公司和医疗垂直媒体。自成立以来，探针资本每年均完成两位数的私募融资与并购交易，累计交易金额近百亿元人民币。在企业增值服务方面，探针资本团队也拥有成熟的产业经验。2020年探针新医疗基金成立，目前已投资多家业内头部公司。\n职责描述：\n寻求一位产品经理，负责投研大数据产品的产品工作。\n1.与行业分析师、投资人团队协同设计投研大数据产品\n2.调研分析客户需求，调研分析行业竞品\n3.负责从0到1的MVP以及后续产品迭代路线及策略\n4.完成产品策划、产品设计、产品开发、产品运营策略、数据监控、产品迭代等产品循环工作\n5.根据项目发展需求，按需组建产品设计、运营团队\n\n岗位职责：\n\n工作地点：杭州\n\n\n\n任职要求：\n1.具有一定的金融、投资知识背景，对投资行业感兴趣\n2.对金融投研大数据产品、企业数据库产品有一定认识\n3.有企业数据库产品或大数据类产品从0到1的建设经验\n4.对机器学习、NLP有一定了解或具有相关产品经验\n5.具有SaaS产品经验或相关知识，具有to B软件项目经验\n6.具备软件项目管理、团队协同、团队管理经验\n7.喜欢有挑战性的工作、探索新事物\n8.5年以上产品工作经验');
INSERT INTO `t_jobdata` VALUES ('214', '大数据产品经理', '35-40k', '北京', '知名国企', 'https://www.liepin.com/a/37743151.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=20&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=20', '北京', '大数据', '35000.00', '40000.00', '37500.00', '岗位职责：\n1.负责业务需求分析，负责需求调研、收集需求、分析整理；\n2.确认需求场景、口径等，输出需求分析书；\n3.跟踪需求开发的全过程，对需求最终交付负责；\n4.参与数据产品的调研、设计工作。\n任职资格：\n1.教育经验：大学本科及以上学历，计算机、信息通信、软件工程等相关专业优先；\n2.工作经验：3年以上大数据或者数据仓库相关经验，其中1年以上需求分析岗位经验；\n3.能力要求：优秀的沟通、互动能力，能够挖掘出业务流程中的潜在需求关键点；\n4.知识技能：熟练掌握SQL语言，了解数据仓库常见结构，具备一定技术背景。');
INSERT INTO `t_jobdata` VALUES ('215', '大数据开发工程师', '25-40k', '上海', '某知名互联网公司', 'https://www.liepin.com/a/38389579.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=21&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=21', '上海', '大数据', '25000.00', '40000.00', '32500.00', '岗位职责：\n1. 根据业务发展规划，进行大数据应用相关技术整体研发工作；\n2. 负责大数据相关应用研发方案设计、数据架构设计及落地实施；\n3. 负责具体的数据建模、模型验证；相关数据挖掘算法、统计分析方法、数据处理应用开发工作；\n4. 负责大数据应用以及相关产品（如CDP、DSP等）的持续优化迭代工作；\n任职要求：\n1. 需要2年以上大中型项目研发工作经验，熟悉大数据行业应用及相关发展趋势；\n2. 精通Hadoop，能熟练应用大数据生态技术，如Spark、Flume、Kafka、Hive、Hbase、Clickhouse等，有用户画像开发，商品标签等开发经验优先，有通信行业数据处理经验者优先\n3. 熟悉linux操作，能够熟练应用脚本；熟练掌握一种以上数据库系统操作；');
INSERT INTO `t_jobdata` VALUES ('216', '大数据开发工程师', '20-30k·15薪', '深圳-福田区', '某上海基金/证券/投资公司', 'https://www.liepin.com/a/39056251.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=22&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=22', '深圳', '大数据', '20000.00', '30000.00', '25000.00', '职责描述：\n1、 负责数据中台的建设相关工作，包括：架构规划、需求分析、开发管理、生产运维、技术探索等工作\n2、 负责数据建模、数据服务、数据工具平台建设等相关工作\n3、 负责数据应用、AI探索等相关工作 \n任职要求：\n1、 计算机、软件工程专业本科及以上学历\n2、 4年以上开发经验，3年以上数据开发经验\n3、 熟悉oracle、sqlserver、Redis、mongodb等主流数据库，并能对性能进行优化\n4、 熟悉GP或hadoop等大数据生态相关技术，能够运用Flink、Spark等进行数据处理分析。\n5、 熟悉jave/python中至少一种语言。\n6、 有高度的责任感、很强的学习和沟通能力，具有良好的团队合作精神。\n7、 有大型数据仓库项目经验、实时数据计算、数据可视化、数据治理经验优先。\n8、 对Docker、K8S等容器化技术有了解的优先；\n9、 有证券、基金相关行业经验优先。');
INSERT INTO `t_jobdata` VALUES ('217', '大数据开发工程师', '20-24k·15薪', '上海-黄浦区', '某国企全资IT子公司', 'https://www.liepin.com/a/38930579.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=23&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=23', '上海', '大数据', '20000.00', '24000.00', '22000.00', '岗位职责;\n负责海量数据处理分布式平台以及大数据分析系统的研发；\n任职要求：\n本科学历，计算机相关专业；3年以上Hadoop和JAVA相关研发经验，熟悉Hadoop、HBase、Hive、Spark、Oozie等组件与编程；熟练运用MapReduce程序处理数据，对Hadoop、Hive源码有研究更佳；熟悉某种关系型数据库（Oracle、Mysql等）；在海量数据处理、数据建模、业务理解方面有丰富经验；良好的学习能力、沟通能力，能够带领和培养技术团队。');
INSERT INTO `t_jobdata` VALUES ('218', '医疗大数据销售经理', '15-20k', '南昌', '北京深睿博联科技有限责任公司', 'https://www.liepin.com/job/1945727727.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=24&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=24', '南昌', '大数据', '15000.00', '20000.00', '17500.00', '职责描述：\r\n1、负责拓展新医院和维护现有医院的项目，对医院端、政府端解决方案销售负责。\r\n2、建立与辖区内医院的合作，维护关键客户和合作渠道，完成相应指标。\r\n3、配合运营体系持续可跟踪服务医院及专家，挖掘客户需求。\r\n\r\n岗位要求:\r\n1，大专及以上学历，医疗信息化背景优先，有一定的行业资源；\r\n2，对医疗大数据领域有一定认知和见解，有兴趣和激情一起加入创业团队；\r\n3，有独立的项目管理、策划和执行能力，有一定的研究和科研思维；\r\n4，客户服务第一的工作思维；\r\n5，有独立的思维能力，具备较强的学习和创新能力。');
INSERT INTO `t_jobdata` VALUES ('219', '大数据开发工程师(J10287)', '15-30k·15薪', '上海', '上海中芯国际', 'https://www.liepin.com/job/1947609379.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=25&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=25', '上海', '大数据', '15000.00', '30000.00', '22500.00', '工作职责:\r\n大数据开发工程师\r\n1. 负责 大数据平台 数据采集、离线数据加工、数据实时接入和实时处理及计算。\r\n2. 大数据平台管理与运维。\r\n3. Web页面可视化开发\r\n4. 与项目用户沟通需求，及系统设计。\r\n\r\n任职资格:\r\n1. 计算机或应用数学相关专业本科及以上学历；\r\n2. 精通Java, Python语言，7年以上项目开发经验；\r\n3. 3年以上Hadoop平台架构和开发经验，精通CDH，Hive，Hbase, ELK, Kafka, Spark, K8S，Docker，Phoenix等；\r\n4. 熟悉AI算法，对机器学习和深度学习有一定的了解；\r\n5. 具备良好的沟通能力和团队协作能力。\r\n6. 学习能力强，具备清晰逻辑思维能力。能快速学习了解先进技术并应用在公司实际项目中。\r\n');
INSERT INTO `t_jobdata` VALUES ('220', '大数据开发工程师(J10434)', '20-30k', '北京-东城区', 'TalkingData', 'https://www.liepin.com/job/1933060663.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=26&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=26', '北京', '大数据', '20000.00', '30000.00', '25000.00', '工作职责:\r\n1.、负责TB级别大数据的清洗、储存，处理，分析等场景的开发；\r\n2、完成数据仓库的建设开发，完成业务数据ETL流程处理，并确保数据质量\r\n3、支撑用户数据分析、用户画像、推荐系统等系统的研发；\r\n4、负责数据平台能力建设，大数据相关组件调研和使用\r\n\r\n任职资格:\r\n1、计算机或相关专业本科以上学历，3年以上工作经验，有机器学习数据建模能力优先；\r\n2、精通SQL和Spark处理方法，具有一线coding的能力，至少1年的Spark(Core/Streaming/SQL)开发经验\r\n3、具有较强的内外沟通能力，良好的团队意识和协作精神；\r\n4、熟悉OLAP和OLTP技术，有大规模数据平台或数据仓库设计经验；');
INSERT INTO `t_jobdata` VALUES ('221', '大数据开发工程师', '12-17k·13薪', '重庆-渝北区', '重庆宝威科技有限公司', 'https://www.liepin.com/job/1951303055.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=27&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=27', '重庆', '大数据', '12000.00', '17000.00', '14500.00', '职责描述：\n1、负责spark/flink实时/离线任务的开发，维护，优化。\n2、大数据平台运维自动化工具的相关开发。\n3、基于大数据场景下的业务项目开发等。\n4、HIVE数仓的数据ETL开发。\n任职要求：\n1、大专或以上学历，计算机相关专业\n2、大数据相关开发或者JAVA项目开发经验。\n3、熟练掌握Java语言。\n4、熟悉大数据相关产品组件(HADOOP/SPARK/FLINK/KAFKA/FLUME/HBASE)，并有实际部署、应用经验者优先。\n5、具备 spark streaming、spark离线编码开发( 不是hive on spark 或 spark on hive)，FLINK实时计算编码开发经验。\n6、熟悉kafka，HBASE、HDFS等JAVA API使用。\n7、热爱大数据和技术，学习能力强，有面向业务的思维，有独立分析和解决问题的能力。\n8、阅读过相关组件源码、熟悉SCALA优先。');
INSERT INTO `t_jobdata` VALUES ('222', '大数据开发工程师', '30-40k', '北京-海淀区', '北京中关村银行股份有限公司', 'https://www.liepin.com/job/1950914279.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=28&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=28', '北京', '大数据', '30000.00', '40000.00', '35000.00', '职责描述：\n1、参与大数据系统银行业务需求分析和技术方案预研；\n2、负责大数据平台、数据仓库、数据集市、数据中台及产品的设计研发工作；\n3、负责大数据生产、测试环境及功能问题的快速定位和解决；\n4、参与数据治理相关工作，确保数据质量；\n5、负责大数据相关代码编写、测试，确保代码执行性能、质量和安全。\n\n任职要求：\n1、全日制本科及以上学历，计算机相关专业，36周岁以下，具备4年以上大数据相关产品研发经验；\n2、熟练掌握大数据相关技术，具备hadoop/HBase/Hive/Spark/Flink/ElasticSearch/Mpp等主流框架使用经验；\n3、熟悉Oracle、Mysql等主流数据库，熟练掌握java、python、sql、shell中的2种以上的语言；\n4、熟悉软件工程，具备良好的代码编写规范和书写文档习惯，具有较强的沟通、协作能力；\n5、具备优秀的问题分析解决能力，严谨、踏实的工作态度，强烈的责任心和进取心态，具备较好的抗压能力；\n6、具备银行类大数据产品、平台开发经验者优先考虑。\n\n\n');
INSERT INTO `t_jobdata` VALUES ('223', '高级业务经理 - 融资租赁 - 大数据行业', '25-40k', '北京-海淀区', '中关村科技租赁', 'https://www.liepin.com/job/1935515605.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=29&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=29', '北京', '大数据', '25000.00', '40000.00', '32500.00', '职责描述：\r\n1、负责项目的开拓、开发、挖掘和筛选；\r\n2、开展行业调研分析，评估企业商业模式和发展潜力；\r\n3、开展项目尽职调查，评估项目风险及投资价值；\r\n4、负责项目尽调报告撰写和评审过会；\r\n5、负责项目投后管理和客户维护。\r\n\r\n任职要求：\r\n1、金融、财务、理工科等相关专业统招本科以上学历，211、985优先；\r\n2、投资、证券、担保、银行对公、租赁等相关领域3年以上工作经验；\r\n3、拥有5G通讯产业链、云计算、智慧城市等相关领域企业、专家资源，能够独立搜寻、对接优质项目；\r\n4、具备扎实的财务、法律、运营分析和判断能力、能够独立完成尽职调查；\r\n5、具备优秀的沟通、协同能力，良好的职业素养和较强的团队精神；\r\n6、主要工作地点为北京，可接受出差。');
INSERT INTO `t_jobdata` VALUES ('224', '大数据开发工程师', '20-35k·14薪', '深圳-南山区', '滔搏', 'https://www.liepin.com/job/1937912575.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=30&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=30', '深圳', '大数据', '20000.00', '35000.00', '27500.00', '岗位职责: \r\n    1.负责公司大数据平台、报表应用平台的架构设计、实施、开发、环境搭建、调优及故障诊断。\r\n    2.负责构建数据应用体系，包括但不限于ETL处理、模型工程化、画像标签应用、知识图谱、数据服务化输出等。\r\n    3.根据部门实际业务需求，规划设计数据应用产品和解决方案。\r\n\r\n    岗位要求：\r\n    1.本科以上学历，计算机与信息科学，软件工程，数学、统计学相关专业优先；\r\n    2.熟悉掌握企业级数据仓库体系架构，数据仓库模型、分层体系构建、元数据管理、数据质量监控等，具备扎实数据仓库建模理论知识；\r\n    3.精通SQL语言，如HiveSQL、SparkSQL等，且具体有丰富的性能调优经验。\r\n    4.熟练使用hadoop、spark、flink、hive、Impala、hbase等大数据基础组件及工具\r\n    5.扎实的java/scala基本功，能够熟练理解JVM原理，熟悉Linux操作系统，可以进行基本的命令行编写；\r\n    6.较强的数据敏感度，能结合业务场景需求完成数据分析和开发，具有数据仓库建设、用户标签建设、用户画像挖掘等相关工作经验优先');
INSERT INTO `t_jobdata` VALUES ('225', 'AI大数据项目交付经理', '25-55k·16薪', '上海-浦东新区', '联和利泰', 'https://www.liepin.com/job/1950953635.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=31&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=31', '上海', '大数据', '25000.00', '55000.00', '40000.00', '职责描述：\n1. 管理数据标注项目交付团队，监控数据项目执行情况与潜在风险，提升团队工作效率，促进各项业务指标的高效完成；\n2. 深度挖掘并跟进潜在的数据标注业务需求，负责需求的前期沟通、分析，可独立编写技术方案并对客户进行服务介绍与方案宣讲；\n3. 与各协作职能团队保持良好的沟通，积极推动标注工具、组织流程与交付流程优化，完善并提升团队交付能力；\n4. 维护与行业大客户长期、良好的合作关系，定期对行业发展、客户需求、项目执行效果等方面进行分析和整理，为业务发展提供可行性建议。\n\n\n\n任职要求：\n1. 统招985/211本科及以上学历；\n2.3年以上大客户项目管理工作经验，1年以上团队管理经验；\n3.有一定的英语听说读写能力，有数据标注或BPO行业工作经验者优先；\n4. 以结果为导向，具备较强的逻辑思维与统筹管理能力，优秀的沟通技巧与推动能力。');
INSERT INTO `t_jobdata` VALUES ('226', '高级大数据开发工程师（武汉）', '20-40k', '武汉-洪山区', '鸿之微科技(上海)股份有限公司', 'https://www.liepin.com/job/1950551983.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=32&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=32', '武汉', '大数据', '20000.00', '40000.00', '30000.00', '岗位职责：\n1. 参与大数据架构的规划设计；\n2. 负责大数据业务的开发工作；\n3. 负责解决业务中的技术难点和性能调优工作；\n4. 参与数据仓库设计，根据业务需求实现高效灵活的查询、数据分析、数据挖掘；\n5. 负责研发技术发展方向，新技术领域的探索，引入并验证大数据平台领域新技术；\n6. 对大数据技术及开业框架敏感，具有钻研精神，能自我学习。\n任职要求：\n1. 统招本科及以上学历，计算机相关专业，5年及以上JAVA开发经验，3年以上的大数据开发经验；\n2. 熟悉Hadoop生态架构和组件，理解各常用组件（Hadoop、Zookeeper、Kafka、Hbase、Flink）的底层原理；\n3. 熟悉CDH、HDP、TDH至少一款大数据产品，有从0到1建设大数据平台经验者优先；\n4. 熟悉Hbase、OpenTSDB、Hive等大数据组件的搭建、维护使用以及性能优化；\n5. 熟悉Flink工作原理和流程，对流式计算有深入的理解；\n6. 较强的开发能力，良好的开发习惯，必须熟悉JAVA、Scala等语言；\n7. 扎实的独立分析问题、解决问题的能力，具备良好的需求理解能力、沟通能力和团队合作精神；有很强的数据设计抽象能力，善于从复杂的数据问题中找到关键路径，并擅长跟业务团队就业务问题进行良好的沟通，能推送业务的指标化、量化；\n8. 热爱工作，有自驱力，有较高抗压能力，有较好的工作稳定性；\n9. 熟悉智能制造或有相关经验者优先。');
INSERT INTO `t_jobdata` VALUES ('227', '大数据开发工程师', '20-35k·13薪', '上海', '上海西井信息科技有限公司', 'https://www.liepin.com/job/1942530123.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=33&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=33', '上海', '大数据', '20000.00', '35000.00', '27500.00', '岗位职责： \n1.负责各个业务线数据仓库建设； \n2.定义并开发业务核心指标数据； \n3.根据具体问题，设计并实现合适的可视化展示，构建数据持续观测平台； \n4.参与数据平台的搭建，优化数据处理流程具体工作； \n5.参与数据收集，数据质量监控，任务调度，数据存储&查询优化，等全流程工作； \n6.参与公司内数据流通规则等数据生态相关工作。 \n\n任职资格： \n1.计算机相关专业，本科3年以上工作经验； \n2.掌握hive，kafka，spark，hbase，flink等任意两种技术，有脚本开发和SQL优化相关经验； \n3.熟悉掌握数据仓库建设方法和ETL相关技术，对于数仓的设计有自己独特的思考，具备优秀的数学思维和建模思维； \n4.很强的学习、发现、定位、分析和解决问题能力，良好的团队意识和协作精神，有较强的内外沟通能力。');
INSERT INTO `t_jobdata` VALUES ('228', '大数据开发工程师', '12-16k·14薪', '无锡', '无锡先进技术研究院', 'https://www.liepin.com/job/1940220557.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=34&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=34', '无锡', '大数据', '12000.00', '16000.00', '14000.00', '1、 负责将大数据及云平台相关软件移植到申威平台；\n2、负责大数据及云平台相关软件功能及性能优化。\n任职要求：\n1、全日制985/211/一本院校本科及以上学历，计算机、软件工程相关专业毕业；\n2、熟练掌握c、c++、java、pthon、go编程语言中的至少一种；\n3、有大数据相关软件研发经验者优先；\n4、熟悉x86、arm或mips中的一种汇编语言。');
INSERT INTO `t_jobdata` VALUES ('229', '大数据平台开发专家/高级工程师 (MJ012779)', '40-60k·15薪', '深圳-南山区', '小鹏汽车', 'https://www.liepin.com/job/1947457473.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=35&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=35', '深圳', '大数据', '40000.00', '60000.00', '50000.00', '岗位职责：负责自动驾驶大数据平台的方案设计，构建大数据闭环，满足算法开发验证和仿真测试；\r\n开发数据采集、分析、可视化、标注平台等工具链，加速算法和功能开发；\r\n负责解决攻克数据系统平台的技术难题；\r\n\r\n岗位要求：1. 计算机或相关专业，本科及硕士以上学历；\r\n2. 具备扎实的数据结构及算法功底，掌握Java/Scala/Python等至少一门编程语言，具有1年以上开发经验；\r\n3. 理解分布式数据处理技术原理，有Hadoop或Spark开发经验优先；\r\n4. 熟悉Docker、Kubernetes及微服务的应用开发设计优先；\r\n5. 熟悉自动驾驶及相关的LiDAR、Camera等传感器数据优先；\r\n6. 对技术有强烈的兴趣，喜欢钻研，具有良好的学习和沟通能力。\r\n');
INSERT INTO `t_jobdata` VALUES ('230', 'JAVA开发工程师（大数据方向）', '15-25k·14薪', '北京-大兴区', '国汽智联', 'https://www.liepin.com/job/1951207621.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=36&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=36', '北京', '大数据', '15000.00', '25000.00', '20000.00', '一、	岗位描述（使命）\n1.	参与公司业务系统的研发，深入理解业务需求，用大数据技术实现系统建设中的功能\n二、	岗位职责\n1.	参与核心业务功能的开发与实现\n2.	进行数据相关开发工作，包括元数据定义和管理、各渠道数据采集和处理、ETL系统建设、实时计算实现等。\n3.	进行高性能、高灵活性的数据指标系统设计和开发。\n4.	负责各业务报表的设计和开发完成公司下达的年度、季度、月度经营目标任务；\n三、岗位成果（价值）\n1、参与完成江心洲项目建设（年度）\n2、完成平台类产品的后端开发工作（年度）\n四、【知识技能】\n1、熟练掌握Java，扎实的java核心知识（core Java），有使用Spring /Spring Cloud/Spring Boot/Spring MVC的实践经验。\n2、精通Hadoop/Spark/Kafka/Flink/ElasticSearch/等主流大数据技术，具有超大规模数据项目的处理经验； \n3、熟悉国内外流行的大数据和数据中台产品和方案，了解大数站前沿技术，持续探索新技术的发展方向。\n五、【素质能力】\n1、具备良好逻辑分析及归纳总结能力；有较强的学习能力、钻研精神； \n2、具有良好的沟通交流和协作能力，善于发现问题和解决问题； \n3、有创业精神，能在面临较多不确定性和变化的环境中，始终保持工作激情和责任心。\n六、【工作经验】\n1、3年以上大数据项目设计&开发经验，貝备大数据实时/离线开发和调优能力；\n2、有边缘计算、 IOT物联网、车联网等系统研发经验者优先\n');
INSERT INTO `t_jobdata` VALUES ('231', '大数据总监', '70-100k', '广州', '某知名公司', 'https://www.liepin.com/a/39067109.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=37&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=37', '广州', '大数据', '70000.00', '100000.00', '85000.00', '\n岗位职责：\n1、全面负责集团大数据团队日常管理，大数据平台技术和数据产品规划等工作；\n2、负责数据收集、挖掘和分析能力建设，支撑营销、运营策略的制定，为集团核心业务和战略提供决策依据;\n3、深入并理解业务，构建有竞争力的数据产品，赋能一线业务，提升业务效率;\n4、负责打造集团大数据平台，数据中台建设，以数据驱动业务快速发展；\n5、负责数据业务报表开发、数据分析、机器学习等，数智化推动业务发展;\n6、负责建立和维护大数据平台技术标准规范、采集规范、数仓规范，建设数据采集评估标准；\n7、负责大数据团队组织建设，加强团队成员能力提升，培养一支结构合理，富有竞争力的大数据专业队伍；\n任职要求：\n1、计算机，数学，统计学相关专业，本科及以上学历；\n2、大数据平台8年及以上从业经验，3年及以上团队管理工作经验，对大数据领域有很强的理解；\n3、熟悉Mysql、SQLServer数据库，扎实的数据库基础知识，有较强的SQL编码经验，熟悉BI报表设计开发；\n4、熟悉但不限于Hadoop，Hbase，Flink，Spark，Kafka等大数据处理框架，并能根据业务模型选择合适的大数据组件；\n5、视野开阔，学习和抗压能力强，具备良好的组织、沟通、协调和问题解决能力；\n6、从0到1搭建大数据平台，数据中台，或者机器学习，算法设计经验者优先考虑；');
INSERT INTO `t_jobdata` VALUES ('232', '大数据产品经理', '18-30k', '杭州', '杭州天阙科技有限公司', 'https://www.liepin.com/job/1951464157.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=38&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=38', '杭州', '大数据', '18000.00', '30000.00', '24000.00', '工作职责：\n1、负责收集和分析行业、用户、友商信息，结合公司战略、技术趋势，制定技术平台产品规划；\n2、负责数据类的产品的需求收集、分析、定义、澄清、验证工作；\n3、负责数据类产品文档编写、原型制作等相关工作 ；\n4、与团队密切合作，实现项目的进度、质量、成本的承诺目标。\n职位要求：\n1、本科及以上学历，计算机或相关专业；\n2、4年以上大数据产品产品经验， 对市场业务发展和技术趋势变化有自己的理解；\n3、熟悉数据治理汇聚、数据建模、大数据组件等技术；\n4、沟通能力强，能就软件产品的成型提供有效的沟通意见直至成功。\n5、有政务行业经验者优先');
INSERT INTO `t_jobdata` VALUES ('233', '产品经理（大数据风控）', '30-60k·15薪', '上海', '某知名国企互联网公司', 'https://www.liepin.com/a/38566665.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=5&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=39&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=5&pageSize=40&index=39', '上海', '大数据', '30000.00', '60000.00', '45000.00', '1.熟悉大数据产品和技术，对数据采集及集成、数据建模、数据开发、数据资产管理、数据分析等大数据领域有实战经验；\n2.具备大数据产品规划、设计交付能力，具备良好的数据敏感度、业务视野、调研分析能力，能够敏锐的捕获用户价值和产品机会，产出MRD、PRD和原型；\n3.熟悉金融行业信贷、交易、营销、安全等具体的业务场景，能不断推动对业务的深度分析，通过数据分析和机器学习建模，实现数据价值的落地和迭代；\n4.负责为部门数据应用创新项目提供前瞻性的技术攻关，将中国移动数据交付能力标准化、产品化；\n5.负责结合前沿技术开辟中国移动数据应用的新赛道，制定可行的应用方案及推进计划；协助相关资源，保证创新项目落地、产生收入。\n任职要求：\n任职资格：\n知识：熟悉机器学习、模型开发、金融机构风险防控，数据中台。\n技能：\n1、熟悉信贷、保险商业模式，具有敏锐的市场洞察力和整体的风险识别能力，能够快速、准确定位客户现状、痛点、需求，并形成相应的解决方案；\n2、丰富的数据产品管理或数据分析经验，对金融行业的信息化建设理解深刻，具备金融类数据知识，有金融类数据产品设计经验者优先。\n3、具备良好的文档（PRD、原型、PPT）包装能力、逻辑思维能力、产品（业务需求）分析能力与设计思路，能够独立从事产品规划和设计；\n4、了解金融机构数据应用，贷前，反欺诈风控流程，掌握机器学习，隐私计算知识原理；\n5、有一定建模经验，熟悉常见机器学习算法：逻辑回归、GBDT、神经网络、图算法(louvain、BMLPA)等；\n6、有一定的数据中台建设知识，有一定技术架构知识；\n教育：计算机、通信、软件工程、信息工程等相关专业研究生学历。\n经验：\n1、具有7年以上数据应用相关经验\n2、有科技公司数据产品建设，能力打造、金融风控相关岗位经验优先。');
INSERT INTO `t_jobdata` VALUES ('234', '平台运营总监（大数据智慧供应链解决方案）', '50-70k·16薪', '上海-浦东新区', 'Michael Page', 'https://www.liepin.com/job/1935854123.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=0&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=0', '上海', '大数据', '50000.00', '70000.00', '60000.00', '职责描述：\r\n1、负责S2B平台的整体规划，和产品总监一起搭建S2B平台，进行产品架构设计，制定平台化运营策略；\r\n2、对GMV负责，和销售团队一起，制定平台化的运营规划和策略，实现GMV目标的达成；\r\n3、对DAU负责，搭建用户运营支撑体系，建立用户画像、用户激励体系、成长体系和营销通道，有效触达、激活、培育和转化新老用户，提升活跃度和留存率；\r\n4、搭建其他运营体系，包括但不限于内容运营、商品运营、产品运营、数据运营等，并组建相应团队。\r\n\r\n任职要求：\r\n1、具备战略和全局观，对商业模式敏感，有互联网思维和平台思维；\r\n2、具备创业精神，享受创业过程，愿意挑战高KPI;\r\n3、本科及以上学历，5年以上工作经验，有B2B、B2C平台运营经验，BAT、有服装行业经验优先；\r\n4、有运营过十万级用户，操盘过上亿GMV，30+团队管理经验，有从0开始搭建过团队的优先。\r\n');
INSERT INTO `t_jobdata` VALUES ('235', '大数据开发工程师', '20-30k', '上海-杨浦区', '联合服务(香港)有限公司', 'https://www.liepin.com/job/1950913637.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=1&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=1', '上海', '大数据', '20000.00', '30000.00', '25000.00', '5-8经验，了解对数据仓库，数据湖， \n-了解Python\n- 清楚Hadoop和相关处理框架的经验，如Spark, Hive等。\n- 有RDBMS系统、SQL和SQL分析功能的经验\n- 具有工作流协调工具如Apache Airflow的经验\n- 拥有Github等源代码控制工具的经验\n- 有性能和可扩展性调整的经验\n- 有能力影响和有效地与团队成员和商业利益相关者进行口头和书面沟通\n- 对新的语言、技术和框架感兴趣，并能快速掌握。\n- 有敏捷/Scrum应用开发的经验');
INSERT INTO `t_jobdata` VALUES ('236', '大数据分析师', '20-35k·14薪', '上海-嘉定区', '某知名中外合资整车厂', 'https://www.liepin.com/a/36796455.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=2&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=2', '上海', '大数据', '20000.00', '35000.00', '27500.00', '1、利用大数据分析，对用户进行画像分析；\n2、改善产品设计，开发创新车机端智能化应用。\n3、与供应商及公司内外部门沟通，解决项目过程中发现的问题，推动项目最终按时落地 。		\n');
INSERT INTO `t_jobdata` VALUES ('237', '大数据开发工程师-BJ', '15-25k·13薪', '北京-朝阳区', '深演智能', 'https://www.liepin.com/job/1950852541.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=3&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=3', '北京', '大数据', '15000.00', '25000.00', '20000.00', '职责描述：\n1、基于深演云平台（包括不限于Hadoop、Spark、Hbase、Kafka、Flink、Druid、AKKA等框架），参与各产品线的开发和优化；\n2、参与人工智能算法在大数据平台的工程化、产品化工作；\n3、通过数据分析和数据挖掘，支撑精细化运营及决策。\n任职要求：\n1、教育背景：\n- 计算机相关专业，全日制本科及以上学历；\n2、经验背景：\n- 3年左右大数据相关经验，有To B数据产品相关经验更佳；\n3、岗位能力：\n- 熟悉Scala、Python、Java中任意一种；\n- 必备Hadoop生态大数据研发经验；\n- 良好的编程基础和数据结构基础，熟悉算法，机器学习的有加分；\n4、软性能力：\n- 优秀的学习能力和抗压能力，具备良好的团队意识，积极主动。');
INSERT INTO `t_jobdata` VALUES ('238', '大数据开发工程师', '15-30k·13薪', '深圳-龙岗区', '软通动力技术服务', 'https://www.liepin.com/job/1944724795.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=4&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=4', '深圳', '大数据', '15000.00', '30000.00', '22500.00', '职责描述：\r\n1、负责公司数据仓库模型设计、维护、扩展和优化，构建健壮的数据仓库公共模型；\r\n2、把关开发设计评审，确保开发严格按照数据仓库分层模型原则设计和开发；\r\n3、参与报表、自助分析等相关工作，提升数据仓库/数据集市对下游应用的支持能力；\r\n4、参与制定公司数仓规划、数据研发规范、数据治理等方案；\r\n\r\n\r\n\r\n任职要求：1、熟悉数据仓库开发流程、各类建模理论、数据仓库数据层级关系、多维数据模型设计。\r\n2、熟悉Hive/Hadoop/Spark/Flink/kafka等分布式计算框架。\r\n3、灵活运用SQL实现海量数据ETL加工处理 ，有较好的SQL性能调优经验。\r\n4、优秀的数据敏感性和业务理解能力，可以对复杂业务逻辑快速抽象建模。\r\n5、熟悉当前主流的分布式数据库离线和实时存储计算解决方案，熟悉主流的查询方案，并对其有较深的理解；\r\n6、有Flink经验优先；');
INSERT INTO `t_jobdata` VALUES ('239', '资深大数据运维工程师', '30-60k·16薪', '北京', '某大型金融公司', 'https://www.liepin.com/a/37739237.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=5&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=5', '北京', '大数据', '30000.00', '60000.00', '45000.00', 'Job Description\nPlease carefully review the position requirements before submitting a potential candidate for consideration.\n1.负责公司大数据集群的日常运维，包括hadoop、yarn\nflink、kafka、spark、elasticsearch、hbase等组件的服务的\n可用性和性能检测；\nResponsible for the daily operation and maintenance of the company\'s big data cluster, including the availability and performance testing of services of hadoop, yarn, flink, kafka, spark, elasticsearch, hbase and other components.\n2.负责数据采集的搭建、维护，包括TiDB、Zookeeper、\nflume、Logstash、Filebeat等的负载、扩容、可用性监控；\nResponsible for the construction and maintenance of data collection, including load, expansion, and availability monitoring of TiDB, Zookeeper, flume, Logstash, Filebeat, etc.\n3.负责公司大数据离线、实时任务的监控维护、维护；\nResponsible for the monitoring, maintenance and maintenance of the company\'s big data offline and real-time tasks.\n4.负责公司调度的搭建、维护、任务、工作流的配置；\nResponsible for the construction, maintenance, tasks, and workflow configuration of company scheduling.');
INSERT INTO `t_jobdata` VALUES ('240', '大数据开发工程师', '20-35k·15薪', '广州-黄埔区', '杰创智能科技股份有限公司', 'https://www.liepin.com/job/1944687137.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=6&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=6', '广州', '大数据', '20000.00', '35000.00', '27500.00', '岗位职责：\r\n1、负责数据采集并对相应的数据进行ETL流程设计与开发，负责大数据建模、数据仓库构建等工作；\r\n2、依据数据治理规范，对相应的数据需求制定解决方案并实施落地；\r\n3、负责协调数据质量相关单位，制定数据质量评审机制，检测并确保数据治理各环节顺畅运作；\r\n岗位要求：\r\n1、全日制本科及以上学历，至少3年以上相关工作经验；\r\n2、了解flume、kafka、hive、hadoop、spark等大数据框架，并具有项目实践经验；\r\n3、了解数据治理体系架构，对数据标准、数据质量、信息模型、元数据管理方法有深入研究；\r\n4、有大型项目数据治理、开发经验优先；');
INSERT INTO `t_jobdata` VALUES ('241', '大数据运维经理', '30-50k·14薪', '北京-朝阳区', 'CSC信息科技(天津)有限公司', 'https://www.liepin.com/job/1949557937.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=7&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=7', '北京', '大数据', '30000.00', '50000.00', '40000.00', '1.熟悉Linux软硬件环境、系统管理和优化，熟练部署、优化各种常用服务\n2.熟悉Hadoop大数据生态及优化，包括但不限于HDFS/YARN/Hive/Hbase/zookeeper/Spark/Kafka等\n3.熟练掌握Hadoop组件的安装部署、升级扩容、性能监控以及配置调优\n4.有运维自动化、监控系统、大数据运维工作等开发经验优先考虑\n5.熟练掌握Shell、Python开发自动化脚本，掌握SQL\n6.具备很强的ownership，有很好的技术敏感度和风险识别能力，有不断钻研和探索的精神，敢于挑战自我，有解决疑难问题的毅力和决心\n7.良好的服务意识，善于团队协作，项目管理，主动思考，自我驱动力强\n8.英语能够熟练读写，简单交流\n9.有管理经验优先');
INSERT INTO `t_jobdata` VALUES ('242', '大数据算法负责人', '150-250k·15薪', '深圳-南山区', '某大型互联网公司', 'https://www.liepin.com/a/38813817.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=8&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=8', '深圳', '大数据', '150000.00', '250000.00', '200000.00', '职位描述\n1、负责大数据研发和治理平台的智能化能力建设；\n2、负责大数据平台的元数据仓库的开发与运维工作；\n3、探索并实现数据中台的增强型数据管理能力，包括Data Warehouse Automation、Augmented Data Quality、Augmented Data Catalog等；\n4、探索大数据智能运维、自动调参、智能权限审批、数据智能异常检测、数据检索与推荐等能力，并应用到数据中台；\n5、负责数据中台数据及算法相关的项目及团队管理工作。\n职位要求\n1、具备扎实的编码能力和数据结构、算法能力；\n2、具备梳理统计基础，熟悉聚类、回归、机器学习、深度学习算法，有机器学习、深度学习工具（Scikit-learn、XGBoost、Tensorflow等）使用经验；\n3、熟悉数仓建设及常用数据模型理论，了解大数据理论支持，熟悉Hive、Spark、Flink、HDFS、Hadoop等大数据组件；\n4、具备项目、团队管理经验。');
INSERT INTO `t_jobdata` VALUES ('243', '大数据开发', '20-35k·14薪', '北京-西城区', '北京顺捷兴宏工程设计咨询有限公司', 'https://www.liepin.com/job/1947100657.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=9&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=9', '北京', '大数据', '20000.00', '35000.00', '27500.00', '工作职责：\r\n1、负责基于hadoop生态系统的大数据平台的数据处理和开发工作；\r\n2、负责大数据平台相关系统的数据采集、存储、加工、分析的设计。\r\n\r\n任职资格：\r\n1、本科及以上学历，2年(含)以上开发经验；\r\n2、熟练编写SQL脚本、存储过程，能设计复杂的业务处理、统计分析；\r\n3、熟悉数据仓库建模，熟悉大数据平台数据处理工具和相关技术HDFS、Impala、Hive、flink、Kafka、Flume等；\r\n4、熟悉主流的NoSQL技术和Linux基本管理，熟练使用Shell；\r\n5、熟练掌握Java、Python等至少一种语言，有项目开发经验者优先\r\n6、熟悉ETL开发流程，有游戏行业经验优先；\r\n7、有PB级数据管理经验者优先；\r\n8、责任心强，积极上进，具备良好的沟通能力与学习能力，有团队协作精神；\r\n9、热爱游戏者优先。');
INSERT INTO `t_jobdata` VALUES ('244', '软件工程师（云计算、大数据）', '11-13k·13薪', '无锡', '无锡先进技术研究院', 'https://www.liepin.com/job/1942396221.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=10&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=10', '无锡', '大数据', '11000.00', '13000.00', '12000.00', '职责描述：\r\n1、负责将大数据及云平台产品移植到国产平台；\r\n2、负责大数据及云平台产品性能优化；\r\n3、负责国产平台大数据及云平台技术解决方案形成及行业解决方案适配支持。\r\n任职要求：\r\n1、计算机、软件工程等相关专业本科及以上学历；\r\n2、熟练掌握C，C++，java，python，go，scala编程语言中的一种或多种，熟悉linux平台相关操作；\r\n3、对hadoop、spark框架或者docker、kubernetes有一定了解；\r\n4、有汇编基础或大数据及云平台相关软件研发经验者优先。');
INSERT INTO `t_jobdata` VALUES ('245', '大数据招商（产业研究）', '15-25k', '南京', '某知名公司', 'https://www.liepin.com/a/38942269.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=11&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=11', '南京', '大数据', '15000.00', '25000.00', '20000.00', '岗位要求：\n1、本科以上学历，3-5年行业研究、行业分析、产业招商等工作经验；\n\n岗位职责：\n1、负责建立硬科技产业行业数据库，对硬科技行业进行研究和分析，进行客户长名单输出，并形成行业研究报告，如智能制造、人工智能、生物医药等；\n 2、协助建立销售模型；\n 3、研究热点行业客户选址关注点，招商导航员，并协助项目落地执行。');
INSERT INTO `t_jobdata` VALUES ('246', '大数据经理', '25-35k', '上海', '比孚科技', 'https://www.liepin.com/job/1934602485.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=12&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=12', '上海', '大数据', '25000.00', '35000.00', '30000.00', '	与客户沟通，理解、细化客户的数据分析需求，了解客户对数据需求背后的目的，更好地为客户提供解决方案。\r\n	根据商业背景和相关行业背景，搭建清晰的分析研究框架，设计数据分析方案，将客户需求落地。\r\n	基于多维大数据以及不同数据特点，使用大数据分析工具，洞悉数据背后的信息，满足客户的业务分析需求。\r\n	基于数据洞察结果提出合理的解决方案和意见，提升数据价值。\r\n	承担数据分析报告撰写的主笔工作。\r\n\r\n	本科以上学历。\r\n	有5年以上的消费品、医药或制造行业经验。\r\n	对消费品、医药或制造行业及商业模式有深入了解，对数据有高敏锐性。\r\n	具备优异数据操作能力，熟悉数据仓库/数据湖开发和数据建模，具备大型数据平台3年以上建设经验。\r\n	良好的沟通与表达能力，善于与客户对接需求。\r\n');
INSERT INTO `t_jobdata` VALUES ('247', '大数据分析管培生(J10008)', '10-15k·13薪', '北京-朝阳区', '正大侨商房地产开发有限公司', 'https://www.liepin.com/job/1944473901.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=13&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=13', '北京', '大数据', '10000.00', '15000.00', '12500.00', '工作职责:\n1、参与构建公司的大数据系统，包括商业大数据、楼宇运行大数据，并负责维护和使用；负责大数据的挖掘、分析、展现和呈现等工作；\n2、参与公司数据库的创建、维护和管理等工作； \n3、参与公司信息系统数据库相关维护工作；\n4、参与数据融合、数据挖掘、分析等相关程序的开发编写等工作，以及微信小程序开发等工作。\n5、协同、支持其他同事的程序开发工作；\n6、完成领导交办的其他工作。\n1、统招本科、硕士、博士学历，计算机、数学、统计等相关专业，毕业三年以内，党员、学生干部优先录用；\n2、深入理解数据仓库理论、体系架构、数据架构、模型设计、元数据管理及数据质量控制；熟悉Linux平台，熟练使用Hadoop、Hive、Spark、HBase等大数据工具，熟练使用 kettle、Datax、Apache Kafka、Camel、Apatar、Scriptella、TASKCTL Web等ETL数据抽取、调度工具和FineBI, SmartBI分析呈现工具，熟练使用SQL、Python、Java、R等计算机语言进行复杂业务逻辑的数据处理；有知识图谱开发经验者优先。\n3、认可正大集团企业文化，正直诚信、懂得感恩，懂得牺牲；\n4、具有较强的业务理解能力，良好的沟通与表达能力，较强的团队协作能力，较强的学习能力。\n');
INSERT INTO `t_jobdata` VALUES ('248', '腾讯云大数据运维工程师', '25-50k·16薪', '北京-海淀区', '腾讯', 'https://www.liepin.com/job/1951196117.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=15&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=15', '北京', '大数据', '25000.00', '50000.00', '37500.00', '职责描述：\n1、负责腾讯大数据平台运维工作，通过设计、开发运维平台，解决运营过程中质量和效率问题；\n2、负责梳理现有服务流程、规范和存在的问题，并给出可行方案；\n3、负责前后端运营效率工具开发，包括但不限于：容量管理平台、DevOps、覆盖率、自动化、健康度等。\n\n任职要求：\n1、熟悉HDFS、YARN Flink、Spark、impala、Kudu、Hive、Elasticsearch、Hbase、Clickhouse等大数据技术至少精通其中2项以上； \n2、 熟练掌握一门以上编程语言（java/python/golang等） \n3、 精通linux或unix操作系统，及系统性能调优、故障处理； \n4、 3年以上大数据运维或开发经验，有很好的故障排查能力，技术敏感度和风险识别能力\n\n工作地点：北京、深圳、成都都可以');
INSERT INTO `t_jobdata` VALUES ('249', '大数据需求分析师(J12653)', '20-35k·13薪', '北京-通州区', '北京东方雨虹防水技术股份有限公司', 'https://www.liepin.com/job/1951031345.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=16&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=16', '北京', '大数据', '20000.00', '35000.00', '27500.00', '职责描述：\n1、	负责基于大数据平台的数据分析建模和数据运营，推动团队大数据项目的业务应用和落地；\n2、	负责开展数据建模、客户标签和客户画像等数据分析工作，能高效的与开发、ITBP、业务等多团队沟通，并推动数据业务快速迭代，挖掘数据价值，促进业务创新；\n3、	实现复杂数据来源、数据类型环境下的数据集中有效管理，包含数据导入和数据清洗，数据建库和数据维护等等；\n4、	推动数据管理体系与平台建设，负责数据管理制度、规范、流程的设计与制定。\n5、进行数据需求理解、数据清洗、数据分析，进行数据相关报表及文档撰写；\n任职要求：\n1、	统计学、应用数学、计算机等相关专业，本科及以上学历；\n2、	三年以上经验，其中有项目主导经验的人员优先，有S4使用经验者优先；\n3、	熟练掌握SQL和Excel，有扎实的数据统计功底；\n4、	具备数据分析报告写作经验，能经验够将分析结果，可视化并独立完成报告编写，熟练使用ppt软件\n5、	良好的数据和业务敏感度，能从海量数据提炼核心结果，有丰富的数据分析、挖掘、清洗和建模的经验，有大数据数据湖项目经验者优先；\n6、	了解大数据相关技术，有大数据ETL和数据治理经验者优先考虑。\n7、	具有较强的分析和解决问题的能力，有良好的沟通能力及团队合作精神，责任心强，有良好的抗压性。');
INSERT INTO `t_jobdata` VALUES ('250', '大数据开发', '35-55k·20薪', '上海', 'TOP券商', 'https://www.liepin.com/a/37833789.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=17&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=17', '上海', '大数据', '35000.00', '55000.00', '45000.00', '1、参与公司各业务方向数据分析及应用、数据治理、客户洞察、人工智能相关业务需求调研、分析、场景设计及落地推动；\n2、参与集团数据治理体系建设和落地，如制定集团数据治理制度，搭建集团数据架构，推进数据认责、审核数据模型、落地数据标准、监督数据质量、构建数据集市等；\n3、参与大数据平台的架构设计，基于Hive、Spark、Hadoop的计算架构，进行大数据开发工作，撰写脚本实现大数据平台上的自动化数据统计分析；\n4、参与人工智能算法与应用场景的应用，包括但不限于自然语言理解类、语音分析类、文本挖掘类、计算机视觉类、最优化、智能推荐类、特征挖掘类、人机交互类、推理类、博弈类、知识图谱类、知识工程类相关算法等；\n5、承接数据分析及应用、数据治理、人工智能相关相关项目的落地实施、技术支持和项目管理，并综合考虑业务/数据/算法等因素，持续改进和优化；\n6、技术预研、探索并应用大数据及人工智能前沿技术，持续跟踪发展生态，规划公司数据驱动业务应用。\n\n1、国内外高水平大学硕士及以上学历，计算机相关专业；\n2、有强烈的责任心和团队合作精神、具备良好的沟通能力以及快速学习的能力，有独立项目开发经验；\n3、熟练使用Java或其他语言进行复杂业务逻辑的数据处理工作，具备海量数据处理以及性能优化的能力，熟悉大数据架构并能够定位数据计算任务的瓶颈并进行性能优化的优先；\n4、数据分析及应用方向，要求精通SQL语言，同时熟练掌握大数据生态工具开发技能，包括Hive、MapReduce、Spark、Kafka、Flink、HBase等，能够独立完成数据开发、数据存储查询的优化；\n5、数据治理方向，熟练掌握数据治理方法，有丰富的指标管理体系建设经验，具备元数据管理、数据标准管理和数据质量管理等实施经验；\n6、人工智能方向，扎实掌握机器学习和数据挖掘方法，具有工程化实践经验，能主动追踪前沿技术方向并结合证券行业进行工程化落地；至少熟悉Python、C++、scala等一门语言，至少熟悉一种深度学习框架（TensorFlow/Keras/Caffe等）；\n7、3年以上大数据开发经验，有数据仓库或人工智能方向从业经验者优先，具有金融证券行业背景者优先。');
INSERT INTO `t_jobdata` VALUES ('251', '大数据开发工程师', '30-60k', '宁波-鄞州区', '穆林科技', 'https://www.liepin.com/job/1951153397.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=18&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=18', '宁波', '大数据', '30000.00', '60000.00', '45000.00', '岗位职责：\n1、负责银行大数据分析营销或者风险分析或者数据集市支撑。\n2、负责银行系统搭建、性能指标优化工作。\n3、负责客户经营类客户集市数据应用开发；借助全方位、各个系统触点获取千万级用户数据，打造AI智能化数据应用，助力一线营销人员获客、服务、筛选重要目标客户；\n4、负责银行国际结算业务和金融市场业务数据集市、数据应用系统的研发。\n负责实时数据、数据api和模型数据开发；\n人员要求：\n1.工作年限：2年以上\n2.年龄限制：30岁以下\n3.学历：本科（一本以上）\n技能要求：\n1、30周岁以下，全日制重点大学本科以及以上学历，计算机、软件工程、通信工程、物理、数学等相关专业；\n2、2年以上软件研发经验；\n3、具备良好的沟通表达能力和团队合作精神，具有较强的工作责任心、主动性及抗压能力；\n4、具体岗位技能要求\n（1）2年及以上数据分析经验，熟练掌握SQL语言，掌握数据分析的一般流程、常用方法，有数据分析项目实践经验；至少熟悉主流数据库技术Oracle/DB2/PostreSql/MySQL中的一种\n（2）熟练掌握数据研发相关算法，熟练构建和优化数据挖掘模型；\n（3）熟悉大数据相关组件，熟悉Hbase/Hive/MR/Spark/storm/flink其中的任意三个组件技术；\n（4）具备扎实的数据仓库理论知识，包括但不限于数据调度、ETL、元数据管理、数据监控、数据建模；\n（5）精通Linux操作系统、熟练使用sas、R或python、shell脚本能力\n（6）了解营销、运营、风险分析的模型设计与开发，有场景化获客建模经验者优先。');
INSERT INTO `t_jobdata` VALUES ('252', '大数据分析师', '45-60k·14薪', '上海', '某猎头公司', 'https://www.liepin.com/a/36761451.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=19&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=19', '上海', '大数据', '45000.00', '60000.00', '52500.00', '熟悉汽车大数据业务，了解行业汽车大数据技术应用方向，了解行业大数据应用的发展方向。\n5年及以上相关工作经验，硕士以上学历，prefer 211以上学校教育背景。\n具备大数据开发的数学基础知识，包括概率论，统计学，线性代数等。\n掌握大数据开发的软件工具和程序语言，Python或者R， Excel，SQL，\n熟悉一些可视化的大数据分析工具，如Tableau\n了解业务需求，对数据有敏感性。');
INSERT INTO `t_jobdata` VALUES ('253', '建工大数据平台发展部总经理', '50-80k', '重庆-渝中区', '某重庆大型专业服务公司', 'https://www.liepin.com/a/38437179.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=20&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=20', '重庆', '大数据', '50000.00', '80000.00', '65000.00', '岗位职责\n1、负责建工大数据平台事业发展规划（包括业务发展方向、发展策略、新业务产品及服务规划等）。\n2、负责建工大数据平台业务体系建设（包括产品体系梳理、业务流程梳理、营销方案梳理等）。\n3、负责带领团队完成集团下达的发展部年度业绩指标。\n4、负责建工大数据平台团队建设、激励和管理。');
INSERT INTO `t_jobdata` VALUES ('254', '高级项目经理（政务大数据）', '15-30k', '南京-雨花台区', '中国电子系统技术有限公司', 'https://www.liepin.com/job/1941408593.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=21&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=21', '南京', '大数据', '15000.00', '30000.00', '22500.00', '岗位职责：\r\n1、负责所在大数据项目整体实施工作；制定项目目标及项目实施计划，按照时间进度和质量要求完成项目的各项交付成果，确保项目实施成果满足客户需求和合同规定\r\n2、作为公司在客户现场的接口，与客户保持积极良好的沟通和交互；协助客户完成项目相关方的协调与组织工作；定期向客户汇报项目实施进度；协助客户编制进度报告以及项目汇报材料；解答客户关于项目的各种问题；收集并积极响应客户需求\r\n3、负责协调解决项目实施过程中的各种问题和冲突，并对重大问题进行告警和上报等\r\n4、定期上报项目实施进展情况，使用有效的流程和手段来保证项目的顺利进行\r\n5、负责项目实施项目团队成员管理，对项目实施团队成员绩效进行考核与评定\r\n6、配合销售和售前进行项目招投标有关工作，编制各省技术文档，预估项目成本和风险\r\n7、发掘新业务和新项目机会，及时反馈到公司\r\n8、完成公司和客户交办的其他工作任务\r\n任职要求：\r\n1、全日制本科及以上学历，具有计算机或相关专业背景优先；优秀者可适当放宽标准。\r\n2、3年以上项目实施经验，有政务、政务或大数据项目工作经验者优先；\r\n3、有大数据项目实施经验，了解ELK或Spark/HBase生态圈；\r\n4、具备客户至上的服务意识，积极主动地为客户着想，及时响应客户需求；\r\n5、具备出色的沟通协调能力，能有效调动各种资源完成任务；\r\n6、具备良好的学习意识和学习能力，善于总结项目经验和实施技术储备，带领团队进行知识分享和培训；\r\n7、责任心强，具有团队合作精神和良好的职业道德精神\r\n8、能够承受较强的工作压力，可以有效应对各项突发任务\r\n9、具备快速反应能力，对客户提出的需求或问题进行及时反馈\r\n10、具备复杂问题处理能力，能对现场发生的各类问题进行有效处理\r\n\r\n');
INSERT INTO `t_jobdata` VALUES ('255', '大数据开发工程师', '15-20k', '广州', '广东莲藕健康科技有限公司', 'https://www.liepin.com/job/1951336745.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=22&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=22', '广州', '大数据', '15000.00', '20000.00', '17500.00', '【岗位职责】\n1、负责数据分析、加工、清洗、处理程序的开发; \n2、从事海量数据分析、挖掘相关工作;\n3、负责大数据相关平台的搭建、开发、维护、优化; \n4、对业务部门的数据分析需求给予实现与支持;\n5、对公司的“数据驱动运营”的业务目标进行大数据架构方案实现。\n\n【任职条件】\n1、计算机相关专业，本科及以上学历，3年以上Java开发工作经验，学习能力突出;\n2、熟悉hadoop生态系统内常见项目的使用(hdfs、hive、hbase、spark、zookeeper、yarn等)，具有python、spark 、MapReduce开发经验，有实际大数据项目经验优先; \n3、熟练掌握SqlServer、MySql等主流数据库;\n4、了解 java web 开发，熟悉基于J2EE的WEB架构设计，熟悉Web开发流程，有丰富的Web MVC(Struts/Spring MVC、Spring，Hibernate/Mybatis等)开发经验; \n5、熟悉Linux/Unix系统环境下的操作;熟悉应用服务器的配置和优化; \n6、具有良好的沟通能力、组织能力及团队协作精神，有较强的分析和解决问题的能力。');
INSERT INTO `t_jobdata` VALUES ('256', '大数据开发工程师', '15-30k·13薪', '上海', '利宏科技(上海)有限公司', 'https://www.liepin.com/job/1951388501.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=23&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=23', '上海', '大数据', '15000.00', '30000.00', '22500.00', '职责描述：\n1.参与构建大数据系列产品，包括统计分析、数据仓库平台等产品分析、设计、开发，为业务分析提供强力支撑的报表报送数据；\n2.负责数据产品的标准制定、实施、监督等工作，确保平台平稳持续运行；\n3.熟练掌握MySQL，Hadoop，Hive，HBase等基础知识，扎实SQL功底，在Hive中构建数据分层: ODS、DWD、DWM、DWS、DIM、APP层。\n4.熟悉数据仓库和数据ETL处理过程相关工具如Datax、Sqoop、Kettle之一，有1年以上经验; \n5.能深入理解主流的大数据MapReduce，Spark，Flink，Kylin等大数据框架，进行相关优化优先。\n6.熟悉Linux常用命令，熟练编写Shell脚本；熟悉Sqoop对MySQL的数据进行导入与导出，Azkaban和Oozie进行任务调度；\n7.熟悉Tableau的操作，可以熟练按需求展示各种报表；\n\n任职要求：\n1.本科及以上学历；\n2.有银行金融统计大集中、1104、east、PBOC、反洗钱等监管规范一个以上，报送处理项目经验;\n3.有信贷、信用卡、互联网金融相关业务优先，有大数据组件平台如星环或腾讯云相关经验优先。');
INSERT INTO `t_jobdata` VALUES ('257', '大数据运维工程师', '25-50k·15薪', '北京-朝阳区', '汇量信息科技', 'https://www.liepin.com/job/1950657215.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=24&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=24', '北京', '大数据', '25000.00', '50000.00', '37500.00', '工作职责\n1、负责业务数据仓库的，以及OLAP数据库的规划、建设、部署集成；\n2、负责OLAP数据库的监控、扩容，性能优化等运维保障工作；\n3、负责大数据计算引擎的性能调优、资源调度优化和故障排除，保证业务24*7高可用；\n4、常见大数据环境和OLAP数据库的一键部署和验证脚本的开发；\n5、完善线上业务监控系统，及时处理并记录问题、统计分析等工作\n\n任职资格\n1、计算机相关专业，本科以上学历，有两年以上大数据分析和数据仓库等相关线上业务运维开发经验；\n2、熟悉大数据集群运行的原理及 Hadoop、Kafka、HDFS 集群和各组件的高可用部署方案，熟悉常见故障原因和处理方式；\n3、熟悉Prometheus、Grafana 等监控系统的使用方法；\n4、熟悉主流分布式数据库的运行原理和运维操作，例如：Clickhouse、DorisDB、MongoDB等的扩容、故障处理等；\n5、具备持续集成、持续交付的开发经验；\n6、熟练掌握 Python、Shell 等脚本和命令行工具；\n7、了解云服务相关技术，具备AWS，阿里云等云平台运维经验者优先；\n6、具备持续集成、持续交付的开发经验；\n7、熟练掌握 Python、Shell 等脚本和命令行工具；\n8、了解云服务相关技术，具备AWS，阿里云等云平台运维经验者优先；\n9、有良好的沟通、团队合作、主动思考、学习能力和强烈的责任心。');
INSERT INTO `t_jobdata` VALUES ('258', '初中高级软件测试工程师（大数据数据库方向）', '6-18k·14薪', '上海-闵行区', '英方软件', 'https://www.liepin.com/job/1937417017.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=25&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=25', '上海', '大数据', '6000.00', '18000.00', '12000.00', '初中高级测试工程师\r\n\r\n岗位职责：\r\n负责大数据模块产品测试\r\n岗位要求：\r\n1、熟悉了解多种数据库（Oracle、MySQL、DB2等）会SQL语言，熟悉国产数据库尤佳。\r\n2、会使用Linux操作系统基础命令熟悉，Shell 或 Python脚本\r\n3、了解大数据平台、消息中间件，Kafka，Hadoop优先\r\n4、有数据容灾、灾备的工作经验优先\r\n5、了解数据库架构优先\r\n\r\n有机会接触功能测试、压力测试、性能测试、自动化测试。');
INSERT INTO `t_jobdata` VALUES ('259', '大数据项目经理', '15-25k', '上海', '上海点正互联网科技有限公司', 'https://www.liepin.com/job/1950951537.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=26&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=26', '上海', '大数据', '15000.00', '25000.00', '20000.00', '大数据项目经理负责公司数据挖掘与建模项目管理工作。他需要有项目管理，电商数据分析理论知识做基础，同时又善于沟通协调，保障项目顺利进行。\n\n职位描述：\n1.	负责项目管理工作，客户对接与响应，理解并准确分析/传达客户需求，制定执行计划，明确执行细节，及时将客户的需求传达技术经理、模型工程师、数据分析师、媒体等部门；\n2.	负责内外部资源协调、实施掌握项目进度和服务质量，确保项目各项能按时按量交付；\n3.	基础的数据分析和处理汇总，相关执行文档的制作，协助模型工程师进行数据的收集；\n4.	邀约或主导部分项目汇报会议及会后纪要整理工作；\n5.	具备较强的沟通能力和服务意识，协调公司内部各部门之间的协作，提升服务团队专业水准，保障客户满意度与团队满意度；\n\n岗位要求：\n•	2年以上电商或互联网行业，参与过数据分析类或电商媒体投放运营类工作；\n•	亲自担任过广告或电商相关项目经理或项目助理工作；\n•	出色的客户沟通能力；\n•	出色的撰写PPT的能力；\n•	熟练掌握Excel数据处理相关功能；\n•	熟悉更多数据分析与处理工具更佳；\n•	有阿里数据银行和数据工厂实施经验更佳；\n');
INSERT INTO `t_jobdata` VALUES ('260', '热爱技术的大数据总监(RXGK1)', '50-80k·14薪', '上海', '欢乐互娱', 'https://www.liepin.com/job/1946914007.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=27&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=27', '上海', '大数据', '50000.00', '80000.00', '65000.00', '我们是行业内少有的连续成功的游戏公司，公司出品月流水过亿的页游《街机三国》，月流水过10亿的手游《龙之谷》，2018年《英雄杀》H5上线突破百万DAU，2020年7月起，《仙境传说RO》相继上线韩服、日服，目前总流水已过6亿。目前已拿到腾讯B轮2.5亿投资。\r\n\r\n我们是谁？\r\n我们是欢乐互娱技术中心，承载公司中台化演进和研运一体的使命，沉淀对游戏最有价值的解决方案。\r\n在这里你可以和一群公司最牛逼的游戏客户端和服务器人员共事，一起做整个公司的游戏中台。\r\n在这里你还可以接触到除了游戏开发之外的web前后端开发，能够成为全栈工程师。可以接触到大数据，SDK，自动化运维等其他的流程业务，让你的知识体系爆炸。你可以主动请战成为一个项目的owner，带着小团队达成目标。\r\n\r\n我们为你提供：  \r\n1、成为复合型人才的机会：团队内部鼓励技术互通，不拘泥于当前的技术，可以参与到中台组内的各个技术栈的建设中，团队每周都会有专题分享，可以了解丰富的专业技术，技术成长非常快；\r\n2、游戏发行向专业技能全貌：可以通过技术中心与发行运营中心的配合，了解到整个游戏发行全生命周期内所需要的技术选型，了解我们打造的中台化产品；\r\n3、思考技术全面性的挑战：团队想要做的是中台化的产品，在技术设计之初就需要考虑各种通用和特性需求，每次的需求和技术评审都会有意想不到的收获；\r\n4、全球化的视野：我们的游戏是全球化产品，获得全球化视野角度下的技术方案。\r\n\r\n职位描述：\r\n1、负责公司大数据平台建设，基于公司实际业务，对大数据平台整体架构设计及优化；\r\n2、深刻理解游戏业务，负责数据产品规划，设计；\r\n3、有较好的分析逻辑和建模，基于数据进行业务分析建模及挖掘数据价值；\r\n4、有好的团队管理经验, 负责大数据团队打造和管理；\r\n5、负责与各游戏项目的需求沟通；\r\n\r\n任职要求：\r\n任职资格\r\n1、计算机相关专业本科及以上学历，5年以上大数据相关工作经验；\r\n2、具有扎实的大数据分布式系统经验，对于大数据基础技术及原理有足够理解；\r\n3、数据大数据开源生态技术：KUDU Hadoop、Hive、HBase、Spark、Storm、Flink、Flume、Kafka、ES等）的实际开发及应用经验；\r\n4、算法基础扎实，熟悉常见的数据结构，深入理解分布式算法和以上提到的分布式系统；\r\n5、数据数据仓库建构，数据模型设计，熟悉传统BI，常用机器学习模型，有游戏项目经验优先；\r\n6、具备10+团队规模的Lead管理经验\r\n要求有搭建公司大数据平台经验，每天处理过2亿条以上数据规模，腾讯网易等用户规模大点的公司优先，最好是游戏行业的，非游戏行业背景优秀的也可以');
INSERT INTO `t_jobdata` VALUES ('261', '大数据开发工程师G000012', '20-35k·14薪', '上海-杨浦区', '上海随申行智慧交通科技有限公司', 'https://www.liepin.com/job/1951151387.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=28&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=28', '上海', '大数据', '20000.00', '35000.00', '27500.00', '职位要求\r\n  1、负责项目模块的系统分析、技术实现；\n  2、负责系统各个业务模块编码设计，确保业务支撑系统的质量、安全和性能；\n  3、负责相关系统建设及流程，重点难点技术攻破，并负责实施效果；\n  4、负责业务需求分析，编写相关技术文档等工作。\n工作职责\r\n 1、熟悉Hbase、Kafka、Spark、Flink、Hive，熟悉主流大数据架构及组件；\n  2、精通ETL开发，对数据仓库建模有较为深入的应用经验；\n  3、熟悉Mysql、Redis等常用数据库；\n  4、熟悉相关linux命令，能独立编写常规脚本；\n  5、大学本科及以上学历，计算机、数学、物理等相关专业，3年以上开发经验；\n  7、具备较强的计划、组织、协调能力和人际交往能力；\n  6、有交通行业经验者优先、有大数据集群运维经验者优先；');
INSERT INTO `t_jobdata` VALUES ('262', '大数据总监', '90-120k·15薪', '上海-浦东新区', '某上海互联网上市公司', 'https://www.liepin.com/a/38724175.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=29&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=29', '上海', '大数据', '90000.00', '120000.00', '105000.00', '岗位职责：\n1. 依据公司多元化业务发展战略，搭建适配不同业务阶段的数据架构，完备数据中台基础；\n2. 不断通过新技术优化数据体系、数据治理，完善数据仓库、数据集市、报表体系；\n3. 通过丰富数据生态，为业务运营与经营决策提供数据支撑，实现数据的业务价值转化；\n4. 整合内外部技术与基础产品，带领团队设计并落地符合业务场景需要的数据产品和解决方案；\n5. 与各业务部门协调配合，完成支持业务发展的数据相关需求；\n6. 负责数据开发团队日常管理工作，组织、管理数据开发资源，培养和组建梯队，提升数据开发人员的技术、效率及团队凝聚力。\n\n\n任职要求：\n1. 全日制本科及以上学历，计算机相关专业，8年以上金融或互联网大数据开发应用经验，有互联网金融背景熟悉零售信贷业务优先；\n2. 精通大数据处理及分布式系统相关技术，如Hadoop、Mapreduce、Spark、Hive、HBase等；\n\n3. 精通实时计算及查询搜索相关技术，如Flink、Kafka、Clickhouse、Presto、Druid、Impala、Kylin等；\n4. 熟悉主流的应用开发框架，如Spring、Spring MVC、SpringBoot等；\n5. 熟悉数据分析和数据建模方法论，具备企业级数据仓库和BI项目经验，对数据行业发展有深刻的理解；\n6. 具备3年及以上综合性数据团队管理经验。');
INSERT INTO `t_jobdata` VALUES ('263', '大数据销售', '15-25k', '上海-普陀区', '智广海联大数据技术有限公司', 'https://www.liepin.com/job/1950500001.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=30&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=30', '上海', '大数据', '15000.00', '25000.00', '20000.00', '岗位描述：\n1、负责面向政府委办局进行大数据相关产品的销售工作，与客户进行商务沟通、谈判、签订合同，完成销售指标；\n2、维护公司客户资源，深入挖掘客户产品需求建议，找到市场痛点；\n3、根据项目需要，从销售及商务角度配合售前及实施等部门工作开展，推进项目顺利进行，完成任务指标。\n\n任职要求：\n1、专科及以上学历，有政府项目销售经验的优先考虑；\n2、了解软件产品技术知识，有售前经验的优先考虑；\n3、具有较强的客户沟通能力及公关能力，逻辑思维清晰，目标明确，性格开朗。');
INSERT INTO `t_jobdata` VALUES ('264', '大数据专家', '40-70k', '上海', '某大型基金证券公司', 'https://www.liepin.com/a/38696813.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=31&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=31', '上海', '大数据', '40000.00', '70000.00', '55000.00', '工作职责：\n1、负责大数据风险管理产品、研发团队。\n2、积极响应一二道防线的风险系统、风险数据、风险模型的建设要求。\n3、优化大数据风险管理技术；\n4、提升风险基础数据的全面、及时、准确、通用性。\n5、优化风险模型，提升模型识别精度。\n6、引入另类数据，提升风险防范能力。\n');
INSERT INTO `t_jobdata` VALUES ('265', '社招-大数据Java应用开发架构师', '25-35k·15薪', '上海-浦东新区', '上海期货信息技术有限公司', 'https://www.liepin.com/job/1947686937.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=32&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=32', '上海', '大数据', '25000.00', '35000.00', '30000.00', '工作职责:\r\n统筹技术方案设计工作，开展技术测试和选型，落实系统架构设计，对具体技术方案进行细化设计，对技术开发人员进行技术指导，建立代码开发规范，负责代码评审，把控开发质量和开发进度。\r\n任职资格:\r\n1、	全日制本科及以上学历，计算机相关专业；\r\n2、	8年以上的java大数据大型应用的开发经验；\r\n3、	精通hadoop大数据平台相关组件的开发和测试能力，对Hive, 图数据库，elasticsearch及 spark/flink 等软件组件都有丰富的开发、排错实践经验；\r\n4、	精通springboot及springcloud 微服务开发框架，熟悉高复杂度分布式微服务应用管理和设计编排工作；\r\n5、	要求至少领导过2-3个金融机构的大型web应用和大数据分析应用的整体技术架构设计工作，并主导项目的全部技术管理过程的工作；\r\n6、	拥有管理10人以上开发团队的技术管理经验，对金融行业领域尤其是期货证券行业有一定的业务经验持；\r\n7、	熟悉多种开发设计管理方法论，如企业架构设计，敏捷开发、测试驱动开发以及DDD领域驱动设计；\r\n8、	严谨的逻辑思维能力，高水平的沟通能力，对技术充满热忱，有快速地学习能力和丰富的问题解决能力，具备高度个人驱动力和执行力，同时具备良好的团队合作精神。\r\n');
INSERT INTO `t_jobdata` VALUES ('266', '金融大数据项目经理—企信大数据部', '8-12k·13薪', '广州-天河区', '中数通信息', 'https://www.liepin.com/job/1936242133.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=33&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=33', '广州', '大数据', '8000.00', '12000.00', '10000.00', '职责描述：\r\n1、负责完整的项目周期（启动、规划、执行、监控及收尾），并确定项目成本、资源、进程与成果交付；\r\n2、参与项目的需求调研、分析及系统原型设计，为客户制定解决方案，做好项目干系人的管理及沟通；\r\n3、有效组织及监控项目实施，合理分配项目所需各项资源，根据实际情况及时对计划进行必要的调整；\r\n4、控制项目质量，做好风险管控，执行风险与问题跟踪管理，做好应对措施；\r\n5、做好项目经验总结及项目资料的归档；\r\n6、具有组建、管理、培训专业化的项目团队的能力。\r\n任职要求：\r\n1、2年以上项目管理经理经验，具备一定的技术背景（熟悉Java、JSP、Html5、JavaScript等）；\r\n2、有金融行业经验、大数据相关项目经验及拥有专业的项目管理资格证书（PMP等）优先考虑；\r\n3、性格开朗，做事积极主动；思维缜密，细心有责任感；有良好的沟通协调能力和团队合作能力，抗压能力强；\r\n4、具备熟练的office技能及方案文档撰写能力；\r\n5、能适应出差。');
INSERT INTO `t_jobdata` VALUES ('267', '大数据开发工程师', '15-30k·15薪', '深圳-南山区', '道通科技', 'https://www.liepin.com/job/1949267973.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=34&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=34', '深圳', '大数据', '15000.00', '30000.00', '22500.00', '岗位职责：\n1.负责大数据平台的建设，参与需求分析，详细设计，开发， 测试；\n2.参与相关数据仓库的建设， 需求调研，数据处理；\n3.参与新项目技术调研，测试；    \n任职要求：                                                                                                                                            \n1. 本科及以上学历，计算机或相关专业,具备扎实的数据结构及算法功底，精通Java/Scala/Python等至少一门编程语言，具有3年以上开发经验；\n2. 熟练掌握Hive/MapReduce/Spark/Flink/kafka/durid/presto等分布式计算系统;\n3.有基于SQL及No-SQL数据库，数据仓库的设计建设经验；\n4.熟悉整个大数据的完整处理流程（数据的采集、清洗、预处理、存储、分析挖掘、机器学习和数据可视化等），有完整的大数据项目设计、开发及部署经验；\n5.熟悉自动驾驶及相关的Radar, Lidar、Camera, 等传感器数据分析处理挖掘， 或相关大数据平台建设经验优先；\n6. 有热情，爱学习，关注大数据前沿技术发展，逻辑思维能力好，有较强解决问题能力, 具有强烈的责任意识、开放的心态、进取心及团队合作精神；');
INSERT INTO `t_jobdata` VALUES ('268', '总行科技开发部大数据开发岗', '17-25k', '厦门-同安区', '厦门国际银行', 'https://www.liepin.com/job/1951195585.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=35&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=35', '厦门', '大数据', '17000.00', '25000.00', '21000.00', '职责描述：\n1、负责大数据平台应用架构设计、工具、系统开发工作，针对银行业务需求提供大数据技术相关解决方案；\n2、完成部门交办的其他工作。\n任职要求：\n1、本科及以上学历，计算机、软件、信息技术相关专业；\n2、3年以上工作经验，具有大数据平台设计、流式处理技术经验者优先；\n3、熟悉Spark、Impala、Stream等大数据技术，熟悉分布式平台工作原理，熟悉分布式数据库平台开发（hadoop，Hbase等），对大规模Hadoop集群的搭建、管理和性能优化有一定经验，了解至少一款业界主流大数据平台商业产品，如ClouderaCDH、华为FusionInsight、IBM BigInsight、星环TDH等； \n4、工作态度认真负责，具有较强的团队意识，勤奋好学，逻辑思维能力强。\n5、具备良好的职业道德、品德操守及风险识别能力，诚实守信，无违法违纪行为和不良记录。');
INSERT INTO `t_jobdata` VALUES ('269', '分公司负责人（天维大数据）', '40-70k', '深圳-罗湖区', '维度数据科技', 'https://www.liepin.com/job/1950651795.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=36&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=36', '深圳', '大数据', '40000.00', '70000.00', '55000.00', '职责描述：\n职责描述：\n岗位职责：\n1、统筹经营：统筹所负责子公司经营管理与日常运营；\n2、业务拓展：带领团队开拓业务，确保年度业务利润目标达成；\n3、组织发展：引进扩展技术、业务等团队，确保年度人才发展目标达成；\n4、负责子公司所有项目的运作与管控，协调实施项目的全过程推进与管理，组织和协调集团内外资源，带领团队达成公司的数字化战略目标；\n5、对子公司发展经营中遇到的重大问题在授权范围内进行决策，授权范围外积极反馈、跟踪；\n6、协助集团在企业文化、组织创新、人才开发、业务开拓、对外合作等企业发展的关键领域进行战略管理；\n\n任职资格：\n1、统招本科及以上学历，有同行业、同岗位的工作经历；\n2、具有5年以上智慧城市类软件系统行业企业高层管理工作经验，具备综合管理能力，有技术团队管理经验，懂市场管理及项目管理者优先；\n3、具备较强的分析决策、实施能力及风险控制能力，能拟定项目发展战略及目标，并带领团队确保目标实现；具有良好的公共关系拓展、维护能力，擅长与政府及相关职能部门沟通。\n4、做事踏实细心、严谨自律、有条理性，具有较强的责任心和敬业精神，有较强的组织能力、学习能力、分析判断能力以及沟通协调能力；\n5、能承受较大工作压力，自身有一定影响力，有较强的谈判技巧及危机处理能力。\n6、为人正直，有良好的沟通及执行能力，具备团队合作精神及团队管理能力。');
INSERT INTO `t_jobdata` VALUES ('270', '产品经理（大数据方向）', '15-22k', '南京-鼓楼区', '中储智运', 'https://www.liepin.com/job/1933619699.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=37&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=37', '南京', '大数据', '15000.00', '22000.00', '18500.00', '职责描述：\r\n1、开展数据应用产品的整体研究及策划、制定产品年度计划和长期发展规划；组织或协助团队完成大数据平台产品、应用产品、分析产品、可视化产品的整体规划；\r\n2、提炼产品核心价值，把我产品定位和目标，搭建数据产品体系，规划设计产品功能、服务及流程，编撰相应产品文档；与业务线产品经理、运营一起提炼数据型产品，并根据业务线产品及运营需要进行数据模型及产品分析和设计；\r\n3、执行大数据产品全过程管理，包括收集用户需求、进行竞品调研、研究产品定位、制定产品规划、设计产品功能等，并拟定优先级合理的具体实施计划，保障相关业务指标达成；\r\n4、研究数据的全生命周期，对数据的生产、采集、治理、资产、应用服务等有自身的理解；掌握大数据平台产品架构技术方案，参加大数据采集、挖掘及业务系统技术交流，并能够实施公司大数据研发产品的技术对接与部署；\r\n任职要求：\r\n1、有着五年以上数据产品工作经验，有独立设计的大型数据模型；\r\n2、能够理解数据链路生产、加工到应用的全流程，并能够用产品化的方式解决底层到应用层的数据产品体系搭建；\r\n3、对数据敏感，能够洞悉数据指标体系对业务的效能提升点，搭建完善的分析框架并用可视化的方式展现；\r\n4、对机器学习、AI技术有一定了解，并通过产品化的手段，融入技术动力，为企业数字化，智能化转型进行产品落地；\r\n5、在运输行业有从业经验者优先。');
INSERT INTO `t_jobdata` VALUES ('271', '大数据开发工程师', '20-30k·13薪', '北京-西城区', '智盟信通', 'https://www.liepin.com/job/1948982961.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=38&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=38', '北京', '大数据', '20000.00', '30000.00', '25000.00', '职责描述：\n1、参与大数据平台的数据架构设计，完成从业务模型到数据模型的设计，研发基于大数据平台的数据仓库平台产品，完成开发及相关文档的编写；\n2、基于海量数据的数据仓库，为业务搭建通用的查询和分析解决方案；\n3、利用大数据相关技术实现对数据的加工、分析、挖掘、处理、及数据可视化等相关工作；\n4、参与大数据平台的容量规划、持续交付、业务监控、应急响应，保证平台正常运行；\n5、基于大数据平台(Hadoop)的数据仓库工具Hive/Spark/HBase, ETL调度工具，数据同步工具的开发、使用、集成和自动化运维，以及多租户与权限控制策略的实现；\n6、根据工作安排高效、高质地完成代码编写，确保符合代码规范；\n7、推动团队内成员技术经验分享，关注相关前沿技术研究，通过新技术服务团队和业务；\n\n任职要求：\n1、计算机、软件工程等相关专业本科及以上学历，3年以上工作经验，2年以上大数据开发经验\n2、熟悉Unix/Linux操作系统\n3、具有较强的编程实现能力，熟悉Scala等编程语言\n4、熟悉MapReduce、Spark、Hive、Impala等开源大数据计算平台\n5、熟悉HDFS、HBase、Kafka等开源大数据存储平台\n6、熟悉大数据分布式与并行计算技术，熟悉Spark Streaming、Spark MLlib等大数据算法库\n7、具有较强的动手能力、学习能力\n8、具备强烈的责任心、进取心及团队合作精神\n');
INSERT INTO `t_jobdata` VALUES ('272', '医疗大数据销售经理', '12-20k', '郑州', '北京深睿博联科技有限责任公司', 'https://www.liepin.com/job/1944622423.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=6&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=39&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=6&pageSize=40&index=39', '郑州', '大数据', '12000.00', '20000.00', '16000.00', '职责描述：\r\n1、负责拓展新医院和维护现有医院的项目，对医院端、政府端解决方案销售负责。\r\n2、建立与辖区内医院的合作，维护关键客户和合作渠道，完成相应指标。\r\n3、配合运营体系持续可跟踪服务医院及专家，挖掘客户需求。\r\n\r\n岗位要求:\r\n1，大专及以上学历，医疗信息化背景优先，有一定的行业资源；\r\n2，对医疗大数据领域有一定认知和见解，有兴趣和激情一起加入创业团队；\r\n3，有独立的项目管理、策划和执行能力，有一定的研究和科研思维；\r\n4，客户服务第一的工作思维；\r\n5，有独立的思维能力，具备较强的学习和创新能力。');
INSERT INTO `t_jobdata` VALUES ('273', '大数据架构师', '150-250k', '深圳', '某深圳IT服务上市公司', 'https://www.liepin.com/a/38394221.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=0&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=0', '深圳', '大数据', '150000.00', '250000.00', '200000.00', '大数据架构师 \n1 \"1. 负责工业大数据技术、应用场景等调研及相关资料收集整理，工业大数据分析平台架构设计及规划 \n2. 工业大数据相关的大数据描述、采集、传输、分析等理论方法及核心技术及应用技术的研究 \n3. 制定平台工业大数据相关技术规划、标准制定，并且推动团队遵循标准； \n4. 负责关键项目中的技术难题，牵头项目关键架构设计和技术难点攻关\" \" \n1. 计算机、软件工程及相关专业，本科及以上学历，至少5年以上大数据项目相关工作经验，有工业大数据项目经验者优先考虑\n2. 精通Hadoop、HBase、Kafka、Hive、Spark等组件的工作原理，熟悉Hadoop生态系统 \n3. 熟练掌握海量数据分析的相关模型、算法，有制造行业大数据分析模型、算法经验者优先\n4. 熟悉数据库开发，精通面向对象设计、设计模式，熟练MySQL、Redis等数据库\n5. 精通Java，python中的一种或多种语言，具备海量数据处理以及性能优化的能力。 \n6. 有大数据挖掘和分析、机器学习相关项目经验者优先\"');
INSERT INTO `t_jobdata` VALUES ('274', '大数据与人工智能应用技术特级专家', '150-300k', '北京', '某北京互联网/电商上市公司', 'https://www.liepin.com/a/39076509.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=1&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=1', '北京', '大数据', '150000.00', '300000.00', '225000.00', '1、结合企业现状及行业趋势制定公司数字化转型战略，组织推进实施数字化转型，构建整体数字化技术架构及治理架构；\n2、研究人工智能与大数据技术领域最新进展，并应用到业务中；\n3、创造并实施能够有效帮助内外部客户实现或提升数字化的产品、服务及解决方案；\n4、以全新视角对企业自身所处的市场环境和价值链进行审视和构思，将数字化技术与企业自身核心优势相结合，通过数据分析认知市场趋势和适应未来的创新商业模式，以创新的商业模式与市场、客户建立全新的关系；\n5、负责培养企业数字化团队，指导数字化建设专业人员的职业规划和技能发展；\n岗位要求：\n1、海外博士学历，统计学、经济学，数学、计算机科学相关专业优先；\n2、担任海外知名公司、科研机构高级管理人员或高级技术人员优先，5年以上数据分析/数据科学行业经验，有重大项目参与经验优先；\n3、扎实的数据分析理论和技术基础，有开发、算法背景优先；能根据数据提供合理的见解推动产品的开发和迭代；\n4、精通数据治理及数据资产管理，熟悉数据集市、平台、智能决策以及大数据相关技术者优先；\n5、具有国际化视野、开阔的战略视野，洞悉信息、数字技术发展态势，有敏锐的数字化洞察力、市场洞察力。');
INSERT INTO `t_jobdata` VALUES ('275', '高级大数据开发工程师（机器学习方向）', '15-25k', '北京-朝阳区', '万达电影', 'https://www.liepin.com/job/1950970657.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=2&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=2', '北京', '大数据', '15000.00', '25000.00', '20000.00', '岗位职责：\n1、负责智能运维大数据的研发和测试，撰写相关文档 \n2、负责高性能、高可用的大数据平台的设计和优化，制定技术演进路线 \n3、负责大数据计算资源的监控、管理和优化 \n4、负责大数据应用产品的代码研发、重构和优化 \n5、对产品实施交付过程中遇到的技术问题提供支持 \n6、关注并研究大数据生态新的前沿技术，推动产品技术革新\n岗位要求：\n1、计算机相关专业，国家统招本科及以上学历，5年以上大数据开发经验； \n2. 熟练掌握编程语言：java、scala、python\n3、熟悉hadoop生态，熟练掌握hdfs、hbase、yarn、flume等相关组件部署及性能优化\n4、熟练掌握hive、spark(或者flink)离线、实时计算框架，有每天10tb级别数据处理经验\n5、有离线、实时数据分析相关开发经验\n6、有数据建模、ETL、数据质量、数据治理及数据安全相关经验\n7、有python机器学习经验者优先\n8、工作责任心强、效率高、有钻劲、善于自学提高；沟通能力好、自我驱动能力强、有创新精神及团队合作精神。');
INSERT INTO `t_jobdata` VALUES ('276', '产品经理（大数据）', '35-60k·16薪', '上海', '全球知名企业', 'https://www.liepin.com/a/37725571.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=3&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=3', '上海', '大数据', '35000.00', '60000.00', '47500.00', '岗位职位：\n1.熟悉大数据产品和技术，对数据采集及集成、数据建模、数据开发、数据资产管理、数据分析等大数据领域有实战经验；\n2.具备大数据产品规划、设计交付能力，具备良好的数据敏感度、业务视野、调研分析能力，能够敏锐的捕获用户价值和产品机会，产出MRD、PRD和原型；\n3.熟悉金融行业信贷、交易、营销、安全等具体的业务场景，能不断推动对业务的深度分析，通过数据分析和机器学习建模，实现数据价值的落地和迭代；\n4.负责为部门数据应用创新项目提供前瞻性的技术攻关，将中国移动数据交付能力标准化、产品化；\n5.负责结合前沿技术开辟中国移动数据应用的新赛道，制定可行的应用方案及推进计划；协助相关资源，保证创新项目落地、产生收入\n任职资格：\n知识：熟悉机器学习、模型开发、金融机构风险防控，数据中台。\n技能：\n1、熟悉信贷、保险商业模式，具有敏锐的市场洞察力和整体的风险识别能力，能够快速、准确定位客户现状、痛点、需求，并形成相应的解决方案；\n2、丰富的数据产品管理或数据分析经验，对金融行业的信息化建设理解深刻，具备金融类数据知识，有金融类数据产品设计经验者优先。\n3、具备良好的文档（PRD、原型、PPT）包装能力、逻辑思维能力、产品（业务需求）分析能力与设计思路，能够独立从事产品规划和设计；\n4、了解金融机构数据应用，贷前，反欺诈风控流程，掌握机器学习，隐私计算知识原理；\n5、有一定建模经验，熟悉常见机器学习算法：逻辑回归、GBDT、神经网络、图算法(louvain、BMLPA)等；\n6、有一定的数据中台建设知识，有一定技术架构知识；\n教育：计算机、通信、软件工程、信息工程等相关专业研究生学历。\n经验：\n1、具有7年以上数据应用相关经验\n2、有科技公司数据产品建设，能力打造、金融风控相关岗位经验优先。');
INSERT INTO `t_jobdata` VALUES ('277', '大数据开发工程师（存储方向）', '30-60k·14薪', '北京-海淀区', '星阑科技', 'https://www.liepin.com/job/1951126089.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=4&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=4', '北京', '大数据', '30000.00', '60000.00', '45000.00', '岗位职责：\n1. 参与高吞吐标准化数据处理及存储平台的建设工作;\n2. 定位并提升当前系统中的瓶颈，如数据存储，网络通信，数据计算流等；\n3. 深入支撑业务及研发流程对存储的各类需求；\n岗位要求：\n1.计算机科学相关专业毕业，有扎实的算法和数据结构基础；\n2.较好的Java/Rust/C/C++/Go编程能力，熟悉其中至少2种；\n3.有三年以上分布式存储使用和调优经验，如doris/hbase/clickhouse等；\n4.有良好的工作文档习惯，优秀的沟通协调能力;\n加分项：\n1.有数据sense，有一定的数据分析，挖掘、清洗和建模经验;\n2.熟悉Linux内核协议栈，有相关开发和性能调优经验优先；\n3.熟悉高性能框架如DPDK、BPF等，有相关开发经验优先');
INSERT INTO `t_jobdata` VALUES ('278', '大数据开发工程师', '12-21k·13薪', '西安-雁塔区', '上海华钦信息科技股份有限公司', 'https://www.liepin.com/job/1946966105.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=6&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=6', '西安', '大数据', '12000.00', '21000.00', '16500.00', '负责与数据管理、数据提取、数据加载到目标系统、异常管理相关的分析、架构和实现任务，并支持生产流程和系统。 该职位需要在整个项目生命周期内与项目经理、技术主管、系统架构主管、开发人员、QA工程师和业务分析师密切合作。 具有大数据开发、设计和架构方面的专业知识  熟悉Ab Initio等tansformation工具 \r\n熟悉Hadoop, Hive, Sqoop, Nifi, Knox, Oozie等大数据技术   \r\n优秀的SQL和Linux shell脚本知识   \r\n-对分布式系统，数据管道，ETL有良好的理解   \r\n在项目的任何阶段提供优先级，计划，评估，工作分配，质量保证和指导。   \r\n识别和开发技术设计文件。 开发并记录高级概念数据流程设计，供数据分析人员审阅。   \r\n为客户提供支持业务流程和业务目标的解决方案。   \r\n为团队成员提供培训、指导、帮助和知识转移。   \r\n具备敏捷交付和Scrum团队的丰富知识和经验。 基本技能:   \r\n-熟练掌握Hadoop、Sqoop、Hive、NiFi、Knox、Oozie等大数据技术   \r\n强有力的SQL技能   \r\n熟悉Devops技术，如Jenkins, Ansible, Nexus, Sonarqube   \r\n熟悉Unix Shell脚本和一般管理   \r\n在金融服务/银行领域有经验   \r\n优秀的沟通技巧   \r\n有用的技能/知识:   \r\n-BMC Control M(版本7.0或以上)   \r\n-云技术，尤其是GCP   \r\n-大数据管道设计   \r\n-大数据湖的性能优化   \r\nPython\r\n英文沟通良好');
INSERT INTO `t_jobdata` VALUES ('279', '大数据开发工程师', '20-30k·13薪', '北京-通州区', '北京东方雨虹防水技术股份有限公司', 'https://www.liepin.com/job/1950571249.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=7&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=7', '北京', '大数据', '20000.00', '30000.00', '25000.00', '职责描述：\n大数据开发工程师\n岗位要求：\n1、本科及以上学历（985、211院校优先），3年以上大数据系统开发经验。\n2、精通SQL，熟练掌握Hadoop、Hive、Flink、Kafka，具备Java、Scala、Python开发能力优先。\n3、熟练使用阿里大数据工具MaxCompute、DataWorks，熟悉阿里大数据工具QuickBI、DataHub。\n4、具有在线及离线数据处理及统计分析经验，能够独立承担数据ETL及统计分析工作。\n5、具有出色的逻辑思维能力和沟通能力。\n\n任职要求：\n岗位职责：\n1.按照开发规范，标准、规范、严格地进行项目编码开发； \n2.按照过程管理，负责项目单元测试、功能测试等； \n3.根据上级主管要求编写符合规范的技术文档及维护手册； \n4.在按照需求完成编码开发工作的前提下，能通过大数据量压力测试； \n5.协助解决系统产生的问题。');
INSERT INTO `t_jobdata` VALUES ('280', '总行审计部——大数据审计岗', '15-25k', '厦门-思明区', '厦门银行股份有限公司', 'https://www.liepin.com/job/1950538967.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=8&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=8', '厦门', '大数据', '15000.00', '25000.00', '20000.00', '岗位职责：\n1、参与非现场审计系统建设，监控非现场审计模型运行，对非现场审计模型提出优化、完善意见；\n2、参与或组织实施对口业务具体审计项目，并对审计发现问题的整改情况进行跟踪；\n3、参与或组织对口业务审计相关制度的起草和修订。\n4、负责集团企业内控审计业务需求，深入挖掘审计业务场景，设计大数据审计模型，并进行模型算法开发和持续优化。\n5、定期进行风险评估，对关键风险建立及完善评估预警模型，并使用模型对相关风险进行测试；\n任职要求：\n1、全日制本科及以上学历，信息管理、信息安全、机器学习、大数据分析及IT审计等相关专业；\n2、熟悉金融相关的法律、法规和政策，对银行的内部控制、风险管理、公司治理等有一定的了解；\n3、熟悉审计程序和公司内部控制流程，具有较强的大数据分析、建模及场景编程能力；\n4、具有3年以上大数据算法开发经验，具有大型集团审计部、大数据审计、IT审计经验者优先；');
INSERT INTO `t_jobdata` VALUES ('281', '大数据开发工程师', '15-30k·14薪', '上海-浦东新区', '某大型世界500强通信公司', 'https://www.liepin.com/a/37945681.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=9&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=9', '上海', '大数据', '15000.00', '30000.00', '22500.00', '岗位职责：\n1. 负责大数据平台的规划、设计、实施，包括但不限于采用合理技术实现ETL、数据仓库、数据集市、实时分析、离线分析、自助分析、报表、智能推荐、机器学习等。有BI系统开发经验、熟悉Dashboard、 标注工具等开源项目；\n\n工作要求：\n1. 计算机或相关专业本科及以上学历，5年以上大数据相关工作经验\n2. 精通大数据生态相关技术，熟悉内在技术的优劣, 具有长时间的实战经验，具备使用、维护、调优的能力，包括但不限于Hadoop, Spark, Kafka, ELK, Flink, clickHouse等\n3. 精通实时大数据平台相关的编程技能, 比如java, golang, scala, java, shell, sql等, 能独立承担较大模块的设计、核心功能开发、上线工作；有对应的前端框架Vue开发经验优先；\n4. 过往项目有微服务、容器技术开发经验；对云原生开源技术有深入了解；\n5. 热爱学习，具备开阔的技术视野, 了解大数据领域实时技术动态\n6. 较强的抗压能力\n\n其他补充：\n1、薪资范围：D1~D5\n2、薪资结构：底薪+绩效+奖金\n3、绩效工资：2k起，A/B两个等级，入职拿B绩效\n4、加班费结算：按正常加班结算\n5、入职即签订4年合同，6个月试用期');
INSERT INTO `t_jobdata` VALUES ('282', '大数据总监', '50-80k·15薪', '北京-东城区', '某北京大型计算机软件公司', 'https://www.liepin.com/a/38844863.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=10&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=10', '北京', '大数据', '50000.00', '80000.00', '65000.00', '职位要求：\n统招本科及以上学历，计算机相关专业；\n负责建立数据平台，数据采集、对接和验收；\n有数据平台搭建、数据标注、算法、训练等数据平台经验者优先；\n具有丰富的项目、团队管理经验。');
INSERT INTO `t_jobdata` VALUES ('283', '大数据开发工程师', '15-30k', '青岛', '某大型家电企业', 'https://www.liepin.com/a/38951055.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=11&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=11', '青岛', '大数据', '15000.00', '30000.00', '22500.00', '岗位职责\n1. 能够使用大数据相关的技术（分布式存储、数据管理、数据处理）解决业务相关问题\n2、理解HDFS体系架构，并能给予Hive、HDFS、python、R、Spark、Zeus等工具构建离线系统\n3、利用大数据平台实现对数据的分析和处理\n4、熟悉业务系统中的数据处理工作（数据采集、清洗、汇总、集成等）\n5、负责对大数据平台系统的开发与部署工作\n6、具有良好的逻辑思维能力，可以独立承担工作压力，善于学习，与团队沟通无障碍\n\n任职要求\n1、计算机相关专业本科及以上学历，硕士学历优先\n2、3年及以上ETL开发或分析经验，至少有1年大数据开发或分析经验（不含实习时间）\n3、精通Python、Shell、Java等中的1种以上\n4、熟悉主流数据库（Oracle、MySQL、TiDB）中的1种及以上，精通SQL、存储过程，有较好的SQL性能调优经验\n5、参加过一个完整的大数据项目开发\n6、熟悉Hadoop、HDFS，MapReduce，Hive等开源分布式系统\n7、具有良好的逻辑思维能力，善于学习，与团队沟通无障碍；有数据仓库ETL经验者优先\n8、有互联网数据处理经验者优先\n9、有持续学习的能力；喜欢开源软件，乐于知识分享；对工作认真负责；可以独立承担较大工作压力');
INSERT INTO `t_jobdata` VALUES ('284', '大数据开发工程师', '12-18k', '西安-高新区', '陕西纳吉特数据科技有限公司', 'https://www.liepin.com/job/1950899881.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=12&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=12', '西安', '大数据', '12000.00', '18000.00', '15000.00', '主要职责：\n1、利用Hadoop、Spark、Flink等大数据技术对海量数据进行清洗治理，支持业务建模的工程化实现。\n2、构架教育大数据平台，包括数据存储、数据清洗、数据治理、数据质量管理、数据血缘分析、数据管理平台系统及相关监控，推进平台的架构设计和实现。\n3、大数据相关框架/工具/中间件的设计和开发。\n任职要求：\n1、全日制本科以上学历，计算机、数学等相关专业。\n2、4年以上Hadoop/Hive/Hbase/Spark/Flink/Mesos/Kafka 等大数据技术栈实战经验，在对海量数据并行计算、传输、处理等有丰富的经验。\n3、熟悉Hadoop底层文件系统及Yarn资源调度，深入理解 Mapreduce及Spark 原理，阅读过Hadoop/Spark源码，有二次开发经验，具备MPP、Hadoop等混搭平台架构的设计能力。\n4、 具有扎实的 Java/Scala等开发语言功底，可以开发高效可靠的代码，能阅读Java、Scala、Python两种以上源码，快速定位问题并解决问题\n5、 熟悉 MySQL/Oracle/DB2/PostgreSQL/Greenplum之一；\n6、良好的团队合作能力、分析和解决问题的能力、积极进取，责任心强；\n7、良好的信息安全意识，熟悉常见的数据脱敏方法，有实际项目经验者优先；\n8、具有一定数据分析和机器学习项目经验者优先；\n9、有参与过教育大数据平台开发者优先。');
INSERT INTO `t_jobdata` VALUES ('285', '大数据算法团队负责人', '70-100k·14薪', '深圳', '某知名央企', 'https://www.liepin.com/a/37399569.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=13&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=13', '深圳', '大数据', '70000.00', '100000.00', '85000.00', '1. 负责公司数据技术平台中长期战略，参与公司总体数据技术架构的设计，制订有关数据平台的规范与使用流程；\n2. 在大数据平台技术，实时数仓、湖仓一体，增强分析、机器学习等领域，负责关键技术调研与落地；\n3. 依据数据架构规范与公司数据战略规划，结合行业发展趋势、监管政策 规划，设计服务解决方案，并推动落地；\n4. 进行数据架构设计，设计数据加工与存储模型，并进行相应管理；\n5. 带领技术团队，设计、研发、运维公司数据平台各模块，保持数据系统的稳定性，提升数据研发效率，通过大数据技术赋能公司各业务条线，提升业务价值；\n6. 带领数据服务团队，设计、规划数据服务与商业化的实施路径，负责技术实现与产品落地，打造金融/保险领域的下一代数据服务解决方案。\n岗位要求 \n1. 博士学历，计算机/统计/数学/信息技术等相关专业； 有金融/互联网行业大数据背景优先；\n2. 5 年以上大数据研发条线管理经验，组织过中等规模以上大数据相关数据平台的选型、开发与落地，对高性能、高可靠，海量数据分析场景有深入理解；\n3. 掌握企业架构方法与较好的实践应用，例如 Togaf、FEAF、Zachman 其中一种；掌握领域建模、业务价值链分析方法并根据业务抽象提炼业务需求与业务架构；\n4.对云计算、大数据及在行业的应用和落地有相关经验；具备优秀的文档能力，使用文字、图示清楚地表达架构意图，能够熟练编写各类需求与设计文档；\n5.善于沟通与理解业务需求；有良好的团队合作与协调能力；有强烈责任感；\n');
INSERT INTO `t_jobdata` VALUES ('286', 'AI和大数据产品经理', '12-24k·15薪', '杭州', '宇视科技', 'https://www.liepin.com/job/1942516201.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=14&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=14', '杭州', '大数据', '12000.00', '24000.00', '18000.00', '岗位职责:\r\n1、 负责市场及用户研究，包括通过市场分析、竞品分析、用户研究等方法对用户需求进行挖掘和分析，识别客用户痛点和需求，发现创新或改进产品的潜在机会，并形成产品需求； \r\n2.、负责将用户/客户需求转化为研发需求，规划产品原型，协调及推动研发团队按时保质完成技术路线制定、产品实现、产品推广及生命周期管理，是视觉分析产品或大数据（数据仓库、数据清洗、数据分析）产品孵化、市场化及推广目标落地的第一负责人；\r\n3.、负责产品上市的筹备工作，锁定目标市场，梳理和建立项目样板和案例；\r\n4.、制定产品市场推广计划，负责推广材料的制作，落实宣贯、培训、推广工作；\r\n5、负责收集产品问题和需求，推动研发对产品问题进行分析和解决；\r\n6、负责产品的销售运营分析，分析业务变化态势，预测软件销售形势，为产品商业化成功负责；\r\n7、与团队密切合作，实现项目的进度、质量、成本的承诺目标；\r\n8、重大项目/重要客户/重要合作伙伴的阶段性沟通交流。\r\n任职资格:\r\n1、本科及以上学历，2年以上产品经理或解决方案或项目经理或研发或售前工作经验，具备相关行业产品经理经验或有管理平台产品相关工作经验者优先。计算机、软件工程、通信工程、电子等理工科相关专业优先；\r\n2、人工智能、大数据或解决方案基本功扎实，有安防行业、视频监控行业经验者优先；\r\n3、逻辑清晰，面对复杂问题能抓住要点和本质；善于沟通表达，能清晰输出观点；吃苦耐劳抗压性强；可接受出差；\r\n4、具备良好的团队合作精神和客户服务意识，有较强分析能力、逻辑思考能力、想象力以及协调、闭环能力；\r\n5、了解视频监控、人工智能、大数据在公安、政府（各部门）、司法、机场、地铁、高等教育、K12普教、企业园区、智能建筑一个或多个行业中的应用。');
INSERT INTO `t_jobdata` VALUES ('287', '大数据解决方案总监', '60-75k', '北京', '广联达', 'https://www.liepin.com/job/1948978177.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=15&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=15', '北京', '大数据', '60000.00', '75000.00', '67500.00', '职责描述：\n负责央企大客户和地方头部省建的大数据平台规划和建设、主数据咨询、数据标准、数据治理咨询。数据平台解决方案的设计与咨询。\n负责企业数据治理或数据中台的咨询和解决方案项目实施。\n\n任职要求：\n10年以上大数据相关工作经验；\n硕士及以上学历；\n有负责大型建企数据中台、大数据平台、数据治理、数据标准等项目咨询和项目实施的经验，\n有大型建企数据平台项目实施落地经验。学习能力强，抗压能力强，协调和沟通能力强。');
INSERT INTO `t_jobdata` VALUES ('288', '金融科技管理部-PaaS运维岗（大数据运维方向）', '25-40k', '武汉', '某武汉大型银行公司', 'https://www.liepin.com/a/39077175.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=16&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=16', '武汉', '大数据', '25000.00', '40000.00', '32500.00', '岗位职责：\n1、承担全行大数据平台的建设与维护工作\n2、承担全行大数据平台关键技术的攻关和推广应用\n3、实施全行大数据层面的安全策略，执行相关安全防范措施\n4、承担大数据层面的性能分析及优化，承担大数据层面故障的处理、分析与总结\n5、为信息科技部其他团队提供大数据层面的基础性技术支持\n6、协助建立、完善运行知识库\n7、完成领导交办的其它工作\n\n岗位要求：\n1、3年或以上大数据平台建设或运维经验，有银行大数据平台研发或运维经验优先');
INSERT INTO `t_jobdata` VALUES ('289', '大数据开发工程师', '15-20k·13薪', '武汉-江夏区', '光谷金信(武汉)科技有限公司', 'https://www.liepin.com/job/1950176527.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=17&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=17', '武汉', '大数据', '15000.00', '20000.00', '17500.00', '工作职责:\n1）熟悉hive、spark、flink、kafka、hbase、kylin等组件的应用开发，有相应的工作经验；\n2）参与离线数仓开发平台、实时数仓开发平台的搭建与开发工作；\n3）参与大数据离线计算集群、大数据实时计算集群等平台的性能改进、功能扩展、故障分析等工作；\n4）熟悉即席查询分析平台的开发工作；\n5）熟悉OLAP建模分析平台的开发工作；\n任职资格:\n1）计算机或相关专业，本科及以上学历，3年以上大数据开发工作经验；\n2）熟悉linux开发环境，熟悉shell脚本，熟练掌握Java/Python/Go语言中的一种；\n3）熟悉hive、spark、flink、kafka、hbase、kylin等大数据组件的技术原理和基本配置，有实际开发运维经验，能解决开发工作中的日常问题；\n4）擅长sql，熟悉mysql、oracle等数据库的使用；\n5）工作习惯良好，代码清晰整洁，积极主动有责任感，具备较好的沟通能力。');
INSERT INTO `t_jobdata` VALUES ('290', '高速增长公司的大数据及AI团队负责人', '100-150k·14薪', '深圳', '某知名公司', 'https://www.liepin.com/a/38238219.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=18&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=18', '深圳', '大数据', '100000.00', '150000.00', '125000.00', '职位描述\n工作职责:\n\n1、负责大数据团队整体工作，包含技术产品化开发、核心技术平台建设、前瞻性基础技术研究、对外合作与生态联盟建设等;\n\n2、负责人工智能与大数据技术在相应领域的应用产品、以及智慧类行业解决方案中的落地应用;\n\n3、负责人工智能与大数据前瞻性基础技术研究，布局新技术方向，储备未来重大技术，在学术研究方面取得行业制高点研究成果，技术产品化方面持续取得突破；\n\n4、负责整合内外部资源，拓展行业生态与合作联盟，强化公司在人工智能与大数据行业地位与影响力；\n\n5、负责人工智能与大数据中心人才队伍建设，在计算机视觉、图像处理、人机交互，以及未来新技术方向上引入高水平业务骨干；\n\n6、承接技术战略工作，包括但不限于：技术战略制定、事业计划编制、人工智能与大数据技术路线图，基础技术研究项目清单等；\n\n\n\n任职资格:\n\n1、硕士以上学历，数学、统计学、计算机软件等相关专业；\n\n2、具备人工智能/大数据头部企业5年以上大数据算法研究和技术落地产品开发管理工作经验\n\n3、有数字化团队管理经验，具备多年大数据行业头部企业数据分析/运营经验，并有通过数据分析项目大幅提升运营指标的案例；\n\n4、对相应领域内大数据常见的业务形态与商业模式有深入的理解，对业务变化有敏锐的洞察力;\n\n5、领导能力突出，具备强烈的责任意识，善于创新、思维敏捷、精力充沛，沟通能力强，有活力，有冲劲。\n期权是额外的');
INSERT INTO `t_jobdata` VALUES ('291', '大数据架构师', '30-50k', '北京-海淀区', '神州医疗', 'https://www.liepin.com/job/1951158009.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=19&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=19', '北京', '大数据', '30000.00', '50000.00', '40000.00', '职责描述：\n1、	参与医疗大数据产品整体架构规划，包括应用架构、技术架构、物理架构和数据架构等。\n2、	参与医疗大数据中台产品开发。\n3、	搭建基于Hudi的数据湖架构。\n4、	融合Hadoop体系、Flink体系、Spark体系，实现批流一体的数据湖产品。\n5、	负责指导工程师进行技术验证与实现，核心技术问题的攻关，解决项目开发过程中的技术难题。\n\n任职要求：\n1、本科以上学历，有互联网大厂工作经验，计算机及相关专业，有医疗行业经验者优先。\n2、5年以上大数据研发和架构相关工作经验。\n3、具有大数据中台架构设计经验，熟悉医疗数据调研方法。\n4、熟悉Hudi数据湖架构，精通数据湖的设计理念，有成功的企业级数据湖架构和实施经验，有医疗大数据治理经验者优先。\n5、精通Hadoop生态及高性能缓存相关的各种工具并有实战经验，包括但不限于hadoop/hive/spark/impala/elasticsearch/druid/redis/hbase/kafka/flume等，能够熟练安装、配置、部署和优化大型Hadoop集群系统。\n6、熟悉Flink开发设计和实施，精通Flink生态及相关的各种工具并有实战经验。\n7 熟悉java语言，有基于海量数据的大型分布式系统应用开发经验者优先，有linux平台及shell脚本开发经验者优先。 \n8.有超PB级别大数据处理实战经验，熟悉整个大数据的完整处理流程，包括数据的采集、清洗、预处理、存储、分析挖掘和数据可视化，以及架构设计、开发、部署、自动化运维等工作。\n');
INSERT INTO `t_jobdata` VALUES ('292', '大数据架构师', '35-60k·15薪', '北京', '傲林科技有限公司', 'https://www.liepin.com/job/1926723905.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=20&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=20', '北京', '大数据', '35000.00', '60000.00', '47500.00', '一、职责描述：\r\n1. 负责数据湖项目整体架构规划，包括应用架构、技术架构、物理架构和数据架构等；\r\n2. 负责指导工程师进行技术验证与实现，核心技术问题的攻关，解决项目开发过程中的技术难题；\r\n3. 根据项目业务需求，设计架构方案，撰写核心代码，并为系统提供性能调优、架构优化重组，解决关键问题和技术难题；\r\n4. 根据公司项目和业务发展特点，负责研究相关大数据前沿技术；\r\n5. 负责项目对外技术沟通，负责营造团队技术氛围，推动技术能力的沉淀；\r\n6. 持续挑战新的技术方向，攻克大数据量，高并发，高稳定性，易用性等各种技术难点。\r\n二、任职要求：\r\n1. 全日制本科以上学历，8年以上工作经验，其中5年以上大数据相关经验；\r\n2. 有丰富的大数据及服务端项目研发和架构经验；\r\n3. 精通Java、scala等主流编程语言，熟悉JVM原理及调优；\r\n4. 精通Hadoop生态及高性能缓存相关的各种工具并有实战经验， 有数据湖设计开发经验，熟悉GreenPlum者优先；熟悉Calcite者优先；\r\n5. 熟悉微服务(如SpringBoot)，熟悉开源服务框架(如Dubbo/Grpc)；\r\n6. 有超PB级别大数据处理实战经验，熟悉整个大数据的完整处理流程，包括数据的采集、清洗、预处理、存储、分析挖掘和数据可视化，以及架构设计、开发、部署、自动化运维等工作；\r\n7. 有优秀的业务理解能力，能理解清楚业务并进行合理的架构设计；\r\n8. 具有较强的沟通能力,工作态度积极主动、细致、有全局观，有较强的抗压能力，良好的团队合作意识。');
INSERT INTO `t_jobdata` VALUES ('293', '大数据PM', '17-22k·14薪', '沈阳-铁西区', '凯捷咨询(中国)有限公司', 'https://www.liepin.com/job/1950567761.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=21&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=21', '沈阳', '大数据', '17000.00', '22000.00', '19500.00', '技能要求:\n•较强的英语书面和口头沟通能力。\n•有大数据/数据分析项目经验。\n•具有领导开发技术交付团队提供服务的良好经验，具有汽车IT行业技术(大数据/数据分析)背景，擅长项目管理。\n•有全球合作IT项目经验，具有较强的沟通、协调和跨团队合作能力。\n•有敏捷方法论经验，并精通流行的敏捷工具，如JIRA/Confluence和其他敏捷工具链工具。\n•良好的演示和表达能力。\n•具有在全球分布的模式下，在动态和快节奏的环境中领导不同团队的经验。\n•具有管理项目和领导多学科设计和开发团队的经验。\n•有能力向产品负责人和功能团队以及其他相关的内部和外部合作伙伴确定并评估是否符合已同意的敏捷工作模型的强制性元素，向产品负责人升级，向功能团队和产品经理确定改进措施。');
INSERT INTO `t_jobdata` VALUES ('294', '解决方案经理：水务大数据', '12-22k·20薪', '上海-嘉定区', '威派格', 'https://www.liepin.com/job/1949315617.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=22&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=22', '上海', '大数据', '12000.00', '22000.00', '17000.00', '职责描述：\n岗位职责 ： \n1、通过各种形式（技术交流、方案宣讲、应用演示等）使客户了解方案的价值，与市场及销售团队一起深入了解客户的需求并出具针对性有竞争力的解决方案； \n2、精准分析客户需求，制定符合客户需求的整体解决方案，并能进行全面展示；\n3、掌握企业的市场策略和产品情况，配合市场人员进行针对性的技术支持；\n4、配合前期市场调研工作，协助销售团队完成地产系统及政府报告； \n5、持续收集用户反馈，分析用户行为及需求，不断优化、改进产品及服务，提升用户满意度；\n6、协助编制、修改公司关键业务审批活动权限表，协助组织公司各部门、各业务流程内部控制的年度风险自我评估工作。\n\n任职资格：\n1、本科以上学历，软件工程、网络工程、通信工程、电气自动化、给排水或相关专业优先；\n2、3年及以上IT行业、网络或者通信行业、系统自动化行业等系统集成相关领域售前支持的经验或者实施经验；\n3、熟悉大数据相关主流技术，有中大型企业大数据平台，数据中心，数据中台有相关项目经验优先&有过供水企业、自来水公司项目经验优先。\n4、有良好的技术综合方案能力和沟通表达能力；\n5、热爱技术，有钻研精神，爱学习，学习能力强。\n');
INSERT INTO `t_jobdata` VALUES ('295', '大数据开发工程师', '20-40k·15薪', '深圳', '华为', 'https://www.liepin.com/job/1950896131.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=23&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=23', '深圳', '大数据', '20000.00', '40000.00', '30000.00', '目前华为车业务发展迅速，和小康深度合作的问界M5六月突破7000，大定突破1万。发布的问界M7，发布后的4个小时订单更是突破2万，欢迎有志之士加入。\n\n工作内容：\n华为智能车联网云服务相关业务（热门风口行业，业务大发展中），从事车联网、大数据平台和大数据分析等云服务的设计与开发。\n新服务、新技术、新架构、业务极具创新性且有挑战，锻炼机会多多。\n\n\n技术要求：\n能够熟练使用以下一项或多项技术：\n云服务技术、微服务、Java开发、大数据（Kafka、HBase、Flink、Spark等）\n\n\n招聘类型和说明：招华为OD员工（除了配股这点有差异之外，工资奖金管理办公场地等与华为员工一致），与华为牛人共事，随业务快速发展而持续锻炼成长，值得选择！');
INSERT INTO `t_jobdata` VALUES ('296', '大数据开发工程师', '40-59k', '杭州-钱塘区', '浙江吉利控股集团', 'https://www.liepin.com/job/1947299523.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=24&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=24', '杭州', '大数据', '40000.00', '59000.00', '49500.00', '职责描述：\r\n1. 负责吉利品牌业务线数据的数仓模型设计、ETL任务开发，建立规范化、稳定可靠的数据体系； \r\n2.参与数据质量治理相关工作，提升易用性与数据质量，保证数据安全、稳定、可恢复； \r\n3. 深入业务，理解并合理抽象业务需求，发挥数据价值，与业务团队紧密合作；\r\n任职要求：\r\n1. 计算机、统计学、数学等相关专业本科以上学历。 \r\n2. 三年以上数据仓库建设、ETL相关开发经验，具备扎实的数据仓库与模型设计理论基础&工程能力。 \r\n3. 熟悉 Hive、Spark 底层原理，精通SQL 编程、性能调优，熟悉FineReport、quicBI的能BI工具优先 \r\n4.维度建模等对数据架构分层、数仓建设理论和实践经验扎实，做过用户画像标签、数据化运营类数据应用优先\r\n5. 熟悉一门或多门脚本研发语言，python、shell、R、php等，有面向对象研发经验优先，如java，c++等\r\n6.有过算法、深度学习经验优先，有过车联网、智能车等和车相关业务经验优先\r\n7. 良好的思维逻辑能力、语言表达能力、团队协作能力');
INSERT INTO `t_jobdata` VALUES ('297', '能源大数据总监', '45-75k·14薪', '北京-西城区', '某国内新能源公司', 'https://www.liepin.com/a/39108135.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=25&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=25', '北京', '大数据', '45000.00', '75000.00', '60000.00', '工作职责：\n1、理解能源行业客户的大数据需求、功能需求，基于能源大数据项目提供业务咨询、技术咨询、规划、设计、推广等专业服务。\n2、负责能源大数据产品售前解决方案工作。参与前期的项目交流、需求引导、产品介绍、方案设计等工作。 \n3、熟悉数据建模，数据安全，数据融合等数据应用业务，能够找到目标市场及客户，结合能源数据特点制定解决方案。\n4、持续关注和研究能源大数据行业政策动态、市场主流竞品公司和产品，协同产品和交付团队完善公司对应解决方案和产品线。\n5、对于项目需求，能够整合各种资源，快速包装解决方案。\n \n任职资格：\n1．博士，能力突出者可适当放宽至研究生，40周岁以下；\n2．熟悉能源大数据领域，有行业资源或客户开发能力；\n3．有敏锐的市场洞察力，较强的需求挖掘和分析应用能力。');
INSERT INTO `t_jobdata` VALUES ('298', '大数据算法工程师', '25-40k·15薪', '广州-黄埔区', '杰创智能科技股份有限公司', 'https://www.liepin.com/job/1944687305.shtml?d_sfrom=search_prime&d_ckId=32304bf2ca39e91fec6499d869498284&d_curPage=7&d_pageSize=40&d_headId=32304bf2ca39e91fec6499d869498284&d_posi=26&skId=r580jevo7r1fgzy7buotnl2g0abn7una&fkId=r580jevo7r1fgzy7buotnl2g0abn7una&ckId=k1wem40t50k5idm6no5ffmo88cjr9zp8&sfrom=search_job_pc&curPage=7&pageSize=40&index=26', '广州', '大数据', '25000.00', '40000.00', '32500.00', '岗位职责：\r\n1、负责大数据算法研究、设计、开发与测试；\r\n2、支撑实现关联拟合、用户画像、趋势分析、搜索推荐、深度学习等业务功能；\r\n3、能根据实际业务需求，抽取特征，构建模型，并进行相关性能指标的调优，解决业务需求，驱动业务创新；\r\n岗位要求：\r\n1、全日制本科及以上学历，计算机，数字，统计学，自动 化等相关专业，至少5年以上相关工作经验；\r\n2、熟悉常用的机器学习和数据挖掘原理和算法，如分类，聚类，回归，协调过滤；有大规模机器学习优化项目经验优先，有相关深度学习模型应用经验优先；\r\n3、掌握运用Hadoop，Spark，Flink等开源平台对大规模数据进行处理和计算的开发能力；');
